(7, 1, 2, 'Złącza do taśm LED umożliwiają prosty i szybki montaż oświetlenia, bez konieczności lutowania. Złącze stałe połączy dwie taśmy LED pod dowolnym kątem.', '', 'zlaczka-do-tasm-led-rgbw-12mm-goldlux', '', '', '', 'Złączka do taśm LED RGBW 12mm Goldlux', '', '', '', ''),
(8, 1, 1, 'Sterownik mini Tuya WiFi do taśm LED RGBW 5pin daje możliwość sterowania taśmą z dowolnego miejsca za pomocą sieci WiFi 2,5GHz; wbudowany mikrofon; wyłącznik czasowy; aplikacja muzyczna; ściemnianie, zmiana barw. Możemy zaplanować pracę taśmy LED np.. stopniowe ściemnianie lub rozjaśnianie barwy o wyznaczonej godzinie. Automatyczne wyłączanie światła po doliczeniu zadanego czasu. Możemy dostosować jasność i temperaturę barwową w trybie białego światła, w trybie światła kolorowego, można zmienić na jakikolwiek kolor RGB oraz dostosować jasność i nasycenie. Sterowanie przez osobę trzecią.', '', 'sterownik-mini-tuya-bialy-rgbw-12-24-v-goldlux', '', '', '', 'Sterownik Mini Tuya biały RGBW 12-24 V Goldlux', '', '', '', ''),
(8, 1, 2, 'Sterownik mini Tuya WiFi do taśm LED RGBW 5pin daje możliwość sterowania taśmą z dowolnego miejsca za pomocą sieci WiFi 2,5GHz; wbudowany mikrofon; wyłącznik czasowy; aplikacja muzyczna; ściemnianie, zmiana barw. Możemy zaplanować pracę taśmy LED np.. stopniowe ściemnianie lub rozjaśnianie barwy o wyznaczonej godzinie. Automatyczne wyłączanie światła po doliczeniu zadanego czasu. Możemy dostosować jasność i temperaturę barwową w trybie białego światła, w trybie światła kolorowego, można zmienić na jakikolwiek kolor RGB oraz dostosować jasność i nasycenie. Sterowanie przez osobę trzecią.', '', 'sterownik-mini-tuya-bialy-rgbw-12-24-v-goldlux', '', '', '', 'Sterownik Mini Tuya biały RGBW 12-24 V Goldlux', '', '', '', ''),
