(11, 1, 2, 'Złącza do taśm LED umożliwiają prosty i szybki montaż oświetlenia, bez konieczności lutowania. Złącze stałe połączy dwie taśmy LED w lini prostej.', '', 'zlacze-do-tasm-led-rgbw-12-mm-goldlux', '', '', '', 'Złącze do taśm LED RGBW 12 mm Goldlux', '', '', '', ''),
(12, 1, 1, 'Sterownik mini Tuya do taśm LED pomaga sterować jednokolorowmi taśmami za pomocą WiFi z dowolnego miejsca. Posiada funkcje: Schedule: wyłącznik czasowy, włączanie i wyłączanie światła o określonych porach; Left Time: automatyczne włączenie światła po odliczaniu zadanego czasu; oraz tryb \"nie przeszkadzać\' gdy zasilaie jest włączone. Aby włączyć światło z poziomu aplikacji, zasilanie musi być włączone dwa razy z rzędu.   INTERFEJS - możesz dostosować jasność świecenia taśmy LED.   SCENY - dostępność różnych trybów, możwiwość wybrania preferowanego trybu lub stworzenie indywidualnego. Możliwość sterowania przez osobę trzecią poprzez jej dodanie zgodnie ze wskazówkami w aplikacji.', '', 'sterownik-mini-tuya-bialy-12-24-v-ip20-goldlux', '', '', '', 'Sterownik Mini Tuya biały 12-24 V IP20 Goldlux', '', '', '', ''),
(12, 1, 2, 'Sterownik mini Tuya do taśm LED pomaga sterować jednokolorowmi taśmami za pomocą WiFi z dowolnego miejsca. Posiada funkcje: Schedule: wyłącznik czasowy, włączanie i wyłączanie światła o określonych porach; Left Time: automatyczne włączenie światła po odliczaniu zadanego czasu; oraz tryb \"nie przeszkadzać\' gdy zasilaie jest włączone. Aby włączyć światło z poziomu aplikacji, zasilanie musi być włączone dwa razy z rzędu.   INTERFEJS - możesz dostosować jasność świecenia taśmy LED.   SCENY - dostępność różnych trybów, możwiwość wybrania preferowanego trybu lub stworzenie indywidualnego. Możliwość sterowania przez osobę trzecią poprzez jej dodanie zgodnie ze wskazówkami w aplikacji.', '', 'sterownik-mini-tuya-bialy-12-24-v-ip20-goldlux', '', '', '', 'Sterownik Mini Tuya biały 12-24 V IP20 Goldlux', '', '', '', ''),
(13, 1, 1, 'Włącznik dotykowy ze ściemniaczem czarny do jednokolorowych taśm led 12-24V. Oświetlenie włącza i wyłącza się poprzez dotknięcie palcem przycisku. Dłuższe przytrzymanie reguluje jasność oświetlenia. Moc zmanionowa produktu: 12V 2A = 24W / 24V 2A = 48W.', '', 'wlacznik-dotykowy-ze-sciemniaczem-czarny-12-24-v-ip20-goldlux', '', '', '', 'Włącznik dotykowy ze ściemniaczem czarny 12-24 V IP20 Goldlux', '', '', '', ''),
(13, 1, 2, 'Włącznik dotykowy ze ściemniaczem czarny do jednokolorowych taśm led 12-24V. Oświetlenie włącza i wyłącza się poprzez dotknięcie palcem przycisku. Dłuższe przytrzymanie reguluje jasność oświetlenia. Moc zmanionowa produktu: 12V 2A = 24W / 24V 2A = 48W.', '', 'wlacznik-dotykowy-ze-sciemniaczem-czarny-12-24-v-ip20-goldlux', '', '', '', 'Włącznik dotykowy ze ściemniaczem czarny 12-24 V IP20 Goldlux', '', '', '', ''),
(14, 1, 1, 'Włącznik dotykowy ze ściemniaczem biały do jednokolorowych taśm led 12-24V. Oświetlenie włącza i wyłącza się poprzez dotknięcie palcem przycisku. Dłuższe przytrzymanie reguluje jasność oświetlenia. Moc zmanionowa produktu: 12V 2A = 24W / 24V 2A = 48W.', '', 'wlacznik-dotykowy-ze-sciemniaczem-bialy-12-24-v-goldlux', '', '', '', 'Włącznik dotykowy ze ściemniaczem biały 12-24 V Goldlux', '', '', '', ''),
(14, 1, 2, 'Włącznik dotykowy ze ściemniaczem biały do jednokolorowych taśm led 12-24V. Oświetlenie włącza i wyłącza się poprzez dotknięcie palcem przycisku. Dłuższe przytrzymanie reguluje jasność oświetlenia. Moc zmanionowa produktu: 12V 2A = 24W / 24V 2A = 48W.', '', 'wlacznik-dotykowy-ze-sciemniaczem-bialy-12-24-v-goldlux', '', '', '', 'Włącznik dotykowy ze ściemniaczem biały 12-24 V Goldlux', '', '', '', ''),
(15, 1, 1, 'Włącznik dotykowy ze ściemniaczem do zabudowy do jednokolorowych taśm led 12-24V. Oświetlenie włącza i wyłącza się poprzez dotknięcie palcem przycisku. Dłuższe przytrzymanie reguluje jasność oświetlenia. Średnica otworu montażowego 17mm. Moc zmanionowa produktu: 12V 3A = 36W / 24V 3A = 72W.', '', 'wlacznik-dotykowy-mini-12-24-v-ip20-goldlux', '', '', '', 'Włącznik dotykowy mini 12-24 V IP20 Goldlux', '', '', '', ''),
(15, 1, 2, 'Włącznik dotykowy ze ściemniaczem do zabudowy do jednokolorowych taśm led 12-24V. Oświetlenie włącza i wyłącza się poprzez dotknięcie palcem przycisku. Dłuższe przytrzymanie reguluje jasność oświetlenia. Średnica otworu montażowego 17mm. Moc zmanionowa produktu: 12V 3A = 36W / 24V 3A = 72W.', '', 'wlacznik-dotykowy-mini-12-24-v-ip20-goldlux', '', '', '', 'Włącznik dotykowy mini 12-24 V IP20 Goldlux', '', '', '', ''),
(16, 1, 1, 'Podtynkowy włącznik dotykowy ze ściemniaczem do taśm LED RGBW 12-24V 4-kanałowy z puszką montażową w zestawie. Urządzenie służy do łatwego i szybkiego zarządzania matężeniem światła. Możliwość podłączenia wielu taśm o łącznej mocy nie przekraczającej 192W (dla 12V) i 384W (dla 24V).', '', 'wlacznik-dotykowy-ze-sciemniaczem-12-24-v-rgbw-goldlux', '', '', '', 'Włącznik dotykowy ze ściemniaczem 12-24 V RGBW Goldlux', '', '', '', ''),
(16, 1, 2, 'Podtynkowy włącznik dotykowy ze ściemniaczem do taśm LED RGBW 12-24V 4-kanałowy z puszką montażową w zestawie. Urządzenie służy do łatwego i szybkiego zarządzania matężeniem światła. Możliwość podłączenia wielu taśm o łącznej mocy nie przekraczającej 192W (dla 12V) i 384W (dla 24V).', '', 'wlacznik-dotykowy-ze-sciemniaczem-12-24-v-rgbw-goldlux', '', '', '', 'Włącznik dotykowy ze ściemniaczem 12-24 V RGBW Goldlux', '', '', '', ''),
(17, 1, 1, 'Praktyczny zestaw: pilot + mini sterownik do taśm LED RGB+W 12-24V, 6A, 2,4GHz. Do zdalnego sterowania oświetleniem LED w pomieszczeniu. Pilot radiowy z wieloma funkcjami jak: dowolny wybór koloru z koła barw; skokowe zmiany barw i odcieni; automatyczne zapętlone odtwarzanie trybów.  Wymiary: pilot 11x5,2x2,3 cm / sterownik 32,2x1,4x1,03 cm.', '', 'pilot-i-sterownik-rgbw-12-24-v-ip20-goldlux', '', '', '', 'Pilot i sterownik RGBW 12-24 V IP20 Goldlux', '', '', '', ''),
(17, 1, 2, 'Praktyczny zestaw: pilot + mini sterownik do taśm LED RGB+W 12-24V, 6A, 2,4GHz. Do zdalnego sterowania oświetleniem LED w pomieszczeniu. Pilot radiowy z wieloma funkcjami jak: dowolny wybór koloru z koła barw; skokowe zmiany barw i odcieni; automatyczne zapętlone odtwarzanie trybów.  Wymiary: pilot 11x5,2x2,3 cm / sterownik 32,2x1,4x1,03 cm.', '', 'pilot-i-sterownik-rgbw-12-24-v-ip20-goldlux', '', '', '', 'Pilot i sterownik RGBW 12-24 V IP20 Goldlux', '', '', '', ''),
(18, 1, 1, 'Praktyczny zestaw: pilot + mini sterownik do taśm LED RGB+W 5-24V, 12A, 433MHz. Do zdalnego sterowania oświetleniem LED w pomieszczeniu. Pilot radiowy z wieloma funkcjami jak: dowolny wybór koloru z koła barw; skokowe zmiany barw i odcieni; automatyczne zapętlone odtwarzanie trybów.  Wymiary: pilot 8,5x4x0,6 cm / sterownik 32,2x1,4x1,03 cm.', '', 'pilot-i-sterownik-mono-5-24-v-ip20-goldlux', '', '', '', 'Pilot i sterownik Mono 5-24 V IP20 Goldlux', '', '', '', ''),
(18, 1, 2, 'Praktyczny zestaw: pilot + mini sterownik do taśm LED RGB+W 5-24V, 12A, 433MHz. Do zdalnego sterowania oświetleniem LED w pomieszczeniu. Pilot radiowy z wieloma funkcjami jak: dowolny wybór koloru z koła barw; skokowe zmiany barw i odcieni; automatyczne zapętlone odtwarzanie trybów.  Wymiary: pilot 8,5x4x0,6 cm / sterownik 32,2x1,4x1,03 cm.', '', 'pilot-i-sterownik-mono-5-24-v-ip20-goldlux', '', '', '', 'Pilot i sterownik Mono 5-24 V IP20 Goldlux', '', '', '', ''),
(19, 1, 1, 'Zestaw: Gniazdo i wtyczka 2pin do taśm led 10mm 12-24V. Złacze pozwala połączyć przewód z dowolnym urządzeniem zakończonym gniazdem DC. Aby zamontować wtyczkę wystarczy odizolować przewody, włożyc je i trwale skręcić w odpowiednich zaciskach. Oferowane złącze znajduje zastosowanie jako: podłączenie urządzeń z zasilaczami zakończonymi gniazdem DC, przedłużanie przewodów zasilających, złaczka do montażu taśm LED oraz wiele innych.', '', 'gniazdo-i-wtyczka-ip20-12-24-v-goldlux', '', '', '', 'Gniazdo i wtyczka IP20 12-24 V Goldlux', '', '', '', ''),
(19, 1, 2, 'Zestaw: Gniazdo i wtyczka 2pin do taśm led 10mm 12-24V. Złacze pozwala połączyć przewód z dowolnym urządzeniem zakończonym gniazdem DC. Aby zamontować wtyczkę wystarczy odizolować przewody, włożyc je i trwale skręcić w odpowiednich zaciskach. Oferowane złącze znajduje zastosowanie jako: podłączenie urządzeń z zasilaczami zakończonymi gniazdem DC, przedłużanie przewodów zasilających, złaczka do montażu taśm LED oraz wiele innych.', '', 'gniazdo-i-wtyczka-ip20-12-24-v-goldlux', '', '', '', 'Gniazdo i wtyczka IP20 12-24 V Goldlux', '', '', '', ''),
(20, 1, 1, 'Podtynkowy włącznik dotykowy ze ściemniaczem do taśm LED jednokolorowych 12-24V 4-kanałowy z puszką montażową w zestawie. Urządzenie służy do łatwego i szybkiego zarządzania matężeniem światła. Możliwość podłączenia wielu taśm o łącznej mocy nie przekraczającej 144W (dla 12V) i 288W (dla 24V).', '', 'wlacznik-dotykowy-ze-sciemniaczem-12-24-v-goldlux', '', '', '', 'Włącznik dotykowy ze ściemniaczem 12-24 V Goldlux', '', '', '', ''),
