(38, 1, 1, 'Taśmy LED „Movaled” to  5-metrowy zestaw samoprzylepny który można dostosować w zależności od preferencji: funkcjonalne białe oświetlenie 4000 K lub oświetlenie wielokolorowe. Dzięki dołączonemu pilotowi zdalnego sterowania można stworzyć własną atmosferę! Taśmę można zginać w celu umieszczenia w narożnikach. Jasna taśma świetlna (350 lumenów na metr) może być przycinana co 10 cm. Zestaw sprzedawany jest z transformatorem i zasilaczem, 2 złączami i 1 pilotem.', '', 'tasma-led-zestaw-5-m-175-lm-05-m-rgbw-inspire', '', '', '', 'Taśma LED zestaw 5 m 175 lm/0.5 m RGBW Inspire', '', '', '', ''),
