(39, 1, 2, 'Srebrny kątowy profil o długości 1 metra idealnie nada dekoracyjnego charakteru instalacji listwowej. Pozwala na wykończenie projektu oświetlenia listwowego. Profil zapewnia jednorodne i rozproszone oświetlenie w zależności od wybranej taśmy. Profil narożny ma tę szczególną cechę, że dopasowuje się do kształtu miejsca montażu, wtapiając się w ścianę lub meble.', '', 'profil-aluminiowy-narozny-do-tasm-led-dl-1-m-oslona-mleczna-inspire', '', '', '', 'Profil aluminiowy narożny do taśm LED dł. 1 m osłona mleczna Inspire', '', '', '', ''),
(40, 1, 1, 'Taśma Flex LED to 5-metrowa samoprzylepna taśma, którą łatwo zamontować w wybranym pomieszczeniu. Dzięki dołączonemu pilotowi można zmieniać kolor, tworzyć nastrój za pomocą 15 kolorów, 4 zaprogramowanych scenariuszy, a także zmieniać natężenie światła. Taśmę można przycinać co 10 cm. Zestaw ten sprzedawany jest z transformatorem, pilotem i przełącznikiem.', '', 'zestaw-tasma-led-ip20-5-m-rgb-inspire', '', '', '', 'Zestaw taśma LED IP20 5 m RGB Inspire', '', '', '', ''),
(40, 1, 2, 'Taśma Flex LED to 5-metrowa samoprzylepna taśma, którą łatwo zamontować w wybranym pomieszczeniu. Dzięki dołączonemu pilotowi można zmieniać kolor, tworzyć nastrój za pomocą 15 kolorów, 4 zaprogramowanych scenariuszy, a także zmieniać natężenie światła. Taśmę można przycinać co 10 cm. Zestaw ten sprzedawany jest z transformatorem, pilotem i przełącznikiem.', '', 'zestaw-tasma-led-ip20-5-m-rgb-inspire', '', '', '', 'Zestaw taśma LED IP20 5 m RGB Inspire', '', '', '', ''),
