(46, 1, 1, 'Profil aluminiowy C narożny o kącie nachylenia taśmy/listwy LED równym 45 stopni. Jeden z najbardziej minimalistycznych i nowoczesnych projektów. Świetnie nadający się do designerskich połączeń dwóch prostopadłych powierzchni oraz wszędzie tam, gdzie konieczne jest skierowanie światła wychodzącego z profilu pod kątem 45 stopni. W zestawie znajdują się: klosz mleczny, uchwyty montażowe i zaślepki.', '', 'profil-aluminiowy-do-tasm-led-typ-c-narozny-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP C narożny dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(46, 1, 2, 'Profil aluminiowy C narożny o kącie nachylenia taśmy/listwy LED równym 45 stopni. Jeden z najbardziej minimalistycznych i nowoczesnych projektów. Świetnie nadający się do designerskich połączeń dwóch prostopadłych powierzchni oraz wszędzie tam, gdzie konieczne jest skierowanie światła wychodzącego z profilu pod kątem 45 stopni. W zestawie znajdują się: klosz mleczny, uchwyty montażowe i zaślepki.', '', 'profil-aluminiowy-do-tasm-led-typ-c-narozny-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP C narożny dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(47, 1, 1, 'PROFILO C SET-FR, jest profilem do LED-owych taśm o szerokości max 10 mm. To kątowy profil dekoracyjno-oświetleniowy, przeznaczony do oświetlenia meblowego, wnęk, półek oraz do montażu kątowego przy suficie. Wykonany z wysokiej jakości aluminium anodowanego. Konstrukcja profilu, w zależności od upodobań, pozwala uzyskać kąt świecenia 30° lub 60°. Profil ma długość 1 m i posiada w komplecie szybkę szronioną, a także zaślepki, które pozwalają zamknąć profil z dwóch stron, oraz uchwyty montażowe. PROFILO to znakomite zabezpieczenie taśm LED przed mechanicznymi uszkodzeniami, co w znacznej mierze przedłuży ich  żywotność, w porównaniu z zamontowaniem taśmy bezpośrednio do podłoża.', '', 'profil-do-tasmy-led-profilo-c-set-fr-narozny-1-m-zaslepki-kanlux', '', '', '', 'Profil do taśmy LED PROFILO C SET-FR narożny 1 m + zaślepki KANLUX', '', '', '', ''),
(47, 1, 2, 'PROFILO C SET-FR, jest profilem do LED-owych taśm o szerokości max 10 mm. To kątowy profil dekoracyjno-oświetleniowy, przeznaczony do oświetlenia meblowego, wnęk, półek oraz do montażu kątowego przy suficie. Wykonany z wysokiej jakości aluminium anodowanego. Konstrukcja profilu, w zależności od upodobań, pozwala uzyskać kąt świecenia 30° lub 60°. Profil ma długość 1 m i posiada w komplecie szybkę szronioną, a także zaślepki, które pozwalają zamknąć profil z dwóch stron, oraz uchwyty montażowe. PROFILO to znakomite zabezpieczenie taśm LED przed mechanicznymi uszkodzeniami, co w znacznej mierze przedłuży ich  żywotność, w porównaniu z zamontowaniem taśmy bezpośrednio do podłoża.', '', 'profil-do-tasmy-led-profilo-c-set-fr-narozny-1-m-zaslepki-kanlux', '', '', '', 'Profil do taśmy LED PROFILO C SET-FR narożny 1 m + zaślepki KANLUX', '', '', '', ''),
(48, 1, 1, 'PROFILO B SET-FR to najmniejszy, nawierzchniowy profil aluminiowy o szerokości 12,2 mm, przeznaczony do najbardziej popularnych taśm LED-owych o szerokości max 8 mm. Wykonany z wysokiej jakości aluminium anodowanego. Wykorzystywany do tworzenia dekoracyjno-oświetleniowych aranżacji. Profil o długości 1 m posiada w komplecie szybkę szronioną, a także zaślepki, które pozwalają zamknąć profil z dwóch stron, oraz uchwyty montażowe. Profil sprawdzi się jako dodatkowe oświetlenie korytarza, schodów a także jako oświetlenie meblowe.  PROFILO to znakomite zabezpieczenie taśm LED przed mechanicznymi uszkodzeniami, co w znacznej mierze przedłuży ich  żywotność, w porównaniu z zamontowaniem taśmy bezpośrednio do podłoża.', '', 'profil-do-tasmy-led-profilo-b-set-fr-1-m-kanlux', '', '', '', 'Profil do taśmy LED PROFILO B SET-FR 1 m KANLUX', '', '', '', ''),
(48, 1, 2, 'PROFILO B SET-FR to najmniejszy, nawierzchniowy profil aluminiowy o szerokości 12,2 mm, przeznaczony do najbardziej popularnych taśm LED-owych o szerokości max 8 mm. Wykonany z wysokiej jakości aluminium anodowanego. Wykorzystywany do tworzenia dekoracyjno-oświetleniowych aranżacji. Profil o długości 1 m posiada w komplecie szybkę szronioną, a także zaślepki, które pozwalają zamknąć profil z dwóch stron, oraz uchwyty montażowe. Profil sprawdzi się jako dodatkowe oświetlenie korytarza, schodów a także jako oświetlenie meblowe.  PROFILO to znakomite zabezpieczenie taśm LED przed mechanicznymi uszkodzeniami, co w znacznej mierze przedłuży ich  żywotność, w porównaniu z zamontowaniem taśmy bezpośrednio do podłoża.', '', 'profil-do-tasmy-led-profilo-b-set-fr-1-m-kanlux', '', '', '', 'Profil do taśmy LED PROFILO B SET-FR 1 m KANLUX', '', '', '', ''),
(49, 1, 1, 'PROFILO D SET-FR to nawierzchniowy profil aluminiowy o szerokości 20 mm, przeznaczony do najbardziej popularnych taśm LED-owych o szerokości max 10 mm. Wykonany z wysokiej jakości aluminium anodowanego. Wykorzystywany do tworzenia dekoracyjno-oświetleniowych aranżacji. Profil o długości 1 m posiada w komplecie szybkę szronioną, a także zaślepki, które pozwalają zamknąć profil z dwóch stron, oraz uchwyty montażowe. Profil sprawdzi się jako dodatkowe oświetlenie korytarza, schodów a także jako oświetlenie meblowe.  PROFILO to znakomite zabezpieczenie taśm LED przed mechanicznymi uszkodzeniami, co w znacznej mierze przedłuży ich  żywotność, w porównaniu z zamontowaniem taśmy bezpośrednio do podłoża.', '', 'profil-do-tasmy-led-profilo-d-set-frz-zaslepkami-1-m-matowy-kanlux', '', '', '', 'Profil do taśmy LED PROFILO D SET-FRz zaślepkami 1 m matowy KANLUX', '', '', '', ''),
(49, 1, 2, 'PROFILO D SET-FR to nawierzchniowy profil aluminiowy o szerokości 20 mm, przeznaczony do najbardziej popularnych taśm LED-owych o szerokości max 10 mm. Wykonany z wysokiej jakości aluminium anodowanego. Wykorzystywany do tworzenia dekoracyjno-oświetleniowych aranżacji. Profil o długości 1 m posiada w komplecie szybkę szronioną, a także zaślepki, które pozwalają zamknąć profil z dwóch stron, oraz uchwyty montażowe. Profil sprawdzi się jako dodatkowe oświetlenie korytarza, schodów a także jako oświetlenie meblowe.  PROFILO to znakomite zabezpieczenie taśm LED przed mechanicznymi uszkodzeniami, co w znacznej mierze przedłuży ich  żywotność, w porównaniu z zamontowaniem taśmy bezpośrednio do podłoża.', '', 'profil-do-tasmy-led-profilo-d-set-frz-zaslepkami-1-m-matowy-kanlux', '', '', '', 'Profil do taśmy LED PROFILO D SET-FRz zaślepkami 1 m matowy KANLUX', '', '', '', ''),
(50, 1, 1, 'Taśmy Led COB 24V o barwie 4000K, elastyczna, to doskonałe rozwiązanie w oświetleniu i dekoracji pomieszczeń. Łączą w sobie wysoką wydajność światła przy minimalnym zużyciu energii. Dzięki niewielkim rozmiarom i dużej elestyczności mogą być stosowane praktycznie w każdym miejscu, gdzie utrudniony jest montaż innych źródeł światła.', '', 'tasma-led-tasma-5-m-3250-lm-neutralna-biel-sanico', '', '', '', 'Taśma LED Taśma 5 m 3250 lm Neutralna biel Sanico', '', '', '', ''),
(50, 1, 2, 'Taśmy Led COB 24V o barwie 4000K, elastyczna, to doskonałe rozwiązanie w oświetleniu i dekoracji pomieszczeń. Łączą w sobie wysoką wydajność światła przy minimalnym zużyciu energii. Dzięki niewielkim rozmiarom i dużej elestyczności mogą być stosowane praktycznie w każdym miejscu, gdzie utrudniony jest montaż innych źródeł światła.', '', 'tasma-led-tasma-5-m-3250-lm-neutralna-biel-sanico', '', '', '', 'Taśma LED Taśma 5 m 3250 lm Neutralna biel Sanico', '', '', '', ''),
(51, 1, 1, 'Twinkly Flex to inteligentna, przypominająca neon, elastyczna tuba LED o długości 2 m. Sterowana za pomocą aplikacji i asystentów głosowych. Twinkly Flex można dowolnie kształtować. Podobnie jak wszystkie produkty Twinkly, każdą pojedynczą diodą LED Flex można sterować indywidualnie, co pozwala tworzyć i odtwarzać unikalne efekty, poziomy natężenia i animacje kolorów. Opatentowane narzędzie do mapowania Twinkly wykorzystuje kamerę smartfona do zlokalizowania kształtu i dokładnej pozycji każdego centymetra Twinkly Flex, niezależnie od tego, jak go ułożysz. Wszystkie efekty można w pełni dostosować: jasność, szybkość, intensywność i kolor można modyfikować jednym dotknięciem. Próbnik kolorów pomaga wybrać idealny odcień spośród ponad 16 milionów opcji. Zegar ON/OFF i ogólny ściemniacz uzupełniają panel sterowania, zapewniając nieograniczone możliwości tworzenia idealnej dekoracji świetlnej. Flex można łączyć z innymi urządzeniami Twinkly, aby tworzyć większe, zsynchronizowane instalacje oświetleniowe. Twinkly Flex może być używany w połączeniu z Twinkly Music, małym urządzeniem USB (sprzedawanym oddzielnie). Twinkly Flex współpracuje z asystentem głosowym, takimi jak Hey Google i Amazon Alexa, a także Apple HomeKit, Homey i Razer Chroma™ RGB za pośrednictwem Twinkly Chroma Connector, aby poprawić wrażenia z gry dzięki oszałamiającym efektom świetlnym, które reagują na rozgrywkę. Kompatybilny z Bluetooth® i Wi-Fi. Twinkly Flex ma certyfikat IP20, nadaje się tylko do użytku w pomieszczeniach.', '', 'tasma-led-flex-ip20-912-lm-2-m-rgb-twinkly', '', '', '', 'Taśma LED Flex IP20 912 lm 2 m RGB Twinkly', '', '', '', ''),
(51, 1, 2, 'Twinkly Flex to inteligentna, przypominająca neon, elastyczna tuba LED o długości 2 m. Sterowana za pomocą aplikacji i asystentów głosowych. Twinkly Flex można dowolnie kształtować. Podobnie jak wszystkie produkty Twinkly, każdą pojedynczą diodą LED Flex można sterować indywidualnie, co pozwala tworzyć i odtwarzać unikalne efekty, poziomy natężenia i animacje kolorów. Opatentowane narzędzie do mapowania Twinkly wykorzystuje kamerę smartfona do zlokalizowania kształtu i dokładnej pozycji każdego centymetra Twinkly Flex, niezależnie od tego, jak go ułożysz. Wszystkie efekty można w pełni dostosować: jasność, szybkość, intensywność i kolor można modyfikować jednym dotknięciem. Próbnik kolorów pomaga wybrać idealny odcień spośród ponad 16 milionów opcji. Zegar ON/OFF i ogólny ściemniacz uzupełniają panel sterowania, zapewniając nieograniczone możliwości tworzenia idealnej dekoracji świetlnej. Flex można łączyć z innymi urządzeniami Twinkly, aby tworzyć większe, zsynchronizowane instalacje oświetleniowe. Twinkly Flex może być używany w połączeniu z Twinkly Music, małym urządzeniem USB (sprzedawanym oddzielnie). Twinkly Flex współpracuje z asystentem głosowym, takimi jak Hey Google i Amazon Alexa, a także Apple HomeKit, Homey i Razer Chroma™ RGB za pośrednictwem Twinkly Chroma Connector, aby poprawić wrażenia z gry dzięki oszałamiającym efektom świetlnym, które reagują na rozgrywkę. Kompatybilny z Bluetooth® i Wi-Fi. Twinkly Flex ma certyfikat IP20, nadaje się tylko do użytku w pomieszczeniach.', '', 'tasma-led-flex-ip20-912-lm-2-m-rgb-twinkly', '', '', '', 'Taśma LED Flex IP20 912 lm 2 m RGB Twinkly', '', '', '', ''),
(52, 1, 1, 'Samoprzylepna taśma LED o długości 1,5 metra posiada ciepłe białe światło o barwie 3000 K, które zapewni przyjemne, dekoracyjne oświetlenie w pomieszczeniu. Taśmę świetlną (190 lumenów na metr) można przycinać co 12,5 cm. Taśma sprzedawana jest w zestawie z transformatorem i przełącznikiem.', '', 'zestaw-tasma-led-ip20-15-m-ciepla-biel', '', '', '', 'Zestaw taśma LED IP20 1.5 m Ciepła biel', '', '', '', ''),
(52, 1, 2, 'Samoprzylepna taśma LED o długości 1,5 metra posiada ciepłe białe światło o barwie 3000 K, które zapewni przyjemne, dekoracyjne oświetlenie w pomieszczeniu. Taśmę świetlną (190 lumenów na metr) można przycinać co 12,5 cm. Taśma sprzedawana jest w zestawie z transformatorem i przełącznikiem.', '', 'zestaw-tasma-led-ip20-15-m-ciepla-biel', '', '', '', 'Zestaw taśma LED IP20 1.5 m Ciepła biel', '', '', '', ''),
