(97, 1, 1, 'Elastyczna taśma LED COB 2m doskonałe sprawdzi się do oświatlenia mebli, witryn sklepowych, reklam oraz do dekoracji mieszkań. Łączy w sobie wysokoą wydajność światła przy minimalnym zużyciu energii elektrycznej. Dzięki niewielkim wymiarom i bardzo dużej elastyczności mogą być stosowane praktycznie w każdym miejscu, gdzie utrudniony jest montaż innych źródeł śwaitła.', '', 'tasma-led-cob-neutralna-biel-ip20-1850-lm-2-m-goldlux', '', '', '', 'Taśma LED Cob Neutralna biel IP20 1850 lm 2 m Goldlux', '', '', '', ''),
