(98, 1, 1, 'Zasilacz stałonapięciowy przeznaczony jest do oświetlenia LED, m.in. pojedyńczych diod, listew, taśm Led, żarówek i modułów. Cechuje się stałym napięciem wyjściowym niezależnym od dopuszczalnego obciążenia. IP67 daje nam możliwość podłączenia zailacza w każdym pomieszczeniu naszego domu.', '', 'zasilacz-stalonapieciowy-24v-100-w-do-ip67-led-goldlux', '', '', '', 'Zasilacz stałonapięciowy 24V 100 W do IP67 LED Goldlux', '', '', '', ''),
