(101, 1, 1, 'Nadaj kolor wnętrzu swojego domu! Produkt stanowi przedłużenie taśmy Yeelight 1S, dzięki czemu wypełnisz pomieszczenie 16 mln barw RGB. Akcesorium wraz z 1S zapewnia łącznie 11 m taśmy LED. Jest podatna na wyginanie, dzięki czemu dopasujesz jej ułożenie do własnych potrzeb. Z powodzeniem umieścisz ją za telewizorem, komputerem, nad łóżkiem, itp. Aplikacja oferuje szereg efektów świetlnych do wyboru. Za jej pośrednictwem możesz ustawiać gotowe kompozycje, wybierając je w zależności od obecnego nastroju i okazji. Istnieje też możliwość zsynchronizowania muzyki lub gry (Razer Chroma RGB), dla jeszcze lepszych wrażeń immersyjnych. Kompatybilność z Amazon Alexa, Apple HomeKit, Google Home oraz Samsung SmartThings pozwala na wygodną obsługę za pomocą komend głosowych. Montaż akcesorium ułatwia taśma samoprzylepna.', '', 'tasma-led-przedluzacz-1-m-rgb-ip65-yeelight', '', '', '', 'Taśma LED przedłużacz 1 m RGB IP65 Yeelight', '', '', '', ''),
