(107, 1, 1, 'Twinkly Extension służy do przedłużania Twinkly Line m do całkowitej długości 3 m', '', 'tasma-led-line-ip20-430-lm-15-m-rgb-twinkly', '', '', '', 'Taśma LED Line IP20 430 lm 1.5 m RGB Twinkly', '', '', '', ''),
(107, 1, 2, 'Twinkly Extension służy do przedłużania Twinkly Line m do całkowitej długości 3 m', '', 'tasma-led-line-ip20-430-lm-15-m-rgb-twinkly', '', '', '', 'Taśma LED Line IP20 430 lm 1.5 m RGB Twinkly', '', '', '', ''),
(108, 1, 1, 'Twinkly Line to inteligentna taśma LED, którą można sterować za pomocą aplikacji i asystentów głosowych. Całkowita długość 1,5 m (z możliwością przedłużenia do 3 m). Przylepna, magnetyczna, całkowicie czarna. Świetnie prezentuje się, niezależnie od tego, czy jest schowana za szafką, czy zainstalowana na widoku. Podobnie jak wszystkie produkty Twinkly, każdą pojedynczą diodą LED Line można sterować indywidualnie, co pozwala tworzyć i odtwarzać unikalne efekty, poziomy natężenia i animacje kolorów. Opatentowane narzędzie do mapowania Twinkly wykorzystuje kamerę smartfona, aby zlokalizować dokładną pozycję każdej diody LED w przestrzeni. Wszystkie efekty można w pełni dostosować: jasność, szybkość, intensywność i kolor można modyfikować jednym dotknięciem. Próbnik kolorów pomaga wybrać idealny odcień spośród ponad 16 milionów opcji. Zegar ON/OFF i ogólny ściemniacz uzupełniają panel sterowania, zapewniając nieograniczone możliwości tworzenia idealnej dekoracji świetlnej. Twinkly LINE można łączyć z innymi urządzeniami Twinkly, tworząc większe, zsynchronizowane instalacje świetlne. Twinkly Line może być używany w połączeniu z Twinkly Music, małym urządzeniem USB (sprzedawanym osobno). Twinkly Line można przedłużyć do całkowitej długości 3 m za pomocą zestawu Twinkly Line Extension, sprzedawanego osobno. Współpracuje z asystentem głosowym, Hey Google i Amazon Alexa, a także Apple HomeKit, Homey i Razer Chroma™ RGB za pośrednictwem złącza Twinkly Chroma Connector, aby poprawić wrażenia z gry dzięki oszałamiającym efektom świetlnym, które reagują na rozgrywkę. Kompatybilne z Bluetooth® i Wi-Fi. Linia Twinkly ma certyfikat IP20, nadaje się tylko do użytku w pomieszczeniach.', '', 'tasma-led-line-ip20-430-lm-15-m-rgb-twinkly', '', '', '', 'Taśma LED Line IP20 430 lm 1.5 m RGB Twinkly', '', '', '', ''),
(108, 1, 2, 'Twinkly Line to inteligentna taśma LED, którą można sterować za pomocą aplikacji i asystentów głosowych. Całkowita długość 1,5 m (z możliwością przedłużenia do 3 m). Przylepna, magnetyczna, całkowicie czarna. Świetnie prezentuje się, niezależnie od tego, czy jest schowana za szafką, czy zainstalowana na widoku. Podobnie jak wszystkie produkty Twinkly, każdą pojedynczą diodą LED Line można sterować indywidualnie, co pozwala tworzyć i odtwarzać unikalne efekty, poziomy natężenia i animacje kolorów. Opatentowane narzędzie do mapowania Twinkly wykorzystuje kamerę smartfona, aby zlokalizować dokładną pozycję każdej diody LED w przestrzeni. Wszystkie efekty można w pełni dostosować: jasność, szybkość, intensywność i kolor można modyfikować jednym dotknięciem. Próbnik kolorów pomaga wybrać idealny odcień spośród ponad 16 milionów opcji. Zegar ON/OFF i ogólny ściemniacz uzupełniają panel sterowania, zapewniając nieograniczone możliwości tworzenia idealnej dekoracji świetlnej. Twinkly LINE można łączyć z innymi urządzeniami Twinkly, tworząc większe, zsynchronizowane instalacje świetlne. Twinkly Line może być używany w połączeniu z Twinkly Music, małym urządzeniem USB (sprzedawanym osobno). Twinkly Line można przedłużyć do całkowitej długości 3 m za pomocą zestawu Twinkly Line Extension, sprzedawanego osobno. Współpracuje z asystentem głosowym, Hey Google i Amazon Alexa, a także Apple HomeKit, Homey i Razer Chroma™ RGB za pośrednictwem złącza Twinkly Chroma Connector, aby poprawić wrażenia z gry dzięki oszałamiającym efektom świetlnym, które reagują na rozgrywkę. Kompatybilne z Bluetooth® i Wi-Fi. Linia Twinkly ma certyfikat IP20, nadaje się tylko do użytku w pomieszczeniach.', '', 'tasma-led-line-ip20-430-lm-15-m-rgb-twinkly', '', '', '', 'Taśma LED Line IP20 430 lm 1.5 m RGB Twinkly', '', '', '', ''),
(109, 1, 1, 'Elastyczna w funkcjonalności taśma LED doskonale sprawdzi się jako oświetlenie pomocnicze lub nastrojowe w każdej przestrzeni. Zmieniaj jej kolor, natężenie świetlne lub zsynchronizuj z odtwarzaną muzyką i ciesz się zmieniającą się atmosferą Twojego domu. Taśma jest niezwykle łatwa w montażu - jest samoprzylepna i bardzo elastyczna, przez co dopasuje się kształtem do każdej powierzchni, a dzięki dostępnemu przedłużeniu Yeelight możesz łączyć do 10 m długości taśmy na jednym zasilaczu. Taśma LED Yeelight jest również gratką dla graczy. Dzięki synchronizacji z Razer Chroma cały pokój może odtwarzać kolory widoczne przez Ciebie na ekranie. Wczuj się jeszcze mocniej w rozgrywkę i niech aura Twojego pokoju niesie Cię do zwycięstwa.', '', 'tasma-led-rgb-ip65-2m-yeelight', '', '', '', 'Taśma LED RGB IP65 2m Yeelight', '', '', '', ''),
(109, 1, 2, 'Elastyczna w funkcjonalności taśma LED doskonale sprawdzi się jako oświetlenie pomocnicze lub nastrojowe w każdej przestrzeni. Zmieniaj jej kolor, natężenie świetlne lub zsynchronizuj z odtwarzaną muzyką i ciesz się zmieniającą się atmosferą Twojego domu. Taśma jest niezwykle łatwa w montażu - jest samoprzylepna i bardzo elastyczna, przez co dopasuje się kształtem do każdej powierzchni, a dzięki dostępnemu przedłużeniu Yeelight możesz łączyć do 10 m długości taśmy na jednym zasilaczu. Taśma LED Yeelight jest również gratką dla graczy. Dzięki synchronizacji z Razer Chroma cały pokój może odtwarzać kolory widoczne przez Ciebie na ekranie. Wczuj się jeszcze mocniej w rozgrywkę i niech aura Twojego pokoju niesie Cię do zwycięstwa.', '', 'tasma-led-rgb-ip65-2m-yeelight', '', '', '', 'Taśma LED RGB IP65 2m Yeelight', '', '', '', ''),
(110, 1, 1, 'Zestaw od marki Blaupunkt to oświetlenie do aranżacji szaf, szuflad czy garderoby. Zasilana bateryjnie taśma LED z naturalną barwą światła dekoruje mebel i jednocześnie ułatwia wieczorne przeszukiwanie zawartości szaf. Taśma LED Blaupunkt to doskonała propozycja do odświeżenia wyglądu mebli oraz całego pomieszczenia. Taśma LED Blaupunkt jest dedykowana do szaf i innego rodzaju umeblowania. Jej funkcjonalność podnosi wyposażenie w czujnik ruchu PIR. To właśnie on jest odpowiedzialny za włączenie światła, gdy tylko otworzysz szufladę. Barwa światła w temperaturze 4000K jest najbardziej zbliżona do światła dziennego. Taka barwa doskonale sprawdza się we wszelkich dekoracjach. Neutralne światło pobudza kreatywność i sprawia, że oświetlany obiekt, a także całe pomieszczenie prezentuje się nowocześniej. Mimo, że szafy są zazwyczaj suche i bezpieczne może się zdarzyć, że coś w ich okolicy się rozleje bądź ilość kurzu gwałtownie się podniesie. Klasa szczelności IP65 gwarantuje niezmienne działanie w takich warunkach.', '', 'tasma-led-1-m-180-lm-neutralna-biel-blaupunkt', '', '', '', 'Taśma LED 1 m 180 lm Neutralna biel Blaupunkt', '', '', '', ''),
(110, 1, 2, 'Zestaw od marki Blaupunkt to oświetlenie do aranżacji szaf, szuflad czy garderoby. Zasilana bateryjnie taśma LED z naturalną barwą światła dekoruje mebel i jednocześnie ułatwia wieczorne przeszukiwanie zawartości szaf. Taśma LED Blaupunkt to doskonała propozycja do odświeżenia wyglądu mebli oraz całego pomieszczenia. Taśma LED Blaupunkt jest dedykowana do szaf i innego rodzaju umeblowania. Jej funkcjonalność podnosi wyposażenie w czujnik ruchu PIR. To właśnie on jest odpowiedzialny za włączenie światła, gdy tylko otworzysz szufladę. Barwa światła w temperaturze 4000K jest najbardziej zbliżona do światła dziennego. Taka barwa doskonale sprawdza się we wszelkich dekoracjach. Neutralne światło pobudza kreatywność i sprawia, że oświetlany obiekt, a także całe pomieszczenie prezentuje się nowocześniej. Mimo, że szafy są zazwyczaj suche i bezpieczne może się zdarzyć, że coś w ich okolicy się rozleje bądź ilość kurzu gwałtownie się podniesie. Klasa szczelności IP65 gwarantuje niezmienne działanie w takich warunkach.', '', 'tasma-led-1-m-180-lm-neutralna-biel-blaupunkt', '', '', '', 'Taśma LED 1 m 180 lm Neutralna biel Blaupunkt', '', '', '', ''),
(111, 1, 1, 'W zestawie taśm LED do telewizora znajdują się dwie taśmy LED o długości 45 cm. Oświetlenie LED do telewizora niesie za sobą szereg korzyści, nie tylko wizualnych. Stosując wysokiej jakości taśmy ledowe do oświetlenia telewizora nie tylko zyskamy przyjemny klimat, zadbamy także o oczy i poprawimy jakość obrazu z telewizora. Wysoka klasa szczelności poprawia możliwości zastosowania taśm LED. Dzięki wysokiej wodoodporności IP65 można zastosować taśmy LED Blaupunkt w miejscach, gdzie pojawia się ryzyko wystąpienia wilgoci. Klasa ochrony IP65 oznacza również większą odporność na kurz i pył oraz ochronę przed dostaniem się do części niebezpiecznych drutem. Barwa naturalna (4000 K) oscyluje pomiędzy światłem ciepłym a zimnym, jest neutralna i zbliżona do światła słonecznego. Światło o barwie białej naturalnej nie wpływa na barwę przedmiotów w otoczeniu. W nowoczesnych przestrzeniach mieszkalnych, przede wszystkim utrzymanych w białej stylistyce sprawdza się doskonale. Taśma LED w tej barwie bardzo dobrze nada się jako oświetlenie telewizora.', '', 'tasma-led-ip65-90-cm-400-lm-neutralna-biel-blaupunkt', '', '', '', 'Taśma LED IP65 90 cm 400 lm Neutralna biel Blaupunkt', '', '', '', ''),
(111, 1, 2, 'W zestawie taśm LED do telewizora znajdują się dwie taśmy LED o długości 45 cm. Oświetlenie LED do telewizora niesie za sobą szereg korzyści, nie tylko wizualnych. Stosując wysokiej jakości taśmy ledowe do oświetlenia telewizora nie tylko zyskamy przyjemny klimat, zadbamy także o oczy i poprawimy jakość obrazu z telewizora. Wysoka klasa szczelności poprawia możliwości zastosowania taśm LED. Dzięki wysokiej wodoodporności IP65 można zastosować taśmy LED Blaupunkt w miejscach, gdzie pojawia się ryzyko wystąpienia wilgoci. Klasa ochrony IP65 oznacza również większą odporność na kurz i pył oraz ochronę przed dostaniem się do części niebezpiecznych drutem. Barwa naturalna (4000 K) oscyluje pomiędzy światłem ciepłym a zimnym, jest neutralna i zbliżona do światła słonecznego. Światło o barwie białej naturalnej nie wpływa na barwę przedmiotów w otoczeniu. W nowoczesnych przestrzeniach mieszkalnych, przede wszystkim utrzymanych w białej stylistyce sprawdza się doskonale. Taśma LED w tej barwie bardzo dobrze nada się jako oświetlenie telewizora.', '', 'tasma-led-ip65-90-cm-400-lm-neutralna-biel-blaupunkt', '', '', '', 'Taśma LED IP65 90 cm 400 lm Neutralna biel Blaupunkt', '', '', '', ''),
(112, 1, 1, 'Zasilacz LED o mocy 72 W znajdzie wiele zastosowań. Duża moc urządzenia pozwala na połączenie ze sobą taśm o łącznej mocy do 72 W. Zasilacz LED do taśm może być stosowany wyłącznie ze źródłami światła opartymi na diodach elektroluminescencyjnych. Dzięki wysokiej sprawności zasilacza 72 W (ponad 90) pobierana z sieci energetycznej energia jest niemal w całości wykorzystywana. Zasilacz do taśm 72 W może być stosowany wyłącznie wewnątrz pomieszczeń. Nie jest to model do zastosowań na zewnątrz. Użytkowanie zasilacza w sposób do tego przeznaczony zagwarantuje jego długie i prawidłowe działanie. Zakres temperatur, w jakich może pracować zasilacz LED Blaupunkt zawiera się w granicach -20 do 45°C. Dzięki wysokiej jakości urządzeń, marka Blaupunkt mogła zaoferować aż trzy lata gwarancji na swoje produkty. Zasilacz posiada certyfikaty CE oraz TUV.', '', 'zasilacz-do-led-12-v-72-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 72 W IP20 Blaupunkt', '', '', '', ''),
(112, 1, 2, 'Zasilacz LED o mocy 72 W znajdzie wiele zastosowań. Duża moc urządzenia pozwala na połączenie ze sobą taśm o łącznej mocy do 72 W. Zasilacz LED do taśm może być stosowany wyłącznie ze źródłami światła opartymi na diodach elektroluminescencyjnych. Dzięki wysokiej sprawności zasilacza 72 W (ponad 90) pobierana z sieci energetycznej energia jest niemal w całości wykorzystywana. Zasilacz do taśm 72 W może być stosowany wyłącznie wewnątrz pomieszczeń. Nie jest to model do zastosowań na zewnątrz. Użytkowanie zasilacza w sposób do tego przeznaczony zagwarantuje jego długie i prawidłowe działanie. Zakres temperatur, w jakich może pracować zasilacz LED Blaupunkt zawiera się w granicach -20 do 45°C. Dzięki wysokiej jakości urządzeń, marka Blaupunkt mogła zaoferować aż trzy lata gwarancji na swoje produkty. Zasilacz posiada certyfikaty CE oraz TUV.', '', 'zasilacz-do-led-12-v-72-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 72 W IP20 Blaupunkt', '', '', '', ''),
(113, 1, 1, 'Zasilacz LED marki Blaupunkt należy stosować z taśmami o napięciu 12 V i mocy łącznej 60 W. Sprawność energetyczna w przypadku zasilacza LED Blaupunkt wynosi ponad 90. Energia nie zostaje zmarnowana i jest zużywana niemal całkowicie przy jej niewielkiej stracie. Zasilacz do taśm marki Blaupunkt przeznaczony jest do używania wewnątrz. Dopuszczalny zakres temperatury, w jakiej może pracować zasilacz, to -20 do 45 stopni C. Urządzenie przeznaczone jest do lamp z diodami LED. Wysoką jakość zasilacza 60W Blaupunkt potwierdzają certyfikaty CE i TÜV. Model jest zgodny z dyrektywą unijną 2014/30/EU oraz z dyrektywą niskonapięciową 2014/35/UE. Producent zasilacza LED udziela na niego aż 36 miesięcy gwarancji.', '', 'zasilacz-do-led-12-v-60-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 60 W IP20 Blaupunkt', '', '', '', ''),
(113, 1, 2, 'Zasilacz LED marki Blaupunkt należy stosować z taśmami o napięciu 12 V i mocy łącznej 60 W. Sprawność energetyczna w przypadku zasilacza LED Blaupunkt wynosi ponad 90. Energia nie zostaje zmarnowana i jest zużywana niemal całkowicie przy jej niewielkiej stracie. Zasilacz do taśm marki Blaupunkt przeznaczony jest do używania wewnątrz. Dopuszczalny zakres temperatury, w jakiej może pracować zasilacz, to -20 do 45 stopni C. Urządzenie przeznaczone jest do lamp z diodami LED. Wysoką jakość zasilacza 60W Blaupunkt potwierdzają certyfikaty CE i TÜV. Model jest zgodny z dyrektywą unijną 2014/30/EU oraz z dyrektywą niskonapięciową 2014/35/UE. Producent zasilacza LED udziela na niego aż 36 miesięcy gwarancji.', '', 'zasilacz-do-led-12-v-60-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 60 W IP20 Blaupunkt', '', '', '', ''),
(114, 1, 1, 'Zasilacz LED marki Blaupunkt umożliwia połączenie taśm LED o łącznej mocy do 20W. Zasilacz działa ze źródłami światła o napięciu 12V. Dzięki zastosowanym materiałom oraz procesowi produkcyjnemu, zasilacz LED 12V Blaupunkt jest odporny na kurz. Zasilacz przystosowany jest do użycia wewnętrznego. Zastosowana została izolacja podstawowa oraz dodatkowa, dzięki czemu nie jest konieczne połączenie urządzenia z przewodami uziemiającymi. Produkt objęty jest 3-letnią gwarancją. W produkcji została zastosowana separacja galwaniczna zwiększająca bezpieczeństwo produktu i obniżająca jego awaryjność. Zasilacz posiada certyfikaty CE oraz TUV.', '', 'zasilacz-do-led-12-v-20-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 20 W IP20 Blaupunkt', '', '', '', ''),
(114, 1, 2, 'Zasilacz LED marki Blaupunkt umożliwia połączenie taśm LED o łącznej mocy do 20W. Zasilacz działa ze źródłami światła o napięciu 12V. Dzięki zastosowanym materiałom oraz procesowi produkcyjnemu, zasilacz LED 12V Blaupunkt jest odporny na kurz. Zasilacz przystosowany jest do użycia wewnętrznego. Zastosowana została izolacja podstawowa oraz dodatkowa, dzięki czemu nie jest konieczne połączenie urządzenia z przewodami uziemiającymi. Produkt objęty jest 3-letnią gwarancją. W produkcji została zastosowana separacja galwaniczna zwiększająca bezpieczeństwo produktu i obniżająca jego awaryjność. Zasilacz posiada certyfikaty CE oraz TUV.', '', 'zasilacz-do-led-12-v-20-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 20 W IP20 Blaupunkt', '', '', '', ''),
(115, 1, 1, 'Zasilacz do taśm LED marki Blaupunkt jest dedykowany źródłom światła o napięciu 12V. Zasilacz Blaupunkt można połączyć z taśmami LED o łącznej mocy do 12W. Klasa szczelności IP20 zapewnia ochronę przed kurzem. Wysoka jakość zasilacza 12W Blaupunkt skłoniła producenta do udzielenia aż 3 letniej gwarancji na produkt. Jakość produktu potwierdzają certyfikaty bezpieczeństwa CE i TÜV.', '', 'zasilacz-do-led-12-v-12-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 12 W IP20 Blaupunkt', '', '', '', ''),
(115, 1, 2, 'Zasilacz do taśm LED marki Blaupunkt jest dedykowany źródłom światła o napięciu 12V. Zasilacz Blaupunkt można połączyć z taśmami LED o łącznej mocy do 12W. Klasa szczelności IP20 zapewnia ochronę przed kurzem. Wysoka jakość zasilacza 12W Blaupunkt skłoniła producenta do udzielenia aż 3 letniej gwarancji na produkt. Jakość produktu potwierdzają certyfikaty bezpieczeństwa CE i TÜV.', '', 'zasilacz-do-led-12-v-12-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 12 W IP20 Blaupunkt', '', '', '', ''),
(116, 1, 1, 'Zasilacz LED marki Blaupunkt jest przeznaczony do pracy z źródłami światła o napięciu 12V. Dzięki zasilaczowi Blaupunkta można połączyć taśmy LED o łącznej mocy do 40W. Zasilacz LED marki Blaupunkt cechuje wysoka sprawność energetyczna, która pozwala na prawie całkowite zużycie pobranej energii. Zasilacz LED 12V Blaupunkt jest przeznaczony do stosowania wewnątrz budynków. Dzięki szczelności IP20 zasilacz posiada odporność przed kurzem. Producent udziela 3 letniej gwarancji na produkt; o wysokiej jakości zasilacza świadczy separacja galwaniczna oraz certyfikaty bezpieczeństwa CE i TUV.', '', 'zasilacz-do-led-12-v-40-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 40 W IP20 Blaupunkt', '', '', '', ''),
(116, 1, 2, 'Zasilacz LED marki Blaupunkt jest przeznaczony do pracy z źródłami światła o napięciu 12V. Dzięki zasilaczowi Blaupunkta można połączyć taśmy LED o łącznej mocy do 40W. Zasilacz LED marki Blaupunkt cechuje wysoka sprawność energetyczna, która pozwala na prawie całkowite zużycie pobranej energii. Zasilacz LED 12V Blaupunkt jest przeznaczony do stosowania wewnątrz budynków. Dzięki szczelności IP20 zasilacz posiada odporność przed kurzem. Producent udziela 3 letniej gwarancji na produkt; o wysokiej jakości zasilacza świadczy separacja galwaniczna oraz certyfikaty bezpieczeństwa CE i TUV.', '', 'zasilacz-do-led-12-v-40-w-ip20-blaupunkt', '', '', '', 'Zasilacz do LED 12 V 40 W IP20 Blaupunkt', '', '', '', ''),
(117, 1, 1, 'Przedłuż kolorową taśmę oświetleniową WiZ (zestaw startowy sprzedawany oddzielnie) za pomocą tego metrowego przedłużacza maksymalnie do długości 10 metrów. Po prostu przyklej elastyczną taśmę oświetleniową do dowolnej powierzchni. Po podłączeniu do Wi-Fi masz do dyspozycji 16 milionów kolorów i możliwość regulacji barwy białej od ciepłej do światła dziennego.', '', 'tasma-led-przedluzacz-1-m-800-lm-cct-dim-rgbw-wiz', '', '', '', 'Taśma LED przedłużacz 1 m 800 lm CCT DIM RGBW WIZ', '', '', '', '');
