(117, 1, 2, 'Przedłuż kolorową taśmę oświetleniową WiZ (zestaw startowy sprzedawany oddzielnie) za pomocą tego metrowego przedłużacza maksymalnie do długości 10 metrów. Po prostu przyklej elastyczną taśmę oświetleniową do dowolnej powierzchni. Po podłączeniu do Wi-Fi masz do dyspozycji 16 milionów kolorów i możliwość regulacji barwy białej od ciepłej do światła dziennego.', '', 'tasma-led-przedluzacz-1-m-800-lm-cct-dim-rgbw-wiz', '', '', '', 'Taśma LED przedłużacz 1 m 800 lm CCT DIM RGBW WIZ', '', '', '', ''),
(118, 1, 1, 'Dzięki naszej kolorowej taśmie WiZ LED zainstalujesz w swoim domu źródło pięknego światła dekoracyjnego. Po prostu przyklej elastyczną taśmę do dowolnej powierzchni — w kasetonach sufitowych lub pod szafkami. W zestawie startowym znajduje się 2-metrowa taśma oświetleniowa, sterownik i zasilacz — nie jest wymagany żaden dodatkowy sprzęt. Można łatwo przyciąć do odpowiedniej długości i przedłużać do 10 m (przedłużacz sprzedawany oddzielnie). Po podłączeniu do Wi-Fi masz do dyspozycji 16 milionów kolorów i możliwość regulacji barwy białej od ciepłej do światła dziennego.', '', 'tasma-led-zestaw-2-m-1600-lm-cct-dim-rgbw-wiz', '', '', '', 'Taśma LED zestaw 2 m 1600 lm CCT DIM RGBW WIZ', '', '', '', ''),
(118, 1, 2, 'Dzięki naszej kolorowej taśmie WiZ LED zainstalujesz w swoim domu źródło pięknego światła dekoracyjnego. Po prostu przyklej elastyczną taśmę do dowolnej powierzchni — w kasetonach sufitowych lub pod szafkami. W zestawie startowym znajduje się 2-metrowa taśma oświetleniowa, sterownik i zasilacz — nie jest wymagany żaden dodatkowy sprzęt. Można łatwo przyciąć do odpowiedniej długości i przedłużać do 10 m (przedłużacz sprzedawany oddzielnie). Po podłączeniu do Wi-Fi masz do dyspozycji 16 milionów kolorów i możliwość regulacji barwy białej od ciepłej do światła dziennego.', '', 'tasma-led-zestaw-2-m-1600-lm-cct-dim-rgbw-wiz', '', '', '', 'Taśma LED zestaw 2 m 1600 lm CCT DIM RGBW WIZ', '', '', '', ''),
