(122, 1, 1, 'Elastyczne taśmy LED to doskonałe rozwiązanie w oświetleniu mebli, witryn sklepowych, reklam oraz w dekoracji pomieszczeń. Łączą w sobie wysoką wydajność światła przy minimalnym zużyciu energii elektrycznej. Dzięki niewielkim rozmiarom i bardzo dużej elastyczności mogą być stosowane praktycznie w każdym miejscu, gdzie utrudniony jest montaż innych źródeł światła. Zastosowanie taśm LED ograniczone jest jedynie wyobraźnią.', '', 'tasma-led-rgb-ip65-zasilacz-i-pilot-5-m-polux', '', '', '', 'Taśma LED RGB IP65 + zasilacz i pilot 5 m POLUX', '', '', '', ''),
