(128, 1, 1, 'Zasilacz LED przeznaczony do montażu taśm LED oraz innych ledowych źródeł światła jak żarówki czy moduły wymagających napięcia 12V. Zasilacz wykonany jest z najwyższej jakości materiałów dzięki czemu wykazuje się wysoką wydajnością oraz długą żywotnością. Zasialcz charakteryzuję się wysokim współczynnikiem szczelności IP67 dzięki czemu może być stosowany w miejscach, w których istnieje ryzyko pracy przy dużej wilgotności jak np. kuchnia czy łazienka oraz do zasilania instalacji na zewnątrz budynków.', '', 'zasilacz-do-led-12v-60w-ip67-eko-light', '', '', '', 'Zasilacz do LED 12V 60W IP67 EKO-LIGHT', '', '', '', ''),
