(136, 1, 2, 'Profil A czarny aluminiowy do taśm LED 1M - zestaw', '', 'profil-do-tasmy-led-natynkowy-1-m-czarny-zaslepki-polux', '', '', '', 'Profil do taśmy LED natynkowy 1 m czarny + zaślepki POLUX', '', '', '', ''),
(137, 1, 1, 'Taśma LED RGB do podświetlania np. telewizorów plus kontroler. Za pomoca kontrolera (przycisk: MODE/DEMO) można ustawić jeden z dziewiętnastu trybów dynamicznych, oraz można zmienić szybkość trybów, do wyboru jest dziewięć szybkości. Przycisk COLOR służy do wyboru jednego z dwudziestu kolorów, w tym trybie przyciskiem SPEED można zmienić stopień jasności kolorów, do wyboru jest osiem stopni jasności. Środkowy przycisk służy do włączenia i wyłaczenia paska. Pasek wyłacza sie po wyłączeniu telewizora. Po ponownym właczeniu, pasek ustawia się w ostatnim używanym trybie (pamięć ostatniego ustawienia).', '', 'tasma-led-tv-rgb-ip65-2-x-50-cm-tv-usb-polux', '', '', '', 'Taśma LED TV RGB IP65 2 x 50 cm TV USB POLUX', '', '', '', ''),
(137, 1, 2, 'Taśma LED RGB do podświetlania np. telewizorów plus kontroler. Za pomoca kontrolera (przycisk: MODE/DEMO) można ustawić jeden z dziewiętnastu trybów dynamicznych, oraz można zmienić szybkość trybów, do wyboru jest dziewięć szybkości. Przycisk COLOR służy do wyboru jednego z dwudziestu kolorów, w tym trybie przyciskiem SPEED można zmienić stopień jasności kolorów, do wyboru jest osiem stopni jasności. Środkowy przycisk służy do włączenia i wyłaczenia paska. Pasek wyłacza sie po wyłączeniu telewizora. Po ponownym właczeniu, pasek ustawia się w ostatnim używanym trybie (pamięć ostatniego ustawienia).', '', 'tasma-led-tv-rgb-ip65-2-x-50-cm-tv-usb-polux', '', '', '', 'Taśma LED TV RGB IP65 2 x 50 cm TV USB POLUX', '', '', '', ''),
