(139, 1, 1, 'Taśma LED 28W, 5m, IP65 barwa światła naturalna biała. Elastyczne taśmy LED to doskonałe rozwiązanie w oświetleniu mebli, witryn sklepowych, reklam oraz w dekoracji pomieszczeń. Łączą w sobie wysoką wydajność światła przy minimalnym zużyciu energii elektrycznej. Dzięki niewielkim rozmiarom i bardzo dużej elastyczności mogą być stosowane praktycznie w każdym miejscu, gdzie utrudniony jest montaż innych źródeł światła.', '', 'tasma-led-ip65-420-lm-m-5-m-barwa-neutralna-polux', '', '', '', 'Taśma LED IP65 420 lm/m 5 m barwa neutralna POLUX', '', '', '', ''),
