(147, 1, 1, 'Pasek LED COB to idealne oświetlenie mieszkania odpowiadające różnym potrzebom. Produkt wykonany jest z PCB i silikonu, pozwala na dokładne oświetlenie wybranych obszarów pomieszczenia. Zastosowana technologia pozwala na uzyskanie jednolitej linii świetlnej dzięki czemu wnętrze nabierze nowoczesnego charakteru. Pasek COD doskonale sprawdzi się jako dodatkowe źródło światła.', '', 'tasma-led-cob-5-m-425-lm-ciepla-biel', '', '', '', 'Taśma LED COB 5 m 425 lm Ciepła biel', '', '', '', ''),
