(150, 1, 1, 'Profil D to profil napowierzchniowy zaprojektowany pod montaż taśm LED w trudno dostępnych miejscach. Ze względu na swoje wymiary, stanowi podstawę do uzyskania maksymalnej ilości światła, przy minimalnej wielkości profilu. Doskonale nadaje się do stosowania jako element podświetleń dekoracyjnych w meblarstwie oraz wykończeniach wnętrz. W zestawie znajdują się: klosz mleczny, uchwyty montażowe i zaślepki.', '', 'profil-aluminiowy-do-tasm-led-typ-d-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP D dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(150, 1, 2, 'Profil D to profil napowierzchniowy zaprojektowany pod montaż taśm LED w trudno dostępnych miejscach. Ze względu na swoje wymiary, stanowi podstawę do uzyskania maksymalnej ilości światła, przy minimalnej wielkości profilu. Doskonale nadaje się do stosowania jako element podświetleń dekoracyjnych w meblarstwie oraz wykończeniach wnętrz. W zestawie znajdują się: klosz mleczny, uchwyty montażowe i zaślepki.', '', 'profil-aluminiowy-do-tasm-led-typ-d-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP D dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(151, 1, 1, 'Profil typ G, wpuszczany. Zaprojektowany z myślą o oświetleniu pomieszczeń kuchennych i sklepowych. Świetnie pasuje do montażu wewnątrz szaf, blatów i schodów. W zestawie znajduje się: klosz mleczny', '', 'profil-aluminiowy-do-tasm-led-typ-g-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP G dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(151, 1, 2, 'Profil typ G, wpuszczany. Zaprojektowany z myślą o oświetleniu pomieszczeń kuchennych i sklepowych. Świetnie pasuje do montażu wewnątrz szaf, blatów i schodów. W zestawie znajduje się: klosz mleczny', '', 'profil-aluminiowy-do-tasm-led-typ-g-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP G dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(152, 1, 1, 'Profil Z to profil stworzony specjalnie pod montaż w bardzo trudno dostępnych miejscach. Zastosowanie tego profilu nie wymaga wykonania głębokiego frezu, gdyż profil jest niezwykle niski. Cechuje go modernistyczny wygląd oraz łatwość montażu dzięki specjalnie wyprofilowanym ściankom profilu, które idealnie wpasowują się we frez. Doskonale nadaje się do stosowania jako element podświetleń dekoracyjnych w meblarstwie oraz wykończeniach wnętrz.', '', 'profil-aluminiowy-do-tasm-led-typ-z-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP Z dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(152, 1, 2, 'Profil Z to profil stworzony specjalnie pod montaż w bardzo trudno dostępnych miejscach. Zastosowanie tego profilu nie wymaga wykonania głębokiego frezu, gdyż profil jest niezwykle niski. Cechuje go modernistyczny wygląd oraz łatwość montażu dzięki specjalnie wyprofilowanym ściankom profilu, które idealnie wpasowują się we frez. Doskonale nadaje się do stosowania jako element podświetleń dekoracyjnych w meblarstwie oraz wykończeniach wnętrz.', '', 'profil-aluminiowy-do-tasm-led-typ-z-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP Z dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(153, 1, 1, 'Profil aluminiowy Y przeznaczony do montażu napowierzchniowego. Jest to produkt innowacyjny na rynku oświetleniowym. Jeden z najbardziej minimalistycznych i nowoczesnych projektów. Niezwykle ciekawy i nowoczesny design profilu Y pozwala wyjść naprzeciw potrzeb klientom jakie niesie zastosowanie taśm LED w tworzeniu linii świetlnych.Dzięki podwyższeniu wymiaru bocznych ścianek profilu uzyskujemy jednolite, bardziej ukierunkowane światło bez widocznych diod LED (przy zastosowaniu przesłony mlecznej). Profil zachowuje wrażenie dyskretnej oprawy do taśm LED oraz doskonale nadaje się do podświetleń dekoracyjnych w meblarstwie i przy wykończeniach wnętrz. W zestawie znajdują się: klosz mleczny, uchwyty montażowe i zaślepki.', '', 'profil-aluminiowy-do-tasm-led-typ-y-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP Y dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
(153, 1, 2, 'Profil aluminiowy Y przeznaczony do montażu napowierzchniowego. Jest to produkt innowacyjny na rynku oświetleniowym. Jeden z najbardziej minimalistycznych i nowoczesnych projektów. Niezwykle ciekawy i nowoczesny design profilu Y pozwala wyjść naprzeciw potrzeb klientom jakie niesie zastosowanie taśm LED w tworzeniu linii świetlnych.Dzięki podwyższeniu wymiaru bocznych ścianek profilu uzyskujemy jednolite, bardziej ukierunkowane światło bez widocznych diod LED (przy zastosowaniu przesłony mlecznej). Profil zachowuje wrażenie dyskretnej oprawy do taśm LED oraz doskonale nadaje się do podświetleń dekoracyjnych w meblarstwie i przy wykończeniach wnętrz. W zestawie znajdują się: klosz mleczny, uchwyty montażowe i zaślepki.', '', 'profil-aluminiowy-do-tasm-led-typ-y-dl-2-m-oslona-mleczna-eko-light', '', '', '', 'Profil aluminiowy do taśm LED TYP Y dł. 2 m osłona mleczna EKO-LIGHT', '', '', '', ''),
