(157, 1, 1, 'Ta lampa wisząca Inspire jest wykonana z naturalnego drewna FSC z 5 lampkami i ma 100 cm długości. Doskonale oświetli Twoją industrialną przestrzeń szczególnie w dużych pomieszczeniach. Umieść go na przykład nad stołem w jadalni lub wyspą kuchenną, aby jak najlepiej go wykorzystać. Dodaj pięć wybranych przez Ciebie żarówek E27 Lexman: zalecamy żarówki żarowe, aby dopełnić wygląd tego urządzenia. Jeśli podoba Ci się seria ELGORT, powinieneś wiedzieć, że możesz skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest produkowany w Europie i objęty 5-letnią gwarancją.', '', 'lampa-wiszaca-elgort-czarna-z-drewnem-5-x-e27-inspire', '', '', '', 'Lampa wisząca Elgort czarna z drewnem 5 x E27 Inspire', '', '', '', ''),
(157, 1, 2, 'Ta lampa wisząca Inspire jest wykonana z naturalnego drewna FSC z 5 lampkami i ma 100 cm długości. Doskonale oświetli Twoją industrialną przestrzeń szczególnie w dużych pomieszczeniach. Umieść go na przykład nad stołem w jadalni lub wyspą kuchenną, aby jak najlepiej go wykorzystać. Dodaj pięć wybranych przez Ciebie żarówek E27 Lexman: zalecamy żarówki żarowe, aby dopełnić wygląd tego urządzenia. Jeśli podoba Ci się seria ELGORT, powinieneś wiedzieć, że możesz skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest produkowany w Europie i objęty 5-letnią gwarancją.', '', 'lampa-wiszaca-elgort-czarna-z-drewnem-5-x-e27-inspire', '', '', '', 'Lampa wisząca Elgort czarna z drewnem 5 x E27 Inspire', '', '', '', ''),
(158, 1, 1, 'Ta lampa wisząca Inspire, o całkowitej długości 30 cm, z metalową złotą powierzchnią zewnętrzną i białym wnętrzem, wniesie szykowny akcent do Twojej przestrzeni. Umieść go w swoim ulubionym pokoju, na przykład nad stołem jadalnym lub wyspą kuchenną, stanie się nowoczesnym, eleganckim wzorem z miękkimi mosiężnymi kloszami. Zalecamy dodanie trzech przezroczystych żarówek E27 Lexman, aby jak najlepiej je wykorzystać. Seria KRELA jest dostępna w wersji lampy wiszącej i kinkietowej, aby zharmonizować Twoją dekorację. Ten produkt Inspire jest objęty 5-letnią gwarancją', '', 'lampa-wiszaca-krela-zlota-e27-inspire', '', '', '', 'Lampa wisząca Krela złota E27 Inspire', '', '', '', ''),
(158, 1, 2, 'Ta lampa wisząca Inspire, o całkowitej długości 30 cm, z metalową złotą powierzchnią zewnętrzną i białym wnętrzem, wniesie szykowny akcent do Twojej przestrzeni. Umieść go w swoim ulubionym pokoju, na przykład nad stołem jadalnym lub wyspą kuchenną, stanie się nowoczesnym, eleganckim wzorem z miękkimi mosiężnymi kloszami. Zalecamy dodanie trzech przezroczystych żarówek E27 Lexman, aby jak najlepiej je wykorzystać. Seria KRELA jest dostępna w wersji lampy wiszącej i kinkietowej, aby zharmonizować Twoją dekorację. Ten produkt Inspire jest objęty 5-letnią gwarancją', '', 'lampa-wiszaca-krela-zlota-e27-inspire', '', '', '', 'Lampa wisząca Krela złota E27 Inspire', '', '', '', ''),
(159, 1, 1, 'Ta lampa wisząca Inspire, o całkowitej długości 85 cm, z metalową złotą powierzchnią zewnętrzną i białym wnętrzem, wniesie szykowny akcent do Twojej przestrzeni. Umieść go w swoim ulubionym pokoju, na przykład nad stołem jadalnym lub wyspą kuchenną, stanie się nowoczesnym, eleganckim wzorem z miękkimi mosiężnymi kloszami. Zalecamy dodanie trzech przezroczystych żarówek E27 Lexman, aby jak najlepiej je wykorzystać. Seria KRELA jest dostępna w wersji lampy wiszącej i kinkietowej, aby zharmonizować Twoją dekorację. Ten produkt Inspire jest objęty 5-letnią gwarancją', '', 'lampa-wiszaca-krela-zlota-3-x-e27-inspire', '', '', '', 'Lampa wisząca Krela złota 3 x E27 Inspire', '', '', '', ''),
(159, 1, 2, 'Ta lampa wisząca Inspire, o całkowitej długości 85 cm, z metalową złotą powierzchnią zewnętrzną i białym wnętrzem, wniesie szykowny akcent do Twojej przestrzeni. Umieść go w swoim ulubionym pokoju, na przykład nad stołem jadalnym lub wyspą kuchenną, stanie się nowoczesnym, eleganckim wzorem z miękkimi mosiężnymi kloszami. Zalecamy dodanie trzech przezroczystych żarówek E27 Lexman, aby jak najlepiej je wykorzystać. Seria KRELA jest dostępna w wersji lampy wiszącej i kinkietowej, aby zharmonizować Twoją dekorację. Ten produkt Inspire jest objęty 5-letnią gwarancją', '', 'lampa-wiszaca-krela-zlota-3-x-e27-inspire', '', '', '', 'Lampa wisząca Krela złota 3 x E27 Inspire', '', '', '', ''),
(160, 1, 1, 'Reus LED wisząca złota -  to jeden z wielu produktów  z serii Reus, w przepięknej odsłonie. Podczas wybierania oświetlenia do domu, przede wszystkim skupiamy się na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz  uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła, zyskujemy również dekorację domu. Taki jest właśnie produkt Reus. Dużej wielkości klosz, jest zaprojektowany w kształcie ciekawego ringu z wbudowanym światłem LED. Stworzony w nowoczesnym stylu. Jego wierzchnia złota strona, poprzez pikowany wzór oraz piękny wysoki połysk - wygląda bardzo glamour! Posiada neutralną barwę światła. Znakomicie będzie prezentować się w kuchni. Idealna także do dużych, przestronnych łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Lampa ta, wówczas w punkt dopełni całość ekskluzywności. W większej ilości znakomicie prezentowałaby się także w miejscach komercyjnych - np. restauracje.  Zapraszamy do zakupu!', '', 'lampa-wiszaca-reus-zlota-4100-lm-led-light-prestige', '', '', '', 'Lampa wisząca Reus złota 4100 lm LED Light Prestige', '', '', '', ''),
(160, 1, 2, 'Reus LED wisząca złota -  to jeden z wielu produktów  z serii Reus, w przepięknej odsłonie. Podczas wybierania oświetlenia do domu, przede wszystkim skupiamy się na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz  uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła, zyskujemy również dekorację domu. Taki jest właśnie produkt Reus. Dużej wielkości klosz, jest zaprojektowany w kształcie ciekawego ringu z wbudowanym światłem LED. Stworzony w nowoczesnym stylu. Jego wierzchnia złota strona, poprzez pikowany wzór oraz piękny wysoki połysk - wygląda bardzo glamour! Posiada neutralną barwę światła. Znakomicie będzie prezentować się w kuchni. Idealna także do dużych, przestronnych łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Lampa ta, wówczas w punkt dopełni całość ekskluzywności. W większej ilości znakomicie prezentowałaby się także w miejscach komercyjnych - np. restauracje.  Zapraszamy do zakupu!', '', 'lampa-wiszaca-reus-zlota-4100-lm-led-light-prestige', '', '', '', 'Lampa wisząca Reus złota 4100 lm LED Light Prestige', '', '', '', ''),
(161, 1, 1, 'Lampa wisząca posiada trzy źródło światła na gwint E27 podstawa metal, klosz szklany . Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Jonera składa się z lampy sufitowej 1, kinkiet 1 oraz lampy wiszące na 1,3 źródła światła. Długość lampy można regulować.', '', 'lampa-wiszaca-jonera-czarna-3-x-e27-candellux', '', '', '', 'Lampa wisząca Jonera czarna 3 x E27 Candellux', '', '', '', ''),
(161, 1, 2, 'Lampa wisząca posiada trzy źródło światła na gwint E27 podstawa metal, klosz szklany . Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Jonera składa się z lampy sufitowej 1, kinkiet 1 oraz lampy wiszące na 1,3 źródła światła. Długość lampy można regulować.', '', 'lampa-wiszaca-jonera-czarna-3-x-e27-candellux', '', '', '', 'Lampa wisząca Jonera czarna 3 x E27 Candellux', '', '', '', ''),
