(164, 1, 1, 'Lampa wisząca posiada jedno źródło światła na gwint E27 podstawa okrągła, klosz szklany dymiony. Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Jonera składa się z lampy sufitowej 1, kinkiet 1 oraz lampy wiszące na 1,3 źródła światła. Długość lampy można regulować.', '', 'lampa-wiszaca-jonera-czarna-e27-candellux', '', '', '', 'Lampa wisząca Jonera czarna E27 Candellux', '', '', '', ''),
(164, 1, 2, 'Lampa wisząca posiada jedno źródło światła na gwint E27 podstawa okrągła, klosz szklany dymiony. Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Jonera składa się z lampy sufitowej 1, kinkiet 1 oraz lampy wiszące na 1,3 źródła światła. Długość lampy można regulować.', '', 'lampa-wiszaca-jonera-czarna-e27-candellux', '', '', '', 'Lampa wisząca Jonera czarna E27 Candellux', '', '', '', ''),
(165, 1, 1, 'Ta lampa wisząca Inspire Mallow o średnicy 31 cm wprowadzi do Twojego wnętrza nowoczesny akcent dzięki strukturze skręconego drutu. Bambusowa osłona gniazda doda naturalnego akcentu Twojej oprawie oświetleniowej. To zawieszenie idealnie nadaje się do oświetlenia salonu, kuchni czy dużego wejścia. Długość kabla jest regulowana, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Zwróć uwagę, że kabel jest również chroniony przez powłokę z tkaniny, która zapewnia dodatkowy akcent wyrafinowania. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, jaki produkt przyniesie na Twojej ścianie, zalecamy użycie przezroczystej żarówki dekoracyjnej z żarnikami. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz', '', 'lampa-wiszaca-mallow-czarna-e27-inspire', '', '', '', 'Lampa wisząca Mallow czarna E27 Inspire', '', '', '', ''),
(165, 1, 2, 'Ta lampa wisząca Inspire Mallow o średnicy 31 cm wprowadzi do Twojego wnętrza nowoczesny akcent dzięki strukturze skręconego drutu. Bambusowa osłona gniazda doda naturalnego akcentu Twojej oprawie oświetleniowej. To zawieszenie idealnie nadaje się do oświetlenia salonu, kuchni czy dużego wejścia. Długość kabla jest regulowana, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Zwróć uwagę, że kabel jest również chroniony przez powłokę z tkaniny, która zapewnia dodatkowy akcent wyrafinowania. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, jaki produkt przyniesie na Twojej ścianie, zalecamy użycie przezroczystej żarówki dekoracyjnej z żarnikami. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz', '', 'lampa-wiszaca-mallow-czarna-e27-inspire', '', '', '', 'Lampa wisząca Mallow czarna E27 Inspire', '', '', '', ''),
(166, 1, 1, 'Ta lampa wisząca Inspire jest wykonana z naturalnego drewna FSC z 3 światłami i długości 70 cm. Doskonale oświetli Twoją industrialną dekorację, szczególnie w średnich i dużych pomieszczeniach. Umieść go na przykład nad stołem w jadalni lub wyspą kuchenną, aby jak najlepiej go wykorzystać. Dodaj trzy wybrane żarówki E27 Lexman: zalecamy żarówki żarowe, aby dopełnić wygląd tego urządzenia. Jeśli podoba Ci się seria ELGORT, powinieneś wiedzieć, że możesz skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest produkowany w Europie i objęty 5-letnią gwarancją', '', 'lampa-wiszaca-elgort-czarna-z-drewnem-3-x-e27-inspire', '', '', '', 'Lampa wisząca Elgort czarna z drewnem 3 x E27 Inspire', '', '', '', ''),
(166, 1, 2, 'Ta lampa wisząca Inspire jest wykonana z naturalnego drewna FSC z 3 światłami i długości 70 cm. Doskonale oświetli Twoją industrialną dekorację, szczególnie w średnich i dużych pomieszczeniach. Umieść go na przykład nad stołem w jadalni lub wyspą kuchenną, aby jak najlepiej go wykorzystać. Dodaj trzy wybrane żarówki E27 Lexman: zalecamy żarówki żarowe, aby dopełnić wygląd tego urządzenia. Jeśli podoba Ci się seria ELGORT, powinieneś wiedzieć, że możesz skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest produkowany w Europie i objęty 5-letnią gwarancją', '', 'lampa-wiszaca-elgort-czarna-z-drewnem-3-x-e27-inspire', '', '', '', 'Lampa wisząca Elgort czarna z drewnem 3 x E27 Inspire', '', '', '', ''),
(167, 1, 1, 'Ta lampa wisząca Inspire o szerokości 20 cm jest wykonana z naturalnego drewna FSC. Doskonale oświetli Twoją industrialną przestrzeń. Umieść ją na środku pokoju, jest dyskretna, ale bardzo jasna. Dodaj wybraną przez siebie ładną żarówkę E27 Lexman: zalecamy żarówki żarnikowe, aby dopełnić wygląd tej oprawy. Jeśli podoba Ci się seria ELGORT, wiedz, że możesz skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest produkowany w Europie i objęty 5-letnią gwarancją', '', 'lampa-wiszaca-elgort-czarna-z-drewnem-e27-inspire', '', '', '', 'Lampa wisząca Elgort czarna z drewnem E27 Inspire', '', '', '', ''),
(167, 1, 2, 'Ta lampa wisząca Inspire o szerokości 20 cm jest wykonana z naturalnego drewna FSC. Doskonale oświetli Twoją industrialną przestrzeń. Umieść ją na środku pokoju, jest dyskretna, ale bardzo jasna. Dodaj wybraną przez siebie ładną żarówkę E27 Lexman: zalecamy żarówki żarnikowe, aby dopełnić wygląd tej oprawy. Jeśli podoba Ci się seria ELGORT, wiedz, że możesz skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest produkowany w Europie i objęty 5-letnią gwarancją', '', 'lampa-wiszaca-elgort-czarna-z-drewnem-e27-inspire', '', '', '', 'Lampa wisząca Elgort czarna z drewnem E27 Inspire', '', '', '', ''),
(168, 1, 1, 'Fantastyczny duet naturalnego drewna i metalowych kloszy w nowej odsłonie. Intrygujący i prosty design serii TABODI przyciąga każde spojrzenie. Warto dodać do oprawy dekoracyjne źródła światła np. LED filament, które osłonięte geometrycznym, metalowym abażurem zaprezentują grę światła i cienia po zapaleniu lampy. Seria doskonale sprawdzi się we wnętrzach o stylu skandynawskim, loftowym, industrialnym.', '', 'lampa-sufitowa-elgort-czarna-z-drewnem-4-x-e27-inspire', '', '', '', 'Lampa sufitowa Elgort czarna z drewnem 4 x E27 Inspire', '', '', '', ''),
(168, 1, 2, 'Fantastyczny duet naturalnego drewna i metalowych kloszy w nowej odsłonie. Intrygujący i prosty design serii TABODI przyciąga każde spojrzenie. Warto dodać do oprawy dekoracyjne źródła światła np. LED filament, które osłonięte geometrycznym, metalowym abażurem zaprezentują grę światła i cienia po zapaleniu lampy. Seria doskonale sprawdzi się we wnętrzach o stylu skandynawskim, loftowym, industrialnym.', '', 'lampa-sufitowa-elgort-czarna-z-drewnem-4-x-e27-inspire', '', '', '', 'Lampa sufitowa Elgort czarna z drewnem 4 x E27 Inspire', '', '', '', ''),
(169, 1, 1, 'Lampa wisząca Beryl to nowoczesny, nietuzinkowy design, który przyciąga wzrok. Idealna do oświetlenia i ozdobienia salonu. Wbudowane diody LED to przyjazne dla środowiska i portfela rozwiązanie. Diody LED zużywają mniej energii i są trwalsze niż standardowe rozwiązania. Od razu po włączeniu możemy cieszyć się pełnią światła w neutralnej białej barwie 4000K, co w połączeniu z wysokim współczynnikiem oddawania barw, który wiernie odwzorowuje kolory, tworzy komfortowe środowisko do pracy jak i wypoczynku.', '', 'lampa-wiszaca-beryl-czarna-led-inspire', '', '', '', 'Lampa wisząca Beryl czarna LED Inspire', '', '', '', ''),
(169, 1, 2, 'Lampa wisząca Beryl to nowoczesny, nietuzinkowy design, który przyciąga wzrok. Idealna do oświetlenia i ozdobienia salonu. Wbudowane diody LED to przyjazne dla środowiska i portfela rozwiązanie. Diody LED zużywają mniej energii i są trwalsze niż standardowe rozwiązania. Od razu po włączeniu możemy cieszyć się pełnią światła w neutralnej białej barwie 4000K, co w połączeniu z wysokim współczynnikiem oddawania barw, który wiernie odwzorowuje kolory, tworzy komfortowe środowisko do pracy jak i wypoczynku.', '', 'lampa-wiszaca-beryl-czarna-led-inspire', '', '', '', 'Lampa wisząca Beryl czarna LED Inspire', '', '', '', ''),
(170, 1, 1, 'Lampa wisząca Byron to duży metalowy klosz w kolorze miedzianym. Designerska forma klosza pasuje do większości wnętrz. Oprawa każdego dni będzie ułatwiać życie wskazując drogę po zmierzchu, a jednocześnie wspaniale dekorować pomieszczenie, w którym zostanie zamontowana. Lampa wspaniale ozdobi zarówno salon, jak i biuro czy łazienkę. Nastrojowy klimat, który uzyskamy po wyborze odpowiednich źródeł światła pozwoli na satysfakcjonujący odpoczynek po całym dniu. Do tej oprawy idealnie pasują żarówki dekoracyjne LED np. w kształcie kuli, trzonek E27, maksymalna moc 60 W.', '', 'lampa-wiszaca-byron-miedziana-e27-inspire', '', '', '', 'Lampa wisząca Byron miedziana E27 Inspire', '', '', '', ''),
