(178, 1, 1, 'Lampa wisząca FOREST marki INSPIRE o nowoczesnym designie oprócz tego, że jest funkcjonalna, zapewni również efekt dekoracyjny w salonie lub sypialni. Klosz w kolorze chromu ma wycięte motywy roślinne - drzewa, które po włączeniu pięknie się podświetlają. Lampa ma 1 punkt światła na żarówkę z tzw. \"dużym gwintem\" E27. Żarówka nie wchodzi w skład zestawu i możesz sam zadecydować, jaki efekt końcowy Cię interesuje - podświetlenie drzew w ciepłej barwie, czy zimnej. Lampa przeznaczona jest do użytku wewnątrz pomieszczeń (IP20).', '', 'lampa-wiszaca-forest-chrom-e27-inspire', '', '', '', 'Lampa wisząca Forest chrom E27 Inspire', '', '', '', ''),
(178, 1, 2, 'Lampa wisząca FOREST marki INSPIRE o nowoczesnym designie oprócz tego, że jest funkcjonalna, zapewni również efekt dekoracyjny w salonie lub sypialni. Klosz w kolorze chromu ma wycięte motywy roślinne - drzewa, które po włączeniu pięknie się podświetlają. Lampa ma 1 punkt światła na żarówkę z tzw. \"dużym gwintem\" E27. Żarówka nie wchodzi w skład zestawu i możesz sam zadecydować, jaki efekt końcowy Cię interesuje - podświetlenie drzew w ciepłej barwie, czy zimnej. Lampa przeznaczona jest do użytku wewnątrz pomieszczeń (IP20).', '', 'lampa-wiszaca-forest-chrom-e27-inspire', '', '', '', 'Lampa wisząca Forest chrom E27 Inspire', '', '', '', ''),
(179, 1, 1, 'Ta lampa wisząca Inspire Mallow o średnicy 80 cm wprowadzi do Twojego wnętrza nowoczesny akcent dzięki strukturze skręconego drutu. Bambusowa osłona gniazda doda naturalnego akcentu Twojej oprawie oświetleniowej. To zawieszenie doskonale sprawdzi się nad stołem w jadalni lub nad wyspą kuchenną. Długość kabla jest regulowana, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Zwróć uwagę, że kabel jest również chroniony przez powłokę z tkaniny, która zapewnia dodatkowy akcent wyrafinowania. Możesz spersonalizować renderowanie światła, wybierając 3 żarówki E27 Lexman dostosowane do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, jaki produkt przyniesie na Twojej ścianie, zalecamy stosowanie przezroczystych żarówek dekoracyjnych z żarnikiem. Żarówki sprzedawane są osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz', '', 'lampa-wiszaca-mallow-czarna-3-x-e27-inspire', '', '', '', 'Lampa wisząca Mallow czarna 3 x E27 Inspire', '', '', '', ''),
