(180, 1, 2, 'Lampa wisząca Byron marki Inspire z białą metalową, dekoracyjną konstrukcją. Dostosowana pod żarówkę E27, sprzedawaną oddzielnie.', '', 'lampa-wiszaca-byron-biala-e27-inspire', '', '', '', 'Lampa wisząca Byron biała E27 Inspire', '', '', '', ''),
(181, 1, 1, 'Wprowadź do swojego wnętrza designerski akcent dzięki lampie wiszącej Byron z czarnego drutu. Do tej oprawy idealnie pasuje dekoracyjna żarówka w kształcie kuli o średnicy 95mm. Ta oprawa jest również dostępna jako 3-punktowa lampa wisząca, kinkiet, lampa, lampa sufitowa i reflektor, aby zapewnić idealną różnorodność stylu we wszystkich pokojach. Dostępny również w kolorze miedzi oraz złota.', '', 'lampa-wiszaca-byron-czarna-e27-inspire', '', '', '', 'Lampa wisząca Byron czarna E27 Inspire', '', '', '', ''),
