(186, 1, 2, 'Lampa wisząca Byron to trzy metalowe klosze w kolorze miedzi. Designerska forma klosza pasuje do większości wnętrz. Oprawa każdego dni będzie ułatwiać życie wskazując drogę po zmierzchu, a jednocześnie wspaniale dekorować pomieszczenie, w którym zostanie zamontowana. Lampa wspaniale ozdobi zarówno salon, jak i biuro czy łazienkę. Nastrojowy klimat, który uzyskamy po wyborze odpowiednich źródeł światła pozwoli na satysfakcjonujący odpoczynek po całym dniu. Do tej oprawy idealnie pasują żarówki dekoracyjne LED np. w kształcie kuli, trzonek E27, maksymalna moc 60 W.', '', 'lampa-wiszaca-byron-miedziana-e27-inspire', '', '', '', 'Lampa wisząca Byron miedziana E27 Inspire', '', '', '', ''),
(187, 1, 1, 'Matowa czarna lampa wisząca Diuna marki Inspire o średnicy 53 cm idealnie nadaje się do oświetlenia dużego pomieszczenia. Świetnie sprawdzi się na przykład w dużym przedpokoju, przestronnym salonie czy nad stołem jadalnym. Dzięki dołączonemu pilotowi możesz dostosować intensywność i temperaturę oświetlenia do swoich potrzeb. Jej sześć obrotowych głowic pozwoli ci zorientować światło w odpowiednim kierunku. Ten zintegrowany produkt LED jest naprawialny i objęty 5-letnią gwarancją.', '', 'lampa-wiszaca-diuna-czarna-4224-lm-led-inspire', '', '', '', 'Lampa wisząca Diuna czarna 4224 lm LED Inspire', '', '', '', ''),
(187, 1, 2, 'Matowa czarna lampa wisząca Diuna marki Inspire o średnicy 53 cm idealnie nadaje się do oświetlenia dużego pomieszczenia. Świetnie sprawdzi się na przykład w dużym przedpokoju, przestronnym salonie czy nad stołem jadalnym. Dzięki dołączonemu pilotowi możesz dostosować intensywność i temperaturę oświetlenia do swoich potrzeb. Jej sześć obrotowych głowic pozwoli ci zorientować światło w odpowiednim kierunku. Ten zintegrowany produkt LED jest naprawialny i objęty 5-letnią gwarancją.', '', 'lampa-wiszaca-diuna-czarna-4224-lm-led-inspire', '', '', '', 'Lampa wisząca Diuna czarna 4224 lm LED Inspire', '', '', '', ''),
(188, 1, 1, 'Ta lampa wisząca Inspire z czarnym matowym metalem i marszczonymi okularami jest idealna, aby dodać szykownego akcentu do Twojej przestrzeni. PARADOX to idealna seria do personalizacji oddawania światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb, ponieważ klosze dają bardzo ładny efekt przezroczystości, gdy jest włączone światło. Możesz dostosować długość kabli, otaczając je mniej więcej na metalowym drążku, dzięki czemu można go idealnie dopasować do konfiguracji Twojego pokoju. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest objęty 5-letnią gwarancją i można go naprawić (w celu uzyskania dalszych informacji skontaktuj się z obsługą posprzedażną Twojego sklepu)', '', 'lampa-wiszaca-paradox-czarna-e27-inspire', '', '', '', 'Lampa wisząca Paradox czarna E27 Inspire', '', '', '', ''),
