(190, 1, 2, 'Ta lampa wisząca Inspire z czarnym matowym metalem i marszczonymi okularami jest idealna, aby dodać szykownego akcentu do Twojej przestrzeni. PARADOX to idealna seria do personalizacji oddawania światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb, ponieważ klosze dają bardzo ładny efekt przezroczystości, gdy jest włączone światło. Możesz dostosować długość kabli, otaczając je mniej więcej na metalowym drążku, dzięki czemu można go idealnie dopasować do konfiguracji Twojego pokoju. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest objęty 5-letnią gwarancją i można go naprawić (w celu uzyskania dalszych informacji skontaktuj się z obsługą posprzedażną Twojego sklepu)', '', 'lampa-wiszaca-paradox-czarna-5-x-e27-inspire', '', '', '', 'Lampa wisząca Paradox czarna 5 x E27 Inspire', '', '', '', ''),
(191, 1, 1, 'Ta lampa wisząca Inspire z matowego metalu niklowanego, o szerokości 70 cm, jest idealna, aby dodać nowoczesny akcent do przestrzeni, szczególnie w pomieszczeniach o średnich i dużych rozmiarach. Ta lampa wisząca o kształcie reprezentującym nieskończoność jest zintegrowana z diodami LED i zapewnia 4000K. Świetnie sprawdzi się np. nad stołem jadalnym. ESME to idealna seria do stworzenia designerskiego produktu z bardzo ładnym efektem świetlnym. Produkt ten można idealnie dopasować do konfiguracji pomieszczenia dzięki regulowanej długości kabla. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii: różne formy i dwa kolory (nikiel i czarny). Ten produkt Inspire jest objęty 5-letnią gwarancją i można go naprawić (w celu uzyskania dalszych informacji skontaktuj się z obsługą posprzedażną Twojego sklepu)', '', 'lampa-wiszaca-esme-srebrna-2640-lm-led-inspire', '', '', '', 'Lampa wisząca Esme srebrna 2640 lm LED Inspire', '', '', '', ''),
