(193, 1, 1, 'Ta lampa wisząca Inspire w czarnym kolorze, o łącznej długości 40cm, jest idealna do montażu w dużych pomieszczeniach. Ta lampa wisząca to subtelna mieszanka metalu i tkaniny, zapewniająca odpowiedni poziom światła. OTTOMANE to idealna seria do personalizacji renderowania światła poprzez wybór żarówki E27 dostosowanej do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, zalecamy użycie przezroczystej żarówki dekoracyjnej. Rzutowane cienie subtelnie znakują sufit. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii. Ten produkt Inspire jest objęty 5-letnią gwarancją', '', 'lampa-wiszaca-ottomane-czarna-e27-inspire', '', '', '', 'Lampa wisząca Ottomane czarna E27 Inspire', '', '', '', ''),
