(195, 1, 1, 'ALMA to lampa wiszącą w transparentnym bursztynie. Ciekawa forma klosza przypadnie do gustu miłośnikom delikatnych acz widocznych elementów oświetlenia. Doskonale sprawdzi się w pomieszczeniach o różnym typie przeznaczenia. Dodatkowy efekt dekoracyjny można uzyskać przy zastosowaniu dekoracyjnej żarówki.', '', 'lampa-wiszaca-alma-brazowa-e27-tk-lighting', '', '', '', 'Lampa wisząca Alma brązowa E27 Tk Lighting', '', '', '', ''),
