(196, 1, 1, 'Delta to seria lamp wiszących, które pomimo swojego minimalizmu pozwalają  sobie na bycie swoistą dekoracją wnętrza. Dymiony szary kolor klosza zestawiony ze złotą podkloszówką ciekawie łączy się z metalowymi elementami podsufitki. Model lampy wiszącej sprawdzi się jako osobne źródło światła w sypialni, gabinecie czy nad stolikiem w kawiarni, zaś w grupie kilku lamp doskonale odnajdzie się jako oświetlenie salonu oraz jadalni.', '', 'lampa-wiszaca-delta-szara-3-x-e27-tk-lighting', '', '', '', 'Lampa wisząca Delta szara 3 x E27 Tk Lighting', '', '', '', ''),
