(199, 1, 1, 'Lampa wisząca Bistro wykonana z czarnej, matowej metalowej okrągłej podstawy na której umieszczone są trzy przewody zakończone źródłem światła osłonięte szklanymi kloszami o średnicy 10cm i wysokości 15cm.Ozdobny, brązowy klosz przepuszcza światło. Lampa wisząca posiada trzy źródło światła na gwint E27 . Możliwość regulacji długości lampy poprzez skrócenie przewodu daje duże możliwości zastosowania. Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Bistro składa się z lamp na 1,2 i 3,4 źródła światła.', '', 'lampa-wiszaca-bistro-brazowa-3-x-e27-candellux', '', '', '', 'Lampa wisząca Bistro brązowa 3 x E27 Candellux', '', '', '', ''),
