(200, 1, 1, 'Lampa wisząca Bistro wykonana z czarnej, matowej metalowej okrągłej podstawy na której umieszczony jest przewód zakończony źródłem światła osłonięty szklanym kloszem o średnicy 10cm i wysokości 15cm . Ozdobny, brązowy klosz przepuszcza światło. Lampa wisząca posiada jedno źródło światła na gwint E27 . Możliwość regulacji długości lampy poprzez skrócenie przewodu daje duże możliwości zastosowania. Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Bistro składa się z lamp na 1,2 i 3,4 źródła światła.', '', 'lampa-wiszaca-bistro-brazowa-e27-candellux', '', '', '', 'Lampa wisząca Bistro brązowa E27 Candellux', '', '', '', ''),
(200, 1, 2, 'Lampa wisząca Bistro wykonana z czarnej, matowej metalowej okrągłej podstawy na której umieszczony jest przewód zakończony źródłem światła osłonięty szklanym kloszem o średnicy 10cm i wysokości 15cm . Ozdobny, brązowy klosz przepuszcza światło. Lampa wisząca posiada jedno źródło światła na gwint E27 . Możliwość regulacji długości lampy poprzez skrócenie przewodu daje duże możliwości zastosowania. Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Bistro składa się z lamp na 1,2 i 3,4 źródła światła.', '', 'lampa-wiszaca-bistro-brazowa-e27-candellux', '', '', '', 'Lampa wisząca Bistro brązowa E27 Candellux', '', '', '', ''),
(201, 1, 1, 'Lampa Lavello to nowoczesna propozycja oprawy wiszącej skandynawskiej firmy Markslojd. Lampa wykonana z metalu w złotym kolorze. Istnieje możliwość płynnej regulacji wysokości. Oprawa spełnia idealnie zarówno funkcje dekoracyjną jak i oświetleniową dzięki zastosowaniu 9 żarówek na gwint E27 o mocy maksymalnej 40W.', '', 'lampa-wiszaca-lavello-zlota-e27-markslojd', '', '', '', 'Lampa wisząca Lavello złota E27 Markslojd', '', '', '', ''),
(201, 1, 2, 'Lampa Lavello to nowoczesna propozycja oprawy wiszącej skandynawskiej firmy Markslojd. Lampa wykonana z metalu w złotym kolorze. Istnieje możliwość płynnej regulacji wysokości. Oprawa spełnia idealnie zarówno funkcje dekoracyjną jak i oświetleniową dzięki zastosowaniu 9 żarówek na gwint E27 o mocy maksymalnej 40W.', '', 'lampa-wiszaca-lavello-zlota-e27-markslojd', '', '', '', 'Lampa wisząca Lavello złota E27 Markslojd', '', '', '', ''),
(202, 1, 1, 'Lampa wisząca RAVENA nada wnętrzu wyjątkowego charakteru. Stanowi dopełnienie aranżacji wnosząc do wnętrza przyjemny nastrój. Całość została wykonana z wysokiej jakości materiałów dzięki czemu na długo pozwoli cieszyć się swoim światłem. Dostępna w dwóch wariantach kolorystycznych.', '', 'lampa-wiszaca-ravena-zloto-rozowa-e27-italux', '', '', '', 'Lampa wisząca Ravena złoto-różowa E27 Italux', '', '', '', ''),
