(206, 1, 1, 'Seria lamp wiszących AUSTELL to modne i designerskie wzornictwo. Wspaniale wpisują się w nowoczesne, eleganckie wnętrza i zapewni nastrojowe oświetlenie. Niezastąpiony duet czerni i złota ozdobi każde pomieszczenie. Abażur lampy to czarna metalowa „klatka” przesłonięta asymetrycznie skrojoną czarną tkaniną ze złotym wnętrzem. Eliminuje to ryzyko olśnienia źródłem światła, tworząc jednocześnie fascynującą grę światła i cienia we wnętrzu. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Wykorzystując różne elementy serii łatwo stworzyć spójne oświetlenie w całym wnętrzu.', '', 'lampa-wiszaca-austell-czarno-zlota-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota E27 Eglo', '', '', '', ''),
(206, 1, 2, 'Seria lamp wiszących AUSTELL to modne i designerskie wzornictwo. Wspaniale wpisują się w nowoczesne, eleganckie wnętrza i zapewni nastrojowe oświetlenie. Niezastąpiony duet czerni i złota ozdobi każde pomieszczenie. Abażur lampy to czarna metalowa „klatka” przesłonięta asymetrycznie skrojoną czarną tkaniną ze złotym wnętrzem. Eliminuje to ryzyko olśnienia źródłem światła, tworząc jednocześnie fascynującą grę światła i cienia we wnętrzu. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Wykorzystując różne elementy serii łatwo stworzyć spójne oświetlenie w całym wnętrzu.', '', 'lampa-wiszaca-austell-czarno-zlota-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota E27 Eglo', '', '', '', ''),
(207, 1, 1, 'Nowoczesna lampa LED z serii Reus współgra z każdym wnętrzem. Nadaje się zarówno do salonu jak i sypialni lub holu. Dobrze sprawdzi się również w biurze.', '', 'lampa-wiszaca-reus-3240-lm-czarna-led-light-prestige', '', '', '', 'Lampa wisząca Reus 3240 lm czarna LED Light Prestige', '', '', '', ''),
(207, 1, 2, 'Nowoczesna lampa LED z serii Reus współgra z każdym wnętrzem. Nadaje się zarówno do salonu jak i sypialni lub holu. Dobrze sprawdzi się również w biurze.', '', 'lampa-wiszaca-reus-3240-lm-czarna-led-light-prestige', '', '', '', 'Lampa wisząca Reus 3240 lm czarna LED Light Prestige', '', '', '', ''),
(208, 1, 1, 'Nowoczesna i pełna wyszukanej elegancji lampa wisząca Sardo Italux to propozycja do gustownie urządzonego salonu, sypialni, gabinetu czy przedpokoju. Doskonale prezentować się będzie także w jadalni, gdzie najlepiej umieścić ją nad stołem. Lampa z 3 źródłami światła zapewni bardzo dobre oświetlenie wnętrza, a szklane dymione klosze zadbają o odpowiedni nastrój. Można stosować do niej żarówki klasyczne lub LED. Zwisające klosze staną się również piękną dekoracją i dopełnieniem aranżacji.', '', 'lampa-wiszaca-sardo-nikiel-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo nikiel 3 x E27 Italux', '', '', '', ''),
(208, 1, 2, 'Nowoczesna i pełna wyszukanej elegancji lampa wisząca Sardo Italux to propozycja do gustownie urządzonego salonu, sypialni, gabinetu czy przedpokoju. Doskonale prezentować się będzie także w jadalni, gdzie najlepiej umieścić ją nad stołem. Lampa z 3 źródłami światła zapewni bardzo dobre oświetlenie wnętrza, a szklane dymione klosze zadbają o odpowiedni nastrój. Można stosować do niej żarówki klasyczne lub LED. Zwisające klosze staną się również piękną dekoracją i dopełnieniem aranżacji.', '', 'lampa-wiszaca-sardo-nikiel-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo nikiel 3 x E27 Italux', '', '', '', ''),
(209, 1, 1, 'Seria lamp wiszących AUSTELL to modne i designerskie wzornictwo. Wspaniale wpisują się w nowoczesne, eleganckie wnętrza i zapewni nastrojowe oświetlenie. Niezastąpiony duet czerni i złota ozdobi każde pomieszczenie. Abażur lampy to czarna metalowa „klatka” przesłonięta asymetrycznie skrojoną czarną tkaniną ze złotym wnętrzem. Eliminuje to ryzyko olśnienia źródłem światła, tworząc jednocześnie fascynującą grę światła i cienia we wnętrzu. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Wykorzystując różne elementy serii łatwo stworzyć spójne oświetlenie w całym wnętrzu.', '', 'lampa-wiszaca-austell-czarno-zlota-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota E27 Eglo', '', '', '', ''),
(209, 1, 2, 'Seria lamp wiszących AUSTELL to modne i designerskie wzornictwo. Wspaniale wpisują się w nowoczesne, eleganckie wnętrza i zapewni nastrojowe oświetlenie. Niezastąpiony duet czerni i złota ozdobi każde pomieszczenie. Abażur lampy to czarna metalowa „klatka” przesłonięta asymetrycznie skrojoną czarną tkaniną ze złotym wnętrzem. Eliminuje to ryzyko olśnienia źródłem światła, tworząc jednocześnie fascynującą grę światła i cienia we wnętrzu. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Wykorzystując różne elementy serii łatwo stworzyć spójne oświetlenie w całym wnętrzu.', '', 'lampa-wiszaca-austell-czarno-zlota-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota E27 Eglo', '', '', '', ''),
(210, 1, 1, 'Lampa wisząca Austell wykonana z wysokiej jakości materiałów wpisuje się w każde nowoczesne, eleganckie wnętrze. Abażur lampy wykonany jest z metalowych drucików tworzących lekką ażurową konstrukcję klatki. Jest to bardzo modny i designerskie wzornictwo. Abażur posiada dodatkowo asymetryczną tkaninę rozciągniętą na abażuże na wysokości źródła światła co ogranicza olśnienie źródłem światła. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Lampa przeznaczona jest na źródło światła o tradycyjnym gwincie E27. Co pozwoli oświetlić każde wnętrze. Polecamy użyć źródeł światła wykonanych w całości ze szkła. Świetnie nadają się źródła światła przeźroczyste, z mlecznym szkłem lub bursztynowym.', '', 'lampa-wiszaca-austell-czarno-zlota-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota E27 Eglo', '', '', '', ''),
(210, 1, 2, 'Lampa wisząca Austell wykonana z wysokiej jakości materiałów wpisuje się w każde nowoczesne, eleganckie wnętrze. Abażur lampy wykonany jest z metalowych drucików tworzących lekką ażurową konstrukcję klatki. Jest to bardzo modny i designerskie wzornictwo. Abażur posiada dodatkowo asymetryczną tkaninę rozciągniętą na abażuże na wysokości źródła światła co ogranicza olśnienie źródłem światła. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Lampa przeznaczona jest na źródło światła o tradycyjnym gwincie E27. Co pozwoli oświetlić każde wnętrze. Polecamy użyć źródeł światła wykonanych w całości ze szkła. Świetnie nadają się źródła światła przeźroczyste, z mlecznym szkłem lub bursztynowym.', '', 'lampa-wiszaca-austell-czarno-zlota-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota E27 Eglo', '', '', '', ''),
(211, 1, 1, 'Seria lamp wiszących AUSTELL to modne i designerskie wzornictwo. Wspaniale wpisują się w nowoczesne, eleganckie wnętrza i zapewni nastrojowe oświetlenie. Niezastąpiony duet czerni i złota ozdobi każde pomieszczenie. Abażur lampy to czarna metalowa „klatka” przesłonięta asymetrycznie skrojoną czarną tkaniną ze złotym wnętrzem. Eliminuje to ryzyko olśnienia źródłem światła, tworząc jednocześnie fascynującą grę światła i cienia we wnętrzu. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Wykorzystując różne elementy serii łatwo stworzyć spójne oświetlenie w całym wnętrzu.', '', 'lampa-wiszaca-austell-czarno-zlota-3-x-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota 3 x E27 Eglo', '', '', '', ''),
(211, 1, 2, 'Seria lamp wiszących AUSTELL to modne i designerskie wzornictwo. Wspaniale wpisują się w nowoczesne, eleganckie wnętrza i zapewni nastrojowe oświetlenie. Niezastąpiony duet czerni i złota ozdobi każde pomieszczenie. Abażur lampy to czarna metalowa „klatka” przesłonięta asymetrycznie skrojoną czarną tkaniną ze złotym wnętrzem. Eliminuje to ryzyko olśnienia źródłem światła, tworząc jednocześnie fascynującą grę światła i cienia we wnętrzu. Jest to bardzo funkcjonalne rozwiązanie w codziennym użytkowaniu. Wykorzystując różne elementy serii łatwo stworzyć spójne oświetlenie w całym wnętrzu.', '', 'lampa-wiszaca-austell-czarno-zlota-3-x-e27-eglo', '', '', '', 'Lampa wisząca Austell czarno-złota 3 x E27 Eglo', '', '', '', ''),
(212, 1, 1, 'Elegancka i wprowadzająca do wnętrza poczucie estetyki lampa wisząca Sardo Italux doskonale sprawdzi się w nowoczesnych i loftowych aranżacjach. Klasyczny, walcowaty kształt klosza wykonanego ze szkła został przełamany lekkim dymieniem, który jednocześnie delikatnie tłumi światło i stanowi ciekawą dekorację. Lampa wisząca Sardo zachowana w czarnym kolorze z łatwością dopasuje się do niemal każdej aranżacji domu, hotelu czy restauracji. Posiada miejsce na jedno źródło światła – klasyczne żarówki lub LED.', '', 'lampa-wiszaca-sardo-czarna-e27-italux', '', '', '', 'Lampa wisząca Sardo czarna E27 Italux', '', '', '', ''),
(212, 1, 2, 'Elegancka i wprowadzająca do wnętrza poczucie estetyki lampa wisząca Sardo Italux doskonale sprawdzi się w nowoczesnych i loftowych aranżacjach. Klasyczny, walcowaty kształt klosza wykonanego ze szkła został przełamany lekkim dymieniem, który jednocześnie delikatnie tłumi światło i stanowi ciekawą dekorację. Lampa wisząca Sardo zachowana w czarnym kolorze z łatwością dopasuje się do niemal każdej aranżacji domu, hotelu czy restauracji. Posiada miejsce na jedno źródło światła – klasyczne żarówki lub LED.', '', 'lampa-wiszaca-sardo-czarna-e27-italux', '', '', '', 'Lampa wisząca Sardo czarna E27 Italux', '', '', '', ''),
(213, 1, 1, 'Nowoczesna lampa wisząca Sardo Italux zapewni efektowny wygląd i doskonale rozproszone po całym wnętrzu światło. Klosz z elementami z dymionego szkła i dodatkami w kolorze satynowanego niklu wprowadzi poczucie estetyki i nienagannego gustu. Lampa wisząca Sardo to także propozycja do loftowych aranżacji. Świetnie sprawdzi się w każdym domowym wnętrzu, a także w hotelach, restauracjach i miejscach użyteczności publicznej. Posiada miejsce na jedno źródło światła – klasyczne lub LED.', '', 'lampa-wiszaca-sardo-nikiel-e27-italux', '', '', '', 'Lampa wisząca Sardo nikiel E27 Italux', '', '', '', ''),
(213, 1, 2, 'Nowoczesna lampa wisząca Sardo Italux zapewni efektowny wygląd i doskonale rozproszone po całym wnętrzu światło. Klosz z elementami z dymionego szkła i dodatkami w kolorze satynowanego niklu wprowadzi poczucie estetyki i nienagannego gustu. Lampa wisząca Sardo to także propozycja do loftowych aranżacji. Świetnie sprawdzi się w każdym domowym wnętrzu, a także w hotelach, restauracjach i miejscach użyteczności publicznej. Posiada miejsce na jedno źródło światła – klasyczne lub LED.', '', 'lampa-wiszaca-sardo-nikiel-e27-italux', '', '', '', 'Lampa wisząca Sardo nikiel E27 Italux', '', '', '', ''),
(214, 1, 1, 'Urokliwa i gustowna lampa wisząca Sardo Italux to propozycja do oświetlenia i dekoracji salonu, sypialni, gabinetu czy jadalni. Główną zaletą lampy są 3 szklane, dymione klosze, które doskonale rozpraszają światło i tworzą przytulną atmosferę. Dodatkowo zwisają na różnych wysokościach z czarnej, okrągłej podstawy, co tworzy piękną i efektowną kompozycję, która stanie się ozdobą każdego wnętrza. 3 źródła światła dostosowane są zarówno do żarówek klasycznych i LED. Lampa do nowoczesnych i loftowych aranżacji.', '', 'lampa-wiszaca-sardo-nikiel-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo nikiel 3 x E27 Italux', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(214, 1, 2, 'Urokliwa i gustowna lampa wisząca Sardo Italux to propozycja do oświetlenia i dekoracji salonu, sypialni, gabinetu czy jadalni. Główną zaletą lampy są 3 szklane, dymione klosze, które doskonale rozpraszają światło i tworzą przytulną atmosferę. Dodatkowo zwisają na różnych wysokościach z czarnej, okrągłej podstawy, co tworzy piękną i efektowną kompozycję, która stanie się ozdobą każdego wnętrza. 3 źródła światła dostosowane są zarówno do żarówek klasycznych i LED. Lampa do nowoczesnych i loftowych aranżacji.', '', 'lampa-wiszaca-sardo-nikiel-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo nikiel 3 x E27 Italux', '', '', '', ''),
(215, 1, 1, 'Wyjątkowa lampa wisząca Sardo Italux zachwyca swoim niezwykłym i oryginalnym designem. Połączenie mosiężnych dodatków, dymionych kloszy oraz czarnej podstawy tworzy niepowtarzalne oświetlenie, które wprowadzi poczucie estetyki i wysmakowania. 3 szklane klosze dostosowane do żarówek klasycznych lub LED zawieszone są na różnej wysokości, co pozwoliło stworzyć piękną i nowoczesną lampę. Lampa nie tylko oświetli salon, sypialnię, jadalnię czy gabinet, ale również stanie się ulubionym elementem wystroju wnętrza.', '', 'lampa-wiszaca-sardo-mosiadz-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo mosiądz 3 x E27 Italux', '', '', '', ''),
(215, 1, 2, 'Wyjątkowa lampa wisząca Sardo Italux zachwyca swoim niezwykłym i oryginalnym designem. Połączenie mosiężnych dodatków, dymionych kloszy oraz czarnej podstawy tworzy niepowtarzalne oświetlenie, które wprowadzi poczucie estetyki i wysmakowania. 3 szklane klosze dostosowane do żarówek klasycznych lub LED zawieszone są na różnej wysokości, co pozwoliło stworzyć piękną i nowoczesną lampę. Lampa nie tylko oświetli salon, sypialnię, jadalnię czy gabinet, ale również stanie się ulubionym elementem wystroju wnętrza.', '', 'lampa-wiszaca-sardo-mosiadz-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo mosiądz 3 x E27 Italux', '', '', '', ''),
(216, 1, 1, 'Mała wisząca biała kula Reus - to kolejny przepiękny produkt z serii Reus. Podczas wybierania oświetlenia do domu skupiamy się przede wszystkim na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz  uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła zyskujemy także dekorację domu. Taki jest właśnie produkt Reus. Małej wielkości klosz, który choć w klasycznym kształcie kuli, to zaprojektowany w nowoczesnym stylu. Jego wierzchnia biała strona, poprzez pikowany wzór oraz piękny wysoki połysk, wygląda bardzo glamour! Posiada neutralną barwę światła. Pasuje zarówno do jasnych, eleganckich wnętrz- nawet białych, ale też pięknie będzie rozjaśniać ciemne wnętrza- czarne, czy chabrowe. Idealna także do łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Lampa ta wówczas w punkt dopełni całość ekskluzywności. Znakomicie prezentowałaby się także w miejscach komercyjnych- np. w restauracjach. Dostępna również w innym rozmiarze.', '', 'lampa-wiszaca-reus-biala-e27-light-prestige', '', '', '', 'Lampa wisząca Reus biała E27 Light Prestige', '', '', '', ''),
(216, 1, 2, 'Mała wisząca biała kula Reus - to kolejny przepiękny produkt z serii Reus. Podczas wybierania oświetlenia do domu skupiamy się przede wszystkim na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz  uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła zyskujemy także dekorację domu. Taki jest właśnie produkt Reus. Małej wielkości klosz, który choć w klasycznym kształcie kuli, to zaprojektowany w nowoczesnym stylu. Jego wierzchnia biała strona, poprzez pikowany wzór oraz piękny wysoki połysk, wygląda bardzo glamour! Posiada neutralną barwę światła. Pasuje zarówno do jasnych, eleganckich wnętrz- nawet białych, ale też pięknie będzie rozjaśniać ciemne wnętrza- czarne, czy chabrowe. Idealna także do łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Lampa ta wówczas w punkt dopełni całość ekskluzywności. Znakomicie prezentowałaby się także w miejscach komercyjnych- np. w restauracjach. Dostępna również w innym rozmiarze.', '', 'lampa-wiszaca-reus-biala-e27-light-prestige', '', '', '', 'Lampa wisząca Reus biała E27 Light Prestige', '', '', '', ''),
(217, 1, 1, 'Wisząca biała Reus LED to jeden z wielu produktów z serii Reus w przepięknej odsłonie. Podczas wybierania oświetlenia do domu przede wszystkim skupiamy się na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła zyskujemy również dekorację domu. Taki jest właśnie produkt Reus. Dużej wielkości klosz jest zaprojektowany w kształcie ciekawego ringu z wbudowanym światłem LED. Stworzony w nowoczesnym stylu. Jego wierzchnia biała strona, poprzez pikowany wzór oraz piękny wysoki połysk, wygląda bardzo glamour! Posiada neutralną barwę światła. Pasuje zarówno do jasnych, eleganckich wnętrz, nawet białych, ale też pięknie będzie rozjaśniać wnętrza ciemne- czarne, granatowe czy zielone. Znakomicie będzie prezentować się w kuchni. Lampa jest idealna także do dużych, przestronnych łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Lampa ta wówczas w punkt dopełni całość ekskluzywności. W większej ilości znakomicie prezentowałaby się także w miejscach komercyjnych np. restauracjach.', '', 'lampa-wiszaca-reus-biala-3240-lm-led-light-prestige', '', '', '', 'Lampa wisząca Reus biała 3240 lm LED Light Prestige', '', '', '', ''),
