(218, 1, 1, 'Elegancki zwis, uwagę przykuwa oryginalna konstrukcja. Trzy czarne, metalowe klosze nadają masywny wydźwięk co idealnie komponuje się z klasycznym designem.', '', 'lampa-wiszaca-vario-czarna-e27-candellux', '', '', '', 'Lampa wisząca Vario czarna E27 Candellux', '', '', '', ''),
(218, 1, 2, 'Elegancki zwis, uwagę przykuwa oryginalna konstrukcja. Trzy czarne, metalowe klosze nadają masywny wydźwięk co idealnie komponuje się z klasycznym designem.', '', 'lampa-wiszaca-vario-czarna-e27-candellux', '', '', '', 'Lampa wisząca Vario czarna E27 Candellux', '', '', '', ''),
(219, 1, 1, 'Lampa sufitowa London Crystal nadaje szyku i elegancji, dzięki kryształkom, które pięknie odbijają światło. Idealnie nadaje się do wystroju salonu, sypialni innych pomieszczeń.', '', 'lampa-sufitowa-london-crystal-srebrna-e14-reality', '', '', '', 'Lampa sufitowa London Crystal srebrna E14 Reality', '', '', '', ''),
(219, 1, 2, 'Lampa sufitowa London Crystal nadaje szyku i elegancji, dzięki kryształkom, które pięknie odbijają światło. Idealnie nadaje się do wystroju salonu, sypialni innych pomieszczeń.', '', 'lampa-sufitowa-london-crystal-srebrna-e14-reality', '', '', '', 'Lampa sufitowa London Crystal srebrna E14 Reality', '', '', '', ''),
(220, 1, 1, 'Reus wisząca czarna - podczas wybierania oświetlenia do domu przede wszystkim skupiamy się na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła, zyskujemy również dekorację domu. Taki jest właśnie produkt Reus. Średniej wielkości klosz, który choć w klasycznym kształcie koła, to zaprojektowany w nowoczesnym stylu. Jego wierzchnia czarna strona, poprzez pikowany wzór oraz piękny wysoki połysk, wygląda bardzo glamour! Posiada neutralną barwę światła. Pasuje zarówno do jasnych, eleganckich wnętrz, ale też pięknie będzie prezentowała się w ciemniejszym otoczeniu. Idealna także do łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Wówczas lampa ta w punkt dopełni całość ekskluzywności. Dostępna również w kolorze białym, który także doda szyku Waszemu domowi.', '', 'lampa-wiszaca-reus-czarna-e27-light-prestige', '', '', '', 'Lampa wisząca Reus czarna E27 Light Prestige', '', '', '', ''),
