(221, 1, 2, 'Reus wisząca biała - podczas wybierania oświetlenia do domu, przede wszystkim skupiamy się na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła zyskujemy również dekorację domu. Taki jest właśnie produkt Reus. Średniej wielkości klosz, który choć w klasycznym kształcie koła, to zaprojektowany w nowoczesnym stylu. Jego wierzchnia biała strona, poprzez pikowany wzór oraz piękny wysoki połysk, wygląda bardzo glamour! Posiada neutralną barwę światła. Pasuje zarówno do jasnych, eleganckich wnętrz- nawet białych, ale też pięknie będzie rozjaśniać te ciemne. Idealna także do łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Wówczas lampa ta w punkt dopełni całość ekskluzywności. Dostępna również w kolorze czarnym, który także doda szyku Waszemu domowi.', '', 'lampa-wiszaca-reus-biala-e27-light-prestige', '', '', '', 'Lampa wisząca Reus biała E27 Light Prestige', '', '', '', ''),
(222, 1, 1, 'Bogato zdobiony plafon, który doda klasy każdemu tradycyjnemu pomieszczeniu. Idealne rozwiązanie do salonu lub pokoju dziennego. Szklane elementy efektownie mienią się w świetle żarówki, rozsiewając wokół atrakcyjne cienie i refleksy.', '', 'zyrandol-rosendal-zloty-e14-markslojd', '', '', '', 'Żyrandol Rosendal złoty E14 Markslojd', '', '', '', ''),
(222, 1, 2, 'Bogato zdobiony plafon, który doda klasy każdemu tradycyjnemu pomieszczeniu. Idealne rozwiązanie do salonu lub pokoju dziennego. Szklane elementy efektownie mienią się w świetle żarówki, rozsiewając wokół atrakcyjne cienie i refleksy.', '', 'zyrandol-rosendal-zloty-e14-markslojd', '', '', '', 'Żyrandol Rosendal złoty E14 Markslojd', '', '', '', ''),
(223, 1, 1, 'Lampa wisząca Bistro wykonana z czarnej, matowej metalowej podstawy na której umieszczone są cztery przewody zakończone źródłem światła osłonięte szklanymi kloszami o średnicy 10cm i wysokości 15cm.Ozdobny, brązowy klosz przepuszcza światło. Lampa wisząca posiada cztery źródło światła na gwint E27 . Możliwość regulacji długości lampy poprzez skrócenie przewodu daje duże możliwości zastosowania. Może być głównym źródłem światła pokoju, sypialni, kuchni, korytarzu jak również w przypadku zastosowania kilku lamp obok siebie - świetnym rozwiązaniem do oświetlenia stołu w jadalni lub barku w kuchni. Rodzina Bistro składa się z lamp na 1,2 i 3,4 źródła światła.', '', 'lampa-wiszaca-bistro-brazowa-4-x-e27-candellux', '', '', '', 'Lampa wisząca Bistro brązowa 4 x E27 Candellux', '', '', '', ''),
