(226, 1, 1, 'Lampa Lavello to nowoczesna propozycja oprawy wiszącej skandynawskiej firmy Markslojd. Lampa wykonana z metalu w czarnym kolorze. Istnieje możliwość płynnej regulacji wysokości. Oprawa spełnia idealnie zarówno funkcje dekoracyjną jak i oświetleniową dzięki zastosowaniu 9 żarówek na gwint E27 o mocy maksymalnej 40W.', '', 'lampa-wiszaca-lavello-czarna-e27-markslojd', '', '', '', 'Lampa wisząca Lavello czarna E27 Markslojd', '', '', '', ''),
(226, 1, 2, 'Lampa Lavello to nowoczesna propozycja oprawy wiszącej skandynawskiej firmy Markslojd. Lampa wykonana z metalu w czarnym kolorze. Istnieje możliwość płynnej regulacji wysokości. Oprawa spełnia idealnie zarówno funkcje dekoracyjną jak i oświetleniową dzięki zastosowaniu 9 żarówek na gwint E27 o mocy maksymalnej 40W.', '', 'lampa-wiszaca-lavello-czarna-e27-markslojd', '', '', '', 'Lampa wisząca Lavello czarna E27 Markslojd', '', '', '', ''),
(227, 1, 1, 'Lampa wyprodukowana przez firmę ALFA - polskiego producenta oświetlenia działającego na rynku nieprzerwanie od 1974 roku. Doskonale współgra niemal z każdym pomieszczeniem nadając mu wyjątkowego charakteru. Stanowi idealne uzupełnienie zarówno nowoczesnych jak również klasycznych wnętrz. Produkt posiada Europejski Certyfikat Zgodności CE oraz objęty jest 2 letnią gwarancją producenta. Oprawa dostosowana jest do źródeł światła o klasie energetycznej od A+++ do E oraz żarówek LED. Zestaw zawiera instrukcję obsługi oraz wszystkie elementy niezbędne do montażu.', '', 'lampa-wiszaca-volda-new-czarny-3-x-e27-alfa', '', '', '', 'Lampa wisząca Volda New czarny 3 x E27 Alfa', '', '', '', ''),
(227, 1, 2, 'Lampa wyprodukowana przez firmę ALFA - polskiego producenta oświetlenia działającego na rynku nieprzerwanie od 1974 roku. Doskonale współgra niemal z każdym pomieszczeniem nadając mu wyjątkowego charakteru. Stanowi idealne uzupełnienie zarówno nowoczesnych jak również klasycznych wnętrz. Produkt posiada Europejski Certyfikat Zgodności CE oraz objęty jest 2 letnią gwarancją producenta. Oprawa dostosowana jest do źródeł światła o klasie energetycznej od A+++ do E oraz żarówek LED. Zestaw zawiera instrukcję obsługi oraz wszystkie elementy niezbędne do montażu.', '', 'lampa-wiszaca-volda-new-czarny-3-x-e27-alfa', '', '', '', 'Lampa wisząca Volda New czarny 3 x E27 Alfa', '', '', '', ''),
