(229, 1, 1, 'Lampa wisząca RAVENA nada wnętrzu wyjątkowego charakteru. Stanowi dopełnienie aranżacji wnosząc do wnętrza przyjemny nastrój. Całość została wykonana z wysokiej jakości materiałów dzięki czemu na długo pozwoli cieszyć się swoim światłem. Dostępna w dwóch wariantach kolorystycznych.', '', 'lampa-wiszaca-ravena-zloto-czarna-e27-italux', '', '', '', 'Lampa wisząca Ravena złoto-czarna E27 Italux', '', '', '', ''),
(229, 1, 2, 'Lampa wisząca RAVENA nada wnętrzu wyjątkowego charakteru. Stanowi dopełnienie aranżacji wnosząc do wnętrza przyjemny nastrój. Całość została wykonana z wysokiej jakości materiałów dzięki czemu na długo pozwoli cieszyć się swoim światłem. Dostępna w dwóch wariantach kolorystycznych.', '', 'lampa-wiszaca-ravena-zloto-czarna-e27-italux', '', '', '', 'Lampa wisząca Ravena złoto-czarna E27 Italux', '', '', '', ''),
(230, 1, 1, 'Lampa wisząca RAVENA nada wnętrzu wyjątkowego charakteru. Stanowi dopełnienie aranżacji wnosząc do wnętrza przyjemny nastrój. Całość została wykonana z wysokiej jakości materiałów dzięki czemu na długo pozwoli cieszyć się swoim światłem. Dostępna w dwóch wariantach kolorystycznych.', '', 'lampa-wiszaca-ravena-zloto-rozowa-e27-italux', '', '', '', 'Lampa wisząca Ravena złoto-różowa E27 Italux', '', '', '', ''),
(230, 1, 2, 'Lampa wisząca RAVENA nada wnętrzu wyjątkowego charakteru. Stanowi dopełnienie aranżacji wnosząc do wnętrza przyjemny nastrój. Całość została wykonana z wysokiej jakości materiałów dzięki czemu na długo pozwoli cieszyć się swoim światłem. Dostępna w dwóch wariantach kolorystycznych.', '', 'lampa-wiszaca-ravena-zloto-rozowa-e27-italux', '', '', '', 'Lampa wisząca Ravena złoto-różowa E27 Italux', '', '', '', ''),
(231, 1, 1, 'Oryginalna lampa wisząca Sarado Italux to gratka dla miłośników efektownego oświetlenia wnętrza. Lampa jest bardzo dekoracyjna i z łatwością dopasuje się do nowoczesnych i industrialnych aranżacji. Szklane klosze w dymionym kolorze zapewnią przytulne, dobrze rozchodzące się po wnętrzu światło. Stalowe dodatki w kolorze mosiądzu dodają elegancji i zdobią lampę. Aż 3 źródła światła dostosowane do żarówek klasycznych i LED oświetlą nawet duży salon, jadalnię, gabinet czy przedpokój.', '', 'lampa-wiszaca-sardo-mosiadz-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo mosiądz 3 x E27 Italux', '', '', '', ''),
(231, 1, 2, 'Oryginalna lampa wisząca Sarado Italux to gratka dla miłośników efektownego oświetlenia wnętrza. Lampa jest bardzo dekoracyjna i z łatwością dopasuje się do nowoczesnych i industrialnych aranżacji. Szklane klosze w dymionym kolorze zapewnią przytulne, dobrze rozchodzące się po wnętrzu światło. Stalowe dodatki w kolorze mosiądzu dodają elegancji i zdobią lampę. Aż 3 źródła światła dostosowane do żarówek klasycznych i LED oświetlą nawet duży salon, jadalnię, gabinet czy przedpokój.', '', 'lampa-wiszaca-sardo-mosiadz-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo mosiądz 3 x E27 Italux', '', '', '', ''),
(232, 1, 1, 'Stworzona dla miłośników niebanalnych wnętrz, lampa wisząca Sardo Italux stworzy niepowtarzalny design i zapewni idealne oświetlenie. Posiada 3 szklane klosze w dymionym kolorze, które zadbają o przyjemny nastrój. Lampa doskonale odnajdzie się w nowoczesnych i loftowych aranżacjach. 3 źródła światła oświetlą nawet przestronny salon, gabinet czy przedpokój. Pięknie będzie prezentować się także w jadalni nad stołem. Lampa wisząca Sardo stanie się ciekawym i pięknym elementem wystroju wnętrza.', '', 'lampa-wiszaca-sardo-czarna-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo czarna 3 x E27 Italux', '', '', '', ''),
(232, 1, 2, 'Stworzona dla miłośników niebanalnych wnętrz, lampa wisząca Sardo Italux stworzy niepowtarzalny design i zapewni idealne oświetlenie. Posiada 3 szklane klosze w dymionym kolorze, które zadbają o przyjemny nastrój. Lampa doskonale odnajdzie się w nowoczesnych i loftowych aranżacjach. 3 źródła światła oświetlą nawet przestronny salon, gabinet czy przedpokój. Pięknie będzie prezentować się także w jadalni nad stołem. Lampa wisząca Sardo stanie się ciekawym i pięknym elementem wystroju wnętrza.', '', 'lampa-wiszaca-sardo-czarna-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo czarna 3 x E27 Italux', '', '', '', ''),
(233, 1, 1, 'Zachwycająca i pełna uroku lampa wisząca Sardo Italux to propozycja do nowoczesnych i industrialnych aranżacji. Na uwagę zasługują przede wszystkim 3 piękne, szklane klosze z efektem dymienia, które zawieszone na różnej wysokości tworzą niebanalną kompozycję. Całość zawieszona na czarnej, stalowej podstawie o okrągłym kształcie zapewni estetykę i elegancję. Lampa zapewni doskonałe oświetlenie nawet przestronnych wnętrz, dzięki zastosowaniu 3 źródeł światła. Dodatkowo jest niezwykle dekoracyjna.', '', 'lampa-wiszaca-sardo-czarny-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo czarny 3 x E27 Italux', '', '', '', ''),
(233, 1, 2, 'Zachwycająca i pełna uroku lampa wisząca Sardo Italux to propozycja do nowoczesnych i industrialnych aranżacji. Na uwagę zasługują przede wszystkim 3 piękne, szklane klosze z efektem dymienia, które zawieszone na różnej wysokości tworzą niebanalną kompozycję. Całość zawieszona na czarnej, stalowej podstawie o okrągłym kształcie zapewni estetykę i elegancję. Lampa zapewni doskonałe oświetlenie nawet przestronnych wnętrz, dzięki zastosowaniu 3 źródeł światła. Dodatkowo jest niezwykle dekoracyjna.', '', 'lampa-wiszaca-sardo-czarny-3-x-e27-italux', '', '', '', 'Lampa wisząca Sardo czarny 3 x E27 Italux', '', '', '', ''),
(234, 1, 1, 'Stylowa i niepowtarzalna lampa wisząca Sardo Italux to propozycja do nowoczesnych i industrialnych wnętrz. Piękny i elegancki design lampy sprawia, że stanie się również oryginalną ozdobą salonu, jadalni, przedpokoju czy biura. Zachwyci także gości hotelu czy modnej restauracji. Klosz wykonany ze szkła posiada efekt dymienia, który doskonale rozprasza światło tworząc przytulną atmosferę. Na uwagę zasługuje także podstawa oświetlenia w kolorze mosiężnym. Lampa wisząca Sardo posiada miejsce na jedno źródło światła.', '', 'lampa-wiszaca-sardo-mosiadz-e27-italux', '', '', '', 'Lampa wisząca Sardo mosiądz E27 Italux', '', '', '', ''),
(234, 1, 2, 'Stylowa i niepowtarzalna lampa wisząca Sardo Italux to propozycja do nowoczesnych i industrialnych wnętrz. Piękny i elegancki design lampy sprawia, że stanie się również oryginalną ozdobą salonu, jadalni, przedpokoju czy biura. Zachwyci także gości hotelu czy modnej restauracji. Klosz wykonany ze szkła posiada efekt dymienia, który doskonale rozprasza światło tworząc przytulną atmosferę. Na uwagę zasługuje także podstawa oświetlenia w kolorze mosiężnym. Lampa wisząca Sardo posiada miejsce na jedno źródło światła.', '', 'lampa-wiszaca-sardo-mosiadz-e27-italux', '', '', '', 'Lampa wisząca Sardo mosiądz E27 Italux', '', '', '', ''),
(235, 1, 1, 'Biała wisząca kula Reus to kolejny przepiękny produkt z serii Reus. Podczas wybierania oświetlenia do domu przede wszystkim skupiamy się na lampach wiszących. Wszystko po to, by praktycznie rozświetlić całe pomieszczenie oraz uzyskać klimatyczny nastrój wnętrza. Czasem jednocześnie prócz światła zyskujemy również dekorację domu. Taki jest właśnie produkt Reus. Dużej wielkości klosz, który choć w klasycznym kształcie kuli, to zaprojektowany w nowoczesnym stylu. Jego wierzchnia biała strona, poprzez pikowany wzór oraz piękny wysoki połysk, wygląda bardzo glamour! Posiada neutralną barwę światła. Lampa pasuje zarówno do jasnych, eleganckich wnętrz, nawet białych, ale też pięknie będzie rozjaśniać ciemne wnętrza- czarne, czy chabrowe. Idealna także do dużych, przestronnych łazienek w luksusowym wydaniu, np. z marmurowymi umywalkami i lśniącymi kafelkami. Lampa ta wówczas w punkt dopełni całość ekskluzywności. W większej ilości znakomicie prezentowałaby się także w miejscach komercyjnych np. salach bankietowych. Dostępna również w innym rozmiarze.', '', 'lampa-wiszaca-reus-biala-e27-light-prestige', '', '', '', 'Lampa wisząca Reus biała E27 Light Prestige', '', '', '', ''),
