(238, 1, 1, 'Rodzina eleganckich, minimalistycznych lamp wiszących MODENA Led ze szklanym kloszem. Lampa sufitowa w kolorze złotym i bezbarwnym szklanym kloszem. Posiada zintegrowane źródło światła LED mocy 5W barwy 3000K .Produkty z rodziny Modena Led można ze sobą dowolnie zestawiać w jednym pomieszczeniu .Lampy sufitowe Modena Led występują w dwóch kształtach kloszy . Lampa skierowana jest do pomieszczeń w stylu apartament charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-modena-zlota-260-lm-led-candellux', '', '', '', 'Lampa wisząca Modena złota 260 lm LED Candellux', '', '', '', ''),
(238, 1, 2, 'Rodzina eleganckich, minimalistycznych lamp wiszących MODENA Led ze szklanym kloszem. Lampa sufitowa w kolorze złotym i bezbarwnym szklanym kloszem. Posiada zintegrowane źródło światła LED mocy 5W barwy 3000K .Produkty z rodziny Modena Led można ze sobą dowolnie zestawiać w jednym pomieszczeniu .Lampy sufitowe Modena Led występują w dwóch kształtach kloszy . Lampa skierowana jest do pomieszczeń w stylu apartament charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-modena-zlota-260-lm-led-candellux', '', '', '', 'Lampa wisząca Modena złota 260 lm LED Candellux', '', '', '', ''),
