(239, 1, 2, 'Rodzina eleganckich, minimalistycznych lamp wiszących MODENA Led ze szklanym kloszem. Lampa sufitowa w kolorze złotym i bezbarwnym szklanym kloszem. Posiada zintegrowane źródło światła LED mocy 5W barwy 3000K .Produkty z rodziny Modena Led można ze sobą dowolnie zestawiać w jednym pomieszczeniu .Lampy sufitowe Modena Led występują w dwóch kształtach kloszy . Lampa skierowana jest do pomieszczeń w stylu apartament charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni, sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-modena-zlota-260-lm-led-candellux', '', '', '', 'Lampa wisząca Modena złota 260 lm LED Candellux', '', '', '', ''),
(240, 1, 1, 'Lampa wisząca Furni Led w kolorze złotym o trzech okrągłych kloszach średnicy 15cm zawieszonych na okrągłej podstawie średnicy 18cm na metalowych linkach. Klosze to połączenie efektu zbitego szkła oraz metalu barwionego na kolor złoty, źródła światła Led o mocy 15W są powieszone na różnych wysokościach. Sposób zaświecenia jednoobwodowy .Lampa sufitowa skierowana jest do pomieszczeń w stylu apartament, nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni , sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-furni-zlota-950-lm-led-candellux', '', '', '', 'Lampa wisząca Furni złota 950 lm LED Candellux', '', '', '', ''),
(240, 1, 2, 'Lampa wisząca Furni Led w kolorze złotym o trzech okrągłych kloszach średnicy 15cm zawieszonych na okrągłej podstawie średnicy 18cm na metalowych linkach. Klosze to połączenie efektu zbitego szkła oraz metalu barwionego na kolor złoty, źródła światła Led o mocy 15W są powieszone na różnych wysokościach. Sposób zaświecenia jednoobwodowy .Lampa sufitowa skierowana jest do pomieszczeń w stylu apartament, nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni , sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-furni-zlota-950-lm-led-candellux', '', '', '', 'Lampa wisząca Furni złota 950 lm LED Candellux', '', '', '', ''),
(241, 1, 1, 'Seria lamp TAGO BLACK to nowoczesna propozyca dla najbardziej wymagających klientów. Czarne abażury wykonane z holenderskiej tkaniny, które od środka zostały powleczone złotą folią pięknie oddają światło, a dodatkowym atutem - który wyróżnia rodzinę - są wycinane laserowo drobne otwory w kształcie kwadrtatu, które przepuszczją światło tworząc na ścianach delikatne wzory.', '', 'lampa-wiszaca-tago-czarna-3-x-e27-tk-lighting', '', '', '', 'Lampa wisząca Tago czarna 3 x E27 Tk Lighting', '', '', '', ''),
(241, 1, 2, 'Seria lamp TAGO BLACK to nowoczesna propozyca dla najbardziej wymagających klientów. Czarne abażury wykonane z holenderskiej tkaniny, które od środka zostały powleczone złotą folią pięknie oddają światło, a dodatkowym atutem - który wyróżnia rodzinę - są wycinane laserowo drobne otwory w kształcie kwadrtatu, które przepuszczją światło tworząc na ścianach delikatne wzory.', '', 'lampa-wiszaca-tago-czarna-3-x-e27-tk-lighting', '', '', '', 'Lampa wisząca Tago czarna 3 x E27 Tk Lighting', '', '', '', ''),
(242, 1, 1, 'Piega 3 wisząca biała – to wąska i smukła lampa z trzema szklanymi kloszami w białym kolorze. Dzięki niemu wytwornie i elegancko wypełni większość ekskluzywnych  aranżacji wnętrz. Prosta, praktyczna ale zarazem nowoczesna propozycja, to oferta dla Wielu osób, poszukujących minimalistyczne oświetlenie. Posiada trzy źródła światła, które są w zupełności wystarczające by oświetlić wybrane miejsce, miłym blaskiem.', '', 'lampa-wiszaca-piega-biala-3-x-e14-light-prestige', '', '', '', 'Lampa wisząca Piega biała 3 x E14 Light Prestige', '', '', '', ''),
(242, 1, 2, 'Piega 3 wisząca biała – to wąska i smukła lampa z trzema szklanymi kloszami w białym kolorze. Dzięki niemu wytwornie i elegancko wypełni większość ekskluzywnych  aranżacji wnętrz. Prosta, praktyczna ale zarazem nowoczesna propozycja, to oferta dla Wielu osób, poszukujących minimalistyczne oświetlenie. Posiada trzy źródła światła, które są w zupełności wystarczające by oświetlić wybrane miejsce, miłym blaskiem.', '', 'lampa-wiszaca-piega-biala-3-x-e14-light-prestige', '', '', '', 'Lampa wisząca Piega biała 3 x E14 Light Prestige', '', '', '', ''),
(243, 1, 1, 'Manacor lampa wisząca czarna - jest to lampa wisząca, w kształcie tuby. Składa się z transparentnego, szklanego klosza z metalową, czarną tubą w środku. Klasyczna, prosta, skromna ale jednocześnie z klasą, szykiem i elegancją. Blask jednego źródła światła jakie oferuje, cudownie rozświetli każdy zakamarek Twojego mieszkania. Światło z lampy Manacor, pada prostopadle, dzięki temu wszystko, co jest umieszczone pod nią, zostanie pięknie oświetlone. Wszystko to nada niepowtarzalnego charakteru, szczególnie w nowoczesnych wnętrzach. Ponadto, lampa świetnie odnajdzie się w pokojach młodzieżowych gościnnych czy kuchni. Co więcej, w większej ilości lampy Manacor, stworzyć mogą niepowtarzalną iluminację świetlną, nawet w przestronnym salonie.', '', 'lampa-wiszaca-manacor-czarna-gu10-light-prestige', '', '', '', 'Lampa wisząca Manacor czarna GU10 Light Prestige', '', '', '', ''),
