INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(251, 1, 1, 'Lampa wisząca ROTONDA 51W posiada dwa wymienne moduły LED o łącznej mocy 51W, zamontowane w okrągłych oprawach o średnicy 40 cm i 60 cm. Emitowany przez nie strumień świetlny ma neutralną, przyjemną dla oka barwę 4000K. Dodatkową zaletą lampy jest możliwość regulacji wysokości położenia elementu świetlnego od 50 do 100 cm. Dzięki takiemu rozwiązaniu z łatwością można ją dopasować do wnętrz o dowolnej wysokości. Lampa została wykonana z metalu w złotym malowaniu oraz akrylu. Do głównych zalet lampy ROTONDA zalicza się jej prosty i minimalistyczny design. Lampę tworzą dwa świecące okręgi, które nadają wnętrzu charakteru ponadczasowości. Produkt sprawdzi się jako oświetlenie salonu, pokoju gościnnego oraz jadalni. Lampa objęta jest 24-miesięczną gwarancją. Po upływie ww. okresu użytkownik ma możliwość skorzystania ze specjalistycznego firmowego serwisu.', '', 'lampa-wiszaca-rotondo-zlota-2850-lm-2-x-led-milagro', '', '', '', 'Lampa wisząca Rotondo złota 2850 lm 2 x LED Milagro', '', '', '', ''),
(251, 1, 2, 'Lampa wisząca ROTONDA 51W posiada dwa wymienne moduły LED o łącznej mocy 51W, zamontowane w okrągłych oprawach o średnicy 40 cm i 60 cm. Emitowany przez nie strumień świetlny ma neutralną, przyjemną dla oka barwę 4000K. Dodatkową zaletą lampy jest możliwość regulacji wysokości położenia elementu świetlnego od 50 do 100 cm. Dzięki takiemu rozwiązaniu z łatwością można ją dopasować do wnętrz o dowolnej wysokości. Lampa została wykonana z metalu w złotym malowaniu oraz akrylu. Do głównych zalet lampy ROTONDA zalicza się jej prosty i minimalistyczny design. Lampę tworzą dwa świecące okręgi, które nadają wnętrzu charakteru ponadczasowości. Produkt sprawdzi się jako oświetlenie salonu, pokoju gościnnego oraz jadalni. Lampa objęta jest 24-miesięczną gwarancją. Po upływie ww. okresu użytkownik ma możliwość skorzystania ze specjalistycznego firmowego serwisu.', '', 'lampa-wiszaca-rotondo-zlota-2850-lm-2-x-led-milagro', '', '', '', 'Lampa wisząca Rotondo złota 2850 lm 2 x LED Milagro', '', '', '', ''),
