(262, 1, 1, 'Lampa wisząca z okrągłą podsufitką o średnicy 8cm wykonana z metalu w kolorze czarnym wyposażona w oprawkę E27 umożliwia zastosowanie żarówki Led oraz metalowym kloszem w stylu loft. Dekoracją jest osłaniająca gwint tulejka w kolorze miedzianym. Lampa sufitowa ma możliwość regulacji wysokości poprzez wciągniecie kabla i umieszczeniu go w podsufitce lub poprzez skrócenie. Lampa Jonas w stylu loftowym polecana do jadalni , sypialni, salonie, pokoju młodzieżowym , korytarzu, biurze, hotelu. \\n', '', 'lampa-wiszaca-jonas-czarna-e27-candellux', '', '', '', 'Lampa wisząca Jonas czarna E27 Candellux', '', '', '', ''),
