(281, 1, 1, 'Lampa wisząca  Alyson wykonana z metalu ,klosze o średnicy 15 cm z białego szkła z delikatnym cieniowaniem zapewniają równomierne rozproszenie światła nadając subtelny klimat oświetlanego pomieszczenia. Lampa sufitowa wyposażona w oprawkę E27 umożliwia zastosowanie żarówki Led. Lampa sufitowa ma możliwość regulacji wysokości . W połączeniu z błyszczącym chromem i zwisającym kryształkiem podkreśla elegancję, dedykowana do nowoczesnych wnętrz. Lampa polecana do jadalni , sypialni, salonie, pokoju młodzieżowym .', '', 'lampa-wiszaca-alyson-biala-5-x-e27-candellux', '', '', '', 'Lampa wisząca Alyson biała 5 x E27 Candellux', '', '', '', ''),
