(283, 1, 1, 'Lampa sufitowa Felis w kolorze czarnym posiada metalową okrągła podstawę o średnicy 30 cm na której umieszczone są trzy czarne przewody wraz z ozdobnymi szklanymi kloszami w kolorze dymionym.Wysokość całej lampy z przewodami wynosi 90cm. Lampa wisząca Felis wyposażona jest w trzy  oprawki E27 umożliwia zastosowanie żarówki Led. Dodatkową zaletą lampy sufitowej jest możliwość regulacji wysokości  poprzez wciągniecie kabla i umieszczeniu go w podsufitce lub poprzez skrócenie.  Lampa Felis to styl nowoczesny design polecana do salonu, sypialni, kuchni, korytarzu oraz ma  zastosowanie poprzez połącznie kilka lamp obok siebie nad stołem lub barku w kuchni.', '', 'lampa-wiszaca-felis-czarna-3-x-e27-candellux', '', '', '', 'Lampa wisząca Felis czarna 3 x E27 Candellux', '', '', '', ''),
