(285, 1, 1, 'Nowoczesna lampa sufitowa wisząca z metalowymi abażurami w kolorze czarny mat i miedź w stylu loft. Lampa sufitowa Olena to metalowe abażury w kolorach czarny mat i miedź zamocowane na czarnych metalowych ramionach wychodzących z czarnej, metalowej podsufitki. Lampa ma możliwość regulacji kąta świecenia poprzez regulację odchylenia części ramienia . Nie ma możliwości skrócenia . Lampa sufitowa Olena posiada cztery źródła światła na gwint E27. Daje to możliwość zastosowania zarówno tradycyjnych jak i ledowych źródeł światła. Olena to minimalistyczny , nowoczesny i loftowy design. Znajdzie zastosowanie w jadalni , sypialni, salonie, pokoju młodzieżowym , korytarzu, biurze, hotelu.', '', 'lampa-wiszaca-olena-czarna-4-x-e27-candellux', '', '', '', 'Lampa wisząca Olena czarna 4 x E27 Candellux', '', '', '', ''),
