(292, 1, 1, 'Lampa sufitowa wisząca z metalowymi abażurami w kolorze czarny mat i miedź w stylu loft. Lampa sufitowa Olena to metalowe abażury w kolorach czarny mat i miedź zawieszone na czarnych ramionkach na okrągłej podsufitce.Lampa znajdzie zastosowanie zarówno w niskich i wysokich pomieszczeniach, posiada cztery źródła światła na gwint E27. Daje to możliwość zastosowania zarówno tradycyjnych jak i ledowych źródeł światła. Olena to minimalistyczny , nowoczesny i loftowy design. Znajdzie zastosowanie w jadalni , sypialni, salonie, pokoju młodzieżowym , korytarzu, biurze, hotelu.', '', 'lampa-sufitowa-olena-czarna-4-x-e27-candellux', '', '', '', 'Lampa sufitowa Olena czarna 4 x E27 Candellux', '', '', '', ''),
(292, 1, 2, 'Lampa sufitowa wisząca z metalowymi abażurami w kolorze czarny mat i miedź w stylu loft. Lampa sufitowa Olena to metalowe abażury w kolorach czarny mat i miedź zawieszone na czarnych ramionkach na okrągłej podsufitce.Lampa znajdzie zastosowanie zarówno w niskich i wysokich pomieszczeniach, posiada cztery źródła światła na gwint E27. Daje to możliwość zastosowania zarówno tradycyjnych jak i ledowych źródeł światła. Olena to minimalistyczny , nowoczesny i loftowy design. Znajdzie zastosowanie w jadalni , sypialni, salonie, pokoju młodzieżowym , korytarzu, biurze, hotelu.', '', 'lampa-sufitowa-olena-czarna-4-x-e27-candellux', '', '', '', 'Lampa sufitowa Olena czarna 4 x E27 Candellux', '', '', '', ''),
(293, 1, 1, 'Lampa sufitowa trzy ramienna Simpli na gwint E27 cieszący się niezwykłą popularnością jako klasyczny chromowy zwis ze szklanymi kloszami. Elementy dekoracyjne, metalowe finezyjne wygięcia, transparentne kryształki oraz chromowe paski na mlecznych kloszach wykonanych ze szkła o średnicy 11cm i wysokości 9,5cm. Całość spójna i estetyczna, do kompletu lampa wisząca 5 ramienna oraz kinkiet . Idealnie pasuje do pomieszczeń w stylu nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni, sypialni, gabinetu.', '', 'lampa-wiszaca-simpli-srebrna-3-x-e27-candellux', '', '', '', 'Lampa wisząca Simpli srebrna 3 x E27 Candellux', '', '', '', ''),
