(294, 1, 2, 'Lampa sufitowa trzy ramienna Simpli na gwint E27 cieszący się niezwykłą popularnością jako klasyczny chromowy zwis ze szklanymi kloszami. Elementy dekoracyjne, metalowe finezyjne wygięcia, transparentne kryształki oraz chromowe paski na mlecznych kloszach wykonanych ze szkła o średnicy 11cm i wysokości 9,5cm. Całość spójna i estetyczna, do kompletu lampa wisząca 5 ramienna oraz kinkiet . Idealnie pasuje do pomieszczeń w stylu nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni, sypialni, gabinetu.', '', 'lampa-wiszaca-simpli-srebrna-5-x-e27-candellux', '', '', '', 'Lampa wisząca Simpli srebrna 5 x E27 Candellux', '', '', '', ''),
(295, 1, 1, 'Lampa wisząca KSEROS Led o mocy 45W kolorze srebrno szarym w formie dwóch prostokątów o wymiarze 44x90, \"Okno na światło\", wykonana z metalu podsufitka w kształcie prostokątnym wymiar 15x25cm. Nowoczesne połączenie chromu i ekonomicznego ledu nadają pomieszczeniu oczekiwany nowoczesny charakter. Lampa jest dostępna w dwóch wymiarach. Wysokość lampy maksymalna 120cm, można regulować a tym samym skierować kierunek świecenia według potrzeb oświetlenia miejsca. Sposób zaświecenia jednoobwodowy .Lampa sufitowa KSEROS skierowana jest do pomieszczeń w stylu apartament, nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni, sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-kseros-srebrna-3800-lm-2-x-led-candellux', '', '', '', 'Lampa wisząca Kseros srebrna 3800 lm 2 x LED Candellux', '', '', '', ''),
