(305, 1, 1, 'Nowoczesna lampa sufitowa Korfu Led w kształcie okrąłym o średnicy 50cm , łączący chrom, awangardowy kryształ i ekonomiczny led o mocy 30W barwy neutralnej 4000K. Ledy tworzą koronę i okalają zawieszone na lampie kryształy. Lampa nada pomieszczeniu eleganckiego i wyszukanego designu. Plafon Korfu Led skierowany do pomieszczeń w stylu apartament charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce oraz stworzyć nastrój pomieszczenia typu kuchnia, pokój dzienny , salon , kuchnia , łazienka.', '', 'lampa-sufitowa-korfu-srebrna-2100-lm-candellux', '', '', '', 'Lampa sufitowa Korfu srebrna 2100 lm Candellux', '', '', '', ''),
(305, 1, 2, 'Nowoczesna lampa sufitowa Korfu Led w kształcie okrąłym o średnicy 50cm , łączący chrom, awangardowy kryształ i ekonomiczny led o mocy 30W barwy neutralnej 4000K. Ledy tworzą koronę i okalają zawieszone na lampie kryształy. Lampa nada pomieszczeniu eleganckiego i wyszukanego designu. Plafon Korfu Led skierowany do pomieszczeń w stylu apartament charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce oraz stworzyć nastrój pomieszczenia typu kuchnia, pokój dzienny , salon , kuchnia , łazienka.', '', 'lampa-sufitowa-korfu-srebrna-2100-lm-candellux', '', '', '', 'Lampa sufitowa Korfu srebrna 2100 lm Candellux', '', '', '', ''),
(306, 1, 1, 'Prosta lecz bardzo nowoczesna lampa wisząca. Połączenie metalu barwionego na brąz oraz led o mocy 28W barwy 4000K.Lampa wisząca Coconut Led to podsufitka w kształcie prostokątu o szerokości 41cm zawieszona na metalowych linkach maksymalna wysokość 150cm.Wysokość lampy można regulować a tym samym skierować kierunek świecenia według potrzeb oświetlenia miejsca o szerokości 91cm podświetli stół, blat kuchenny. Po obu stronach Ledu znajdują się wstawki metalu. Skierowana do pomieszczeń w stylu apartament charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce oraz stworzyć nastrój pomieszczenia typu kuchnia, pokój dzienny , salon .', '', 'lampa-wiszaca-coconut-brazowa-1750-lm-led-candellux', '', '', '', 'Lampa wisząca Coconut brązowa 1750 lm LED Candellux', '', '', '', ''),
