(308, 1, 1, 'Lampa wisząca Furni Led w kolorze szarym o sześciu okrągłych kloszach zawieszonych na metalowych listwach. Klosze o średnicy 15cm to połączenie efektu zbitego szkła oraz granatu/ niebieskiego, a źródła świetlne Led o mocy 30W barwy 4000K są powieszone w różnych wysokościach. Lampa nadaje wnętrzu dostojności i wyszukanego designu .Lampa sufitowa 6 punktowa idealnie pasuje nad stolikami kawowymi, konsolą podkreśla miejsce , gdzie znajduje się coś wyjątkowego tworząc nastrój w pomieszczeniu. Sposób zaświecenia jednoobwodowy .Lampa sufitowa skierowana jest do pomieszczeń w stylu apartament, nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,w pomieszczeniu typu salonu, jadalni, kuchni , sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-furni-szara-1900-lm-6-x-led-candellux', '', '', '', 'Lampa wisząca Furni szara 1900 lm 6 x LED Candellux', '', '', '', ''),
