(318, 1, 1, 'Lampa sufitowa Best to bardzo nowoczesna przestrzenna forma oprawy oświetleniowej na gwint E14 umożliwia wykorzystanie żarówek LED poprzez dowolny wybór barwy żarówki w zależności od potrzeb. Połączenie lustrzanego chromu z bezbarwnymi kloszami o średnicy 12cm , wzbogaconymi subtelnym motywem, miedziowane ozdobne tuleje na oprawkach dodają blasku po zaświeceniu. Możliwość regulacji wysokości na teleskopowej sztycy. Lampa wisząca Best przeznaczona do pomieszczeń salonu, jadali, pokoju dziennego.', '', 'lampa-wiszaca-best-srebrna-8-x-e14-candellux', '', '', '', 'Lampa wisząca Best srebrna 8 x E14 Candellux', '', '', '', ''),
