(319, 1, 1, 'Lampa sufitowa wisząca Paksos to nowoczesna ale i dostojna forma opraw oświetleniowych w kolorze szarym , okrągłe abażury stworzone z kryształów. Zawieszone na sztycy z dwoma obrotowymi ramionami kąt obracania 340 stopni , dzięki którym można zmieniać położenie wykwintnych kryształów a tym samym regulować kierunek świecenia. Lampa Paksos podstawa stalowa przeznaczona jest na gwint G9 umożliwia wykorzystanie żarówek LED poprzez dowolny wybór barwy żarówki w zależności od potrzeby. Połączenie awangardy z elegancją daje wnętrzu dostojnego i wyszukanego designu. Kolekcja Paksos przeznaczona do pomieszczeń salonu, jadali, pokoju dziennego .Dostępna także w kolorze czarnym.', '', 'lampa-wiszaca-paksos-szara-4-x-g9-candellux', '', '', '', 'Lampa wisząca Paksos szara 4 x G9 Candellux', '', '', '', ''),
(319, 1, 2, 'Lampa sufitowa wisząca Paksos to nowoczesna ale i dostojna forma opraw oświetleniowych w kolorze szarym , okrągłe abażury stworzone z kryształów. Zawieszone na sztycy z dwoma obrotowymi ramionami kąt obracania 340 stopni , dzięki którym można zmieniać położenie wykwintnych kryształów a tym samym regulować kierunek świecenia. Lampa Paksos podstawa stalowa przeznaczona jest na gwint G9 umożliwia wykorzystanie żarówek LED poprzez dowolny wybór barwy żarówki w zależności od potrzeby. Połączenie awangardy z elegancją daje wnętrzu dostojnego i wyszukanego designu. Kolekcja Paksos przeznaczona do pomieszczeń salonu, jadali, pokoju dziennego .Dostępna także w kolorze czarnym.', '', 'lampa-wiszaca-paksos-szara-4-x-g9-candellux', '', '', '', 'Lampa wisząca Paksos szara 4 x G9 Candellux', '', '', '', ''),
(320, 1, 1, 'Niesamowita lampa wisząca, która w swojej prostocie nadaje pomieszczeniu wyszukany design. Połączenie energooszczędnego leda z metalem nadaje nowoczesnego wyglądu. Zawieszona na metalowych linkach umożliwiających regulację wysokości Sposób zaświecenia jednoobwodowy .Lampa sufitowa skierowana jest do pomieszczeń w stylu apartament, nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni , sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-thasos-zlota-1600-lm-led-candellux', '', '', '', 'Lampa wisząca Thasos złota 1600 lm LED CANDELLUX', '', '', '', ''),
(320, 1, 2, 'Niesamowita lampa wisząca, która w swojej prostocie nadaje pomieszczeniu wyszukany design. Połączenie energooszczędnego leda z metalem nadaje nowoczesnego wyglądu. Zawieszona na metalowych linkach umożliwiających regulację wysokości Sposób zaświecenia jednoobwodowy .Lampa sufitowa skierowana jest do pomieszczeń w stylu apartament, nowoczesnym charakteryzujących się prostotą i elegancją stawiając na funkcjonalność lampy aby podkreślić wyjątkowe miejsce ,stworzyć nastrój pomieszczenia salonu, jadalni, kuchni , sypialni, przedpokoju, gabinetu.', '', 'lampa-wiszaca-thasos-zlota-1600-lm-led-candellux', '', '', '', 'Lampa wisząca Thasos złota 1600 lm LED CANDELLUX', '', '', '', ''),
(321, 1, 1, 'Produkt z ekskluzywnej linii marki APETI. Niesamowita lampa wisząca, która w swojej prostocie nadaje pomieszczeniu wyszukany design. Połączenie energooszczędnego leda z metalem nadaje nowoczesnego wyglądu. Zawieszona na metalowych linkach umożliwiających regulację wysokości, dostępna w trzech kolorach.', '', 'lampa-wiszaca-thasos-srebrna-1600-lm-led-candellux', '', '', '', 'Lampa wisząca Thasos srebrna 1600 lm LED CANDELLUX', '', '', '', ''),
(321, 1, 2, 'Produkt z ekskluzywnej linii marki APETI. Niesamowita lampa wisząca, która w swojej prostocie nadaje pomieszczeniu wyszukany design. Połączenie energooszczędnego leda z metalem nadaje nowoczesnego wyglądu. Zawieszona na metalowych linkach umożliwiających regulację wysokości, dostępna w trzech kolorach.', '', 'lampa-wiszaca-thasos-srebrna-1600-lm-led-candellux', '', '', '', 'Lampa wisząca Thasos srebrna 1600 lm LED CANDELLUX', '', '', '', ''),
(322, 1, 1, 'Lampa sufitowa wisząca Paksos to nowoczesna ale i dostojna forma opraw oświetleniowych w kolorze czarnym , okrągłe abażury stworzone z kryształów. Zawieszone na sztycy z dwoma obrotowymi ramionami kąt obracania 340 stopni , dzięki którym można zmieniać położenie wykwintnych kryształów a tym samym regulować kierunek świecenia. Lampa Paksos podstawa stalowa przeznaczona jest na gwint G9 umożliwia wykorzystanie żarówek LED poprzez dowolny wybór barwy żarówki w zależności od potrzeby. Połączenie awangardy z elegancją daje wnętrzu dostojnego i wyszukanego designu. Kolekcja Paksos przeznaczona do pomieszczeń salonu, jadali, pokoju dziennego .Dostępna także w kolorze szarym .', '', 'lampa-wiszaca-paksos-czarna-4-x-g9-candellux', '', '', '', 'Lampa wisząca Paksos czarna 4 x G9 Candellux', '', '', '', ''),
(322, 1, 2, 'Lampa sufitowa wisząca Paksos to nowoczesna ale i dostojna forma opraw oświetleniowych w kolorze czarnym , okrągłe abażury stworzone z kryształów. Zawieszone na sztycy z dwoma obrotowymi ramionami kąt obracania 340 stopni , dzięki którym można zmieniać położenie wykwintnych kryształów a tym samym regulować kierunek świecenia. Lampa Paksos podstawa stalowa przeznaczona jest na gwint G9 umożliwia wykorzystanie żarówek LED poprzez dowolny wybór barwy żarówki w zależności od potrzeby. Połączenie awangardy z elegancją daje wnętrzu dostojnego i wyszukanego designu. Kolekcja Paksos przeznaczona do pomieszczeń salonu, jadali, pokoju dziennego .Dostępna także w kolorze szarym .', '', 'lampa-wiszaca-paksos-czarna-4-x-g9-candellux', '', '', '', 'Lampa wisząca Paksos czarna 4 x G9 Candellux', '', '', '', ''),
(323, 1, 1, 'Produkt z ekskluzywnej linii marki APETI. Obłędna okrągła lampa wisząca Led , która przez swój nieszablonowy kształt z dekorem z liści nadaje niewiarygodny efekt w pomieszczeniu. Lampa ta to niewiarygodne połączenie czarnego metalu, ledu i kryształu. Lampa nadaje elegancji oraz szyku w pomieszczeniu .Lampa sufitowa będzie pasować do przedpokoju, sypialni ,salonu .', '', 'lampa-wiszaca-giaros-czarna-2100-lm-led-candellux', '', '', '', 'Lampa wisząca Giaros czarna 2100 lm LED Candellux', '', '', '', ''),
