(325, 1, 2, 'Lampa sufitowa Best to bardzo nowoczesna przestrzenna forma oprawy oświetleniowej na gwint E14 umożliwia wykorzystanie żarówek LED poprzez dowolny wybór barwy żarówki w zależności od potrzeb. Połączenie lustrzanego chromu z bezbarwnymi kloszami o średnicy 12cm , wzbogaconymi subtelnym motywem, miedziowane ozdobne tuleje na oprawkach dodają blasku po zaświeceniu. Możliwość regulacji wysokości na teleskopowej sztycy. Lampa wisząca Best przeznaczona do salonu, jadali, pokoju dziennego oraz sal weselnych.', '', 'lampa-wiszaca-best-srebrna-12-x-e14-candellux', '', '', '', 'Lampa wisząca Best srebrna 12 x E14 Candellux', '', '', '', ''),
(326, 1, 1, 'Nowoczesna lampa naścienna Samos w kształcie płatka śniegu wykonana z metalu to połączenie czerni i ekonomicznego ledu o barwie 4000K nada każdemu wnętrzu charakteru. Z troski do użytkowników led schowany jest pod mlecznym paskiem z tworzywa .Sposób zaświecenia jednoobwodowy. Lampa sufitowa będzie pasować do salonu , pokoju dziennego , przedpokoju.', '', 'lampa-sufitowa-samos-czarna-4000-lm-led-candellux', '', '', '', 'Lampa sufitowa Samos czarna 4000 lm LED Candellux', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(326, 1, 2, 'Nowoczesna lampa naścienna Samos w kształcie płatka śniegu wykonana z metalu to połączenie czerni i ekonomicznego ledu o barwie 4000K nada każdemu wnętrzu charakteru. Z troski do użytkowników led schowany jest pod mlecznym paskiem z tworzywa .Sposób zaświecenia jednoobwodowy. Lampa sufitowa będzie pasować do salonu , pokoju dziennego , przedpokoju.', '', 'lampa-sufitowa-samos-czarna-4000-lm-led-candellux', '', '', '', 'Lampa sufitowa Samos czarna 4000 lm LED Candellux', '', '', '', ''),
(327, 1, 1, 'Clara - lampa wisząca różowe złoto. 1xE27 40W. Wysokość 13cm. Wysokość całkowita 100cm. Szerokość 15cm. Głębokość 15cm. Klosze 15 i 8cm szklane różowe złoto i przezroczyste', '', 'lampa-wiszaca-clara-zlota-e27-reality', '', '', '', 'Lampa wisząca Clara złota E27 Reality', '', '', '', ''),
(327, 1, 2, 'Clara - lampa wisząca różowe złoto. 1xE27 40W. Wysokość 13cm. Wysokość całkowita 100cm. Szerokość 15cm. Głębokość 15cm. Klosze 15 i 8cm szklane różowe złoto i przezroczyste', '', 'lampa-wiszaca-clara-zlota-e27-reality', '', '', '', 'Lampa wisząca Clara złota E27 Reality', '', '', '', ''),
(328, 1, 1, 'Piega wisząca biał – to wąska i smukła lampa ze szklanym kloszem o białym kolorze. Dzięki niemu wytwornie i elegancko wypełni większość ekskluzywnych  aranżacji wnętrz. Prosta, praktyczna ale zarazem nowoczesna propozycja, to oferta dla Wielu osób, poszukujących minimalistyczne oświetlenie. Posiada jedno źródła światła, które jest w zupełności wystarczające by oświetlić wybrane miejsce, miłym blaskiem.', '', 'lampa-wiszaca-piega-biala-e14-light-prestige', '', '', '', 'Lampa wisząca Piega biała E14 Light Prestige', '', '', '', ''),
(328, 1, 2, 'Piega wisząca biał – to wąska i smukła lampa ze szklanym kloszem o białym kolorze. Dzięki niemu wytwornie i elegancko wypełni większość ekskluzywnych  aranżacji wnętrz. Prosta, praktyczna ale zarazem nowoczesna propozycja, to oferta dla Wielu osób, poszukujących minimalistyczne oświetlenie. Posiada jedno źródła światła, które jest w zupełności wystarczające by oświetlić wybrane miejsce, miłym blaskiem.', '', 'lampa-wiszaca-piega-biala-e14-light-prestige', '', '', '', 'Lampa wisząca Piega biała E14 Light Prestige', '', '', '', ''),
(329, 1, 1, 'Lampa wisząca CHISLE składa się z czterech bursztynowych kloszu w czarnej klatce każdy. Siatka cieni tworzy intrygującą grę światła i cienia, gdy światło jest włączone. Ta lampa wisząca, dzięki ciekawej mieszance materiałów, czyli eleganckiego szkła i rustykalnego metalu, doskonale komponuje się z nowoczesnymi meblami o loftowym charakterze.', '', 'lampa-wiszaca-chisle-czarna-4-x-e27-eglo', '', '', '', 'Lampa wisząca Chisle czarna 4 x E27 Eglo', '', '', '', ''),
(329, 1, 2, 'Lampa wisząca CHISLE składa się z czterech bursztynowych kloszu w czarnej klatce każdy. Siatka cieni tworzy intrygującą grę światła i cienia, gdy światło jest włączone. Ta lampa wisząca, dzięki ciekawej mieszance materiałów, czyli eleganckiego szkła i rustykalnego metalu, doskonale komponuje się z nowoczesnymi meblami o loftowym charakterze.', '', 'lampa-wiszaca-chisle-czarna-4-x-e27-eglo', '', '', '', 'Lampa wisząca Chisle czarna 4 x E27 Eglo', '', '', '', ''),
(330, 1, 1, 'Lampa sufitowa HILDA składa się z sześciu metalowych ramion. Każde z ramion jest ustawione w innym kierunku i na innym poziomie. Zapewnia to optymalne doświetlenie pomieszczenia. Żarówki są pozbawione jakiejkolwiek osłony, więc światło może rozprzestrzeniać się bez przeszkód. Dobór żarówki jest indywidualny, zatem końcowy efekt estetyczny pozostaje po stronie użytkownika. Lampa mocowana jest do sufitu za pomocą poprzeczki umieszczonej w podsufitce.', '', 'lampa-wiszaca-hilda-czarna-6-x-e27-lamkur', '', '', '', 'Lampa wisząca Hilda czarna 6 x E27 Lamkur', '', '', '', ''),
(330, 1, 2, 'Lampa sufitowa HILDA składa się z sześciu metalowych ramion. Każde z ramion jest ustawione w innym kierunku i na innym poziomie. Zapewnia to optymalne doświetlenie pomieszczenia. Żarówki są pozbawione jakiejkolwiek osłony, więc światło może rozprzestrzeniać się bez przeszkód. Dobór żarówki jest indywidualny, zatem końcowy efekt estetyczny pozostaje po stronie użytkownika. Lampa mocowana jest do sufitu za pomocą poprzeczki umieszczonej w podsufitce.', '', 'lampa-wiszaca-hilda-czarna-6-x-e27-lamkur', '', '', '', 'Lampa wisząca Hilda czarna 6 x E27 Lamkur', '', '', '', ''),
(331, 1, 1, 'Elegancka i wprowadzająca do wnętrza poczucie estetyki lampa wisząca Darlena Italux doskonale sprawdzi się w nowoczesnych i loftowych aranżacjach. Klasyczny kształt klosza wykonanego ze szkła w bursztynowym kolorze, który jednocześnie delikatnie tłumi światło i stanowi ciekawą dekorację. Lampa wisząca Darlena zachowana z łatwością dopasuje się do niemal każdej aranżacji domu, hotelu czy restauracji. Posiada miejsce na jedno źródło światła – klasyczne żarówki lub LED.', '', 'lampa-wiszaca-darlena-brazowa-e27-italux', '', '', '', 'Lampa wisząca Darlena brązowa E27 Italux', '', '', '', ''),
(331, 1, 2, 'Elegancka i wprowadzająca do wnętrza poczucie estetyki lampa wisząca Darlena Italux doskonale sprawdzi się w nowoczesnych i loftowych aranżacjach. Klasyczny kształt klosza wykonanego ze szkła w bursztynowym kolorze, który jednocześnie delikatnie tłumi światło i stanowi ciekawą dekorację. Lampa wisząca Darlena zachowana z łatwością dopasuje się do niemal każdej aranżacji domu, hotelu czy restauracji. Posiada miejsce na jedno źródło światła – klasyczne żarówki lub LED.', '', 'lampa-wiszaca-darlena-brazowa-e27-italux', '', '', '', 'Lampa wisząca Darlena brązowa E27 Italux', '', '', '', ''),
(332, 1, 1, 'Lampa wisząca CHISLE to czarny abażur druciany z wewnętrznym szklanym kloszem w odcieniu bursztynu. Gdy światło jest włączone, konstrukcja w klatce tworzy fascynującą grę światła i cienia na ścianach, a połączenie eleganckiego szkła i rustykalnego metalu doskonale komponuje się z nowoczesnymi wnętrzami w stylu loftu. Produkt tworzy wyraziste oświetlenie w każdej przestrzeni, czy to w salonie, czy nad stołem w jadalni.', '', 'lampa-wiszaca-chisle-czarna-e27-eglo', '', '', '', 'Lampa wisząca Chisle czarna E27 Eglo', '', '', '', ''),
(332, 1, 2, 'Lampa wisząca CHISLE to czarny abażur druciany z wewnętrznym szklanym kloszem w odcieniu bursztynu. Gdy światło jest włączone, konstrukcja w klatce tworzy fascynującą grę światła i cienia na ścianach, a połączenie eleganckiego szkła i rustykalnego metalu doskonale komponuje się z nowoczesnymi wnętrzami w stylu loftu. Produkt tworzy wyraziste oświetlenie w każdej przestrzeni, czy to w salonie, czy nad stołem w jadalni.', '', 'lampa-wiszaca-chisle-czarna-e27-eglo', '', '', '', 'Lampa wisząca Chisle czarna E27 Eglo', '', '', '', ''),
(333, 1, 1, 'Elegancka i wprowadzająca do wnętrza poczucie estetyki lampa wisząca Darlena Italux doskonale sprawdzi się w nowoczesnych i loftowych aranżacjach. Klasyczny kształt klosza wykonanego ze szkła w bursztynowym kolorze, który jednocześnie delikatnie tłumi światło i stanowi ciekawą dekorację. Lampa wisząca Darlena zachowana z łatwością dopasuje się do niemal każdej aranżacji domu, hotelu czy restauracji. Posiada miejsce na jedno źródło światła – klasyczne żarówki lub LED.', '', 'lampa-wiszaca-darlena-brazowa-3-x-e27-italux', '', '', '', 'Lampa wisząca Darlena brązowa 3 x E27 Italux', '', '', '', ''),
(333, 1, 2, 'Elegancka i wprowadzająca do wnętrza poczucie estetyki lampa wisząca Darlena Italux doskonale sprawdzi się w nowoczesnych i loftowych aranżacjach. Klasyczny kształt klosza wykonanego ze szkła w bursztynowym kolorze, który jednocześnie delikatnie tłumi światło i stanowi ciekawą dekorację. Lampa wisząca Darlena zachowana z łatwością dopasuje się do niemal każdej aranżacji domu, hotelu czy restauracji. Posiada miejsce na jedno źródło światła – klasyczne żarówki lub LED.', '', 'lampa-wiszaca-darlena-brazowa-3-x-e27-italux', '', '', '', 'Lampa wisząca Darlena brązowa 3 x E27 Italux', '', '', '', ''),
