(335, 1, 1, 'Nowoczesna lampa wisząca Italux Isidora łączy w sobie w sobie wyjątkowy design oraz uniwersalny styl, co stwarza szereg możliwości zastosowania. Oświetlenie cechuje się funkcjonalnością i praktycznością. Metal i stal sprawi, że znajdzie zastosowanie zarówno w ciemnych jak i jasnych wnętrzach. Wysoka jakość wykonania i ergonomiczna konstrukcja lampy zagwarantuje łatwość w utrzymaniu czystości', '', 'lampa-wiszaca-isidora-czarno-zlota-3-x-gu10-italux', '', '', '', 'Lampa wisząca Isidora czarno-złota 3 x GU10 Italux', '', '', '', ''),
