(337, 1, 2, 'Dzięki minimalistycznemu wyglądowi lampa wisząca CHASELY uzupełnia nowoczesne wnętrza i pięknie rozświetli Twoją przestrzeń, czy to w salonie, czy nad stołem w jadalni.', '', 'lampa-wiszaca-chasely-brazowa-e27-eglo', '', '', '', 'Lampa wisząca Chasely brązowa E27 Eglo', '', '', '', ''),
(338, 1, 1, 'Manacor lampa wisząca biła - jest to lampa wisząca, w kształcie tuby. Składa się z transparentnego, szklanego klosza z metalową, białą tubą w środku. Klasyczna, prosta, skromna ale jednocześnie z klasą, szykiem i elegancją. Blask jednego źródła światła jakie oferuje, cudownie rozświetli każdy zakamarek Twojego mieszkania. Światło z lampy Manacor, pada prostopadle, dzięki temu wszystko, co jest umieszczone pod nią, zostanie pięknie oświetlone. Wszystko to nada niepowtarzalnego charakteru, szczególnie w nowoczesnych wnętrzach. Ponadto, lampa świetnie odnajdzie się w pokojach młodzieżowych gościnnych czy kuchni. Co więcej, w większej ilości lampy Manacor, stworzyć mogą niepowtarzalną iluminację świetlną, nawet w przestronnym salonie.', '', 'lampa-wiszaca-manacor-biala-gu10-light-prestige', '', '', '', 'Lampa wisząca Manacor biała GU10 Light Prestige', '', '', '', ''),
