(342, 1, 1, 'Lampy z serii OILELLA to dymione szkło z efektem ombre z pięknym czarno mosiężnym wykończeniem. Elegancka oprawa doda szyku wnętrzu a szklane klosze zapewnią odpowiednią ilość światła w pomieszczeniu.', '', 'lampa-wiszaca-oilella-czarna-e27-eglo', '', '', '', 'Lampa wisząca Oilella czarna E27 Eglo', '', '', '', ''),
(342, 1, 2, 'Lampy z serii OILELLA to dymione szkło z efektem ombre z pięknym czarno mosiężnym wykończeniem. Elegancka oprawa doda szyku wnętrzu a szklane klosze zapewnią odpowiednią ilość światła w pomieszczeniu.', '', 'lampa-wiszaca-oilella-czarna-e27-eglo', '', '', '', 'Lampa wisząca Oilella czarna E27 Eglo', '', '', '', ''),
(343, 1, 1, 'Lampa wisząca OILELLA składa się z kulistego abażuru z przezroczystego szkła o ekscytującym gradiencie kolorów w kolorze czarnym i brązowym. Abażur został połączony z czarnym metalowym zawieszeniem i uzupełniony elementem dekoracyjnym ze szczotkowanego mosiądzu. Wisząca lampa w modnych odcieniach ziemi zapewnia przyjemne oświetlenie pokoju - czy to w salonie, czy w jadalni nad stołem jadalnym.', '', 'lampa-wiszaca-oilella-czarno-brazowa-e27-eglo', '', '', '', 'Lampa wisząca Oilella czarno-brązowa E27 Eglo', '', '', '', ''),
