(344, 1, 1, 'Arette wisząca złota - to kolejna propozycja lampy wiszącej. Ta, posiada jeden klosz w kształcie kuli, co daje jedno źródło światła. Kula jest wyprodukowana z transparentnego szkła, dzięki czemu światło będzie pięknie rozproszone. Całość na złotym stelażu i długim przewodzie. Długość przewodu sięga jednego metra! Jednak niezależnie od tego, jaką wysokość ma pomieszczenie, lampa Arette będzie odpowiednia, ponieważ jej przewód jest regulowany. Transparentny kolor klosza, nadaje uniwersalności jeśli chodzi o kolorystykę wnętrz. Jej zastosowanie, będzie odpowiednie zarówno w salonie jak i kuchni.', '', 'lampa-wiszaca-arette-zlota-e27-light-prestige', '', '', '', 'Lampa wisząca Arette złota E27 Light Prestige', '', '', '', ''),
