(350, 1, 1, 'Clara - lampa wisząca różowe złoto. 3xE27 40W. Wysokość 13cm. Wysokość całkowita 100cm. Szerokość 61cm. Głębokość 15cm. Klosze 15 i 8cm szklane różowe złoto i przezroczyste', '', 'lampa-wiszaca-clara-zlota-3-x-e27-reality', '', '', '', 'Lampa wisząca Clara złota 3 x E27 Reality', '', '', '', ''),
(350, 1, 2, 'Clara - lampa wisząca różowe złoto. 3xE27 40W. Wysokość 13cm. Wysokość całkowita 100cm. Szerokość 61cm. Głębokość 15cm. Klosze 15 i 8cm szklane różowe złoto i przezroczyste', '', 'lampa-wiszaca-clara-zlota-3-x-e27-reality', '', '', '', 'Lampa wisząca Clara złota 3 x E27 Reality', '', '', '', ''),
(351, 1, 1, 'Manacor 3 lampa wisząca biła - jest to lampa wisząca, w kształcie tuby. Składa się z trzech transparentnych, szklanych kloszy z metalową, białą tubą w środku. Klasyczna, prosta, skromna ale jednocześnie z klasą, szykiem i elegancją. Blask trzech źródeł światła jakie oferuje, cudownie rozświetli każdy zakamarek Twojego mieszkania. Światło z lampy Manacor, pada prostopadle, dzięki temu wszystko, co jest umieszczone pod nią, zostanie pięknie oświetlone. Wszystko to nada niepowtarzalnego charakteru, szczególnie w nowoczesnych wnętrzach. Ponadto, lampa świetnie odnajdzie się w pokojach młodzieżowych gościnnych czy kuchni.', '', 'lampa-wiszaca-manacor-biala-3-x-gu10-light-prestige', '', '', '', 'Lampa wisząca Manacor biała 3 x GU10 Light Prestige', '', '', '', ''),
(351, 1, 2, 'Manacor 3 lampa wisząca biła - jest to lampa wisząca, w kształcie tuby. Składa się z trzech transparentnych, szklanych kloszy z metalową, białą tubą w środku. Klasyczna, prosta, skromna ale jednocześnie z klasą, szykiem i elegancją. Blask trzech źródeł światła jakie oferuje, cudownie rozświetli każdy zakamarek Twojego mieszkania. Światło z lampy Manacor, pada prostopadle, dzięki temu wszystko, co jest umieszczone pod nią, zostanie pięknie oświetlone. Wszystko to nada niepowtarzalnego charakteru, szczególnie w nowoczesnych wnętrzach. Ponadto, lampa świetnie odnajdzie się w pokojach młodzieżowych gościnnych czy kuchni.', '', 'lampa-wiszaca-manacor-biala-3-x-gu10-light-prestige', '', '', '', 'Lampa wisząca Manacor biała 3 x GU10 Light Prestige', '', '', '', ''),
(352, 1, 1, 'Flowers lampa dziecięca wisząca - to zdecydowanie, propozycja lampy wiszącej do dziecięco pokoju. Na oświetlenie składa się duży klosz, który jest okrągły. Pokryty jest białą tkaniną we wzorki z motylkami i kwiatkami. Produkt ten, przystosowany jest do jednego źródła światła - E27.', '', 'lampa-wiszaca-flowers-biala-e27-light-prestige', '', '', '', 'Lampa wisząca Flowers biała E27 Light Prestige', '', '', '', ''),
(352, 1, 2, 'Flowers lampa dziecięca wisząca - to zdecydowanie, propozycja lampy wiszącej do dziecięco pokoju. Na oświetlenie składa się duży klosz, który jest okrągły. Pokryty jest białą tkaniną we wzorki z motylkami i kwiatkami. Produkt ten, przystosowany jest do jednego źródła światła - E27.', '', 'lampa-wiszaca-flowers-biala-e27-light-prestige', '', '', '', 'Lampa wisząca Flowers biała E27 Light Prestige', '', '', '', ''),
(353, 1, 1, 'Lampa wisząca ITALUX Marbelio to nietuzinkowy zwis przyozdobiony szklanymi bańkami w bursztynowym kolorze Rozświetli każde wnętrze nadając mu przytulny klimat i wyjątkowy charakter. Sprawdzi się zarówno w nowoczesnych aranżacjach jak i loftowych wnętrzach.', '', 'lampa-wiszaca-marbelio-brazowa-15-x-g9-italux', '', '', '', 'Lampa wisząca Marbelio brązowa 15 x G9 Italux', '', '', '', ''),
(353, 1, 2, 'Lampa wisząca ITALUX Marbelio to nietuzinkowy zwis przyozdobiony szklanymi bańkami w bursztynowym kolorze Rozświetli każde wnętrze nadając mu przytulny klimat i wyjątkowy charakter. Sprawdzi się zarówno w nowoczesnych aranżacjach jak i loftowych wnętrzach.', '', 'lampa-wiszaca-marbelio-brazowa-15-x-g9-italux', '', '', '', 'Lampa wisząca Marbelio brązowa 15 x G9 Italux', '', '', '', ''),
(354, 1, 1, 'Lampa wisząca ITALUX Marbelio to nietuzinkowy zwis przyozdobiony szklanymi bańkami w bursztynowym kolorze Rozświetli każde wnętrze nadając mu przytulny klimat i wyjątkowy charakter. Sprawdzi się zarówno w nowoczesnych aranżacjach jak i loftowych wnętrzach.', '', 'lampa-wiszaca-marbelio-brazowa-16-x-g9-italux', '', '', '', 'Lampa wisząca Marbelio brązowa 16 x G9 Italux', '', '', '', ''),
(354, 1, 2, 'Lampa wisząca ITALUX Marbelio to nietuzinkowy zwis przyozdobiony szklanymi bańkami w bursztynowym kolorze Rozświetli każde wnętrze nadając mu przytulny klimat i wyjątkowy charakter. Sprawdzi się zarówno w nowoczesnych aranżacjach jak i loftowych wnętrzach.', '', 'lampa-wiszaca-marbelio-brazowa-16-x-g9-italux', '', '', '', 'Lampa wisząca Marbelio brązowa 16 x G9 Italux', '', '', '', ''),
(355, 1, 1, 'TESORO to propozycja lampy wiszącej od polskiej marki MiLAGRO, którą wyposażono w moduł LED. Produkt wykonano ze szlachetnego metalu w połączeniu z wysokiej jakości tworzywem sztucznym. Futurystyczny design lampy sprawdzi się idealnie w minimalistycznym lub nowoczesnym wnętrzu, nadając aranżacji ciekawy charakter. Model ten dostępny jest w kolorze: czarny mat oraz złoty. Lampa TESORO może służyć także jako ciekawy element dekoracyjny w każdym pomieszczeniu. Produkty objęte są 2-letnią gwarancją, w ramach której świadczone są nieodpłatne usługi gwarancyjne. Po upływie ww. okresu istnieje możliwość skorzystania ze specjalistycznego firmowego serwisu.', '', 'zyrandol-tesoro-zloty-2700-lm-led-milagro', '', '', '', 'Żyrandol Tesoro złoty 2700 lm LED Milagro', '', '', '', ''),
(355, 1, 2, 'TESORO to propozycja lampy wiszącej od polskiej marki MiLAGRO, którą wyposażono w moduł LED. Produkt wykonano ze szlachetnego metalu w połączeniu z wysokiej jakości tworzywem sztucznym. Futurystyczny design lampy sprawdzi się idealnie w minimalistycznym lub nowoczesnym wnętrzu, nadając aranżacji ciekawy charakter. Model ten dostępny jest w kolorze: czarny mat oraz złoty. Lampa TESORO może służyć także jako ciekawy element dekoracyjny w każdym pomieszczeniu. Produkty objęte są 2-letnią gwarancją, w ramach której świadczone są nieodpłatne usługi gwarancyjne. Po upływie ww. okresu istnieje możliwość skorzystania ze specjalistycznego firmowego serwisu.', '', 'zyrandol-tesoro-zloty-2700-lm-led-milagro', '', '', '', 'Żyrandol Tesoro złoty 2700 lm LED Milagro', '', '', '', ''),
(356, 1, 1, 'LUCERO to linia stylowych lamp wiszących, które wyposażono w energooszczędny moduł LED. Charakteryzują się one nietuzinkowym designem. Lampy te będą idealnym dodatkiem do futurystycznych lub minimalistycznych wnętrz. Wykonano je z metalu oraz wysokiej jakości tworzywa sztucznego. Każda z lamp posiada możliwość regulacji wysokości. Linia LUCENO dostępna jest w dwóch wersjach kolorystycznych: złotej oraz matowej czarnej. Lampy te będą doskonałym wyborem do salonu lub kuchni, gdzie na pewno przyciągną spojrzenia gości. Produkty objęte są 2-letnią gwarancją, w ramach której świadczone są nieodpłatne usługi gwarancyjne. Po upływie ww. okresu istnieje możliwość skorzystania ze specjalistycznego firmowego serwisu.', '', 'lampa-wiszaca-lucero-2700-lm-led-milagro', '', '', '', 'Lampa wisząca Lucero 2700 lm LED Milagro', '', '', '', ''),
(356, 1, 2, 'LUCERO to linia stylowych lamp wiszących, które wyposażono w energooszczędny moduł LED. Charakteryzują się one nietuzinkowym designem. Lampy te będą idealnym dodatkiem do futurystycznych lub minimalistycznych wnętrz. Wykonano je z metalu oraz wysokiej jakości tworzywa sztucznego. Każda z lamp posiada możliwość regulacji wysokości. Linia LUCENO dostępna jest w dwóch wersjach kolorystycznych: złotej oraz matowej czarnej. Lampy te będą doskonałym wyborem do salonu lub kuchni, gdzie na pewno przyciągną spojrzenia gości. Produkty objęte są 2-letnią gwarancją, w ramach której świadczone są nieodpłatne usługi gwarancyjne. Po upływie ww. okresu istnieje możliwość skorzystania ze specjalistycznego firmowego serwisu.', '', 'lampa-wiszaca-lucero-2700-lm-led-milagro', '', '', '', 'Lampa wisząca Lucero 2700 lm LED Milagro', '', '', '', ''),
(357, 1, 1, 'Ta lampa wisząca Inspire Tonka o średnicy 23 cm nada Twojemu wnętrzu szyku i nowoczesności. Na skrzyżowaniu czystych stylów industrialnych i designerskich to zawieszenie jest idealne do oświetlenia małego pomieszczenia. Może być używana pojedynczo lub w zestawie nad blatem baru lub wyspą kuchenną, aby stworzyć w pełni stylową atmosferę. Długość kabla można regulować, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz.', '', 'lampa-wiszaca-tonka-szara-e27-inspire', '', '', '', 'Lampa wisząca Tonka szara E27 Inspire', '', '', '', ''),
(357, 1, 2, 'Ta lampa wisząca Inspire Tonka o średnicy 23 cm nada Twojemu wnętrzu szyku i nowoczesności. Na skrzyżowaniu czystych stylów industrialnych i designerskich to zawieszenie jest idealne do oświetlenia małego pomieszczenia. Może być używana pojedynczo lub w zestawie nad blatem baru lub wyspą kuchenną, aby stworzyć w pełni stylową atmosferę. Długość kabla można regulować, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz.', '', 'lampa-wiszaca-tonka-szara-e27-inspire', '', '', '', 'Lampa wisząca Tonka szara E27 Inspire', '', '', '', ''),
(358, 1, 1, 'Ta lampa wisząca Inspire Pecan o średnicy 60 cm nada Twojemu wnętrzu ciepły akcent. Ta lampa wisząca została wykonana z innowacyjnego materiału, naturalnie zrównoważonego zasobu, który szybko rośnie i ma ciepły wygląd: bambusa. To zawieszenie będzie idealne na przykład nad stołem w jadalni lub nad wyspą kuchenną. Długość kabla można regulować, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Zwróć uwagę, że kabel jest również chroniony przez powłokę z tkaniny, co zapewnia dodatkowy akcent wyrafinowania. Możesz spersonalizować renderowanie światła, wybierając 3 żarówki E27 Lexman dostosowane do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, jaki produkt przyniesie na Twojej ścianie, zalecamy stosowanie przezroczystych żarówek dekoracyjnych z żarnikiem. Żarówki sprzedawane są osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz', '', 'lampa-wiszaca-pecan-czarno-bezowa-3-x-e27-inspire', '', '', '', 'Lampa wisząca Pecan czarno-beżowa 3 x E27 Inspire', '', '', '', ''),
(358, 1, 2, 'Ta lampa wisząca Inspire Pecan o średnicy 60 cm nada Twojemu wnętrzu ciepły akcent. Ta lampa wisząca została wykonana z innowacyjnego materiału, naturalnie zrównoważonego zasobu, który szybko rośnie i ma ciepły wygląd: bambusa. To zawieszenie będzie idealne na przykład nad stołem w jadalni lub nad wyspą kuchenną. Długość kabla można regulować, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Zwróć uwagę, że kabel jest również chroniony przez powłokę z tkaniny, co zapewnia dodatkowy akcent wyrafinowania. Możesz spersonalizować renderowanie światła, wybierając 3 żarówki E27 Lexman dostosowane do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, jaki produkt przyniesie na Twojej ścianie, zalecamy stosowanie przezroczystych żarówek dekoracyjnych z żarnikiem. Żarówki sprzedawane są osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz', '', 'lampa-wiszaca-pecan-czarno-bezowa-3-x-e27-inspire', '', '', '', 'Lampa wisząca Pecan czarno-beżowa 3 x E27 Inspire', '', '', '', ''),
(359, 1, 1, '.', '', 'lampa-wiszaca-cordera-brazowa-e27-inspire', '', '', '', 'Lampa wisząca Cordera brązowa E27 Inspire', '', '', '', ''),
(359, 1, 2, '.', '', 'lampa-wiszaca-cordera-brazowa-e27-inspire', '', '', '', 'Lampa wisząca Cordera brązowa E27 Inspire', '', '', '', ''),
(360, 1, 1, 'Lampa wisząca Venosa marki Inspire o średnicy 18 cm idealnie nadaje się do oświetlania niewielkich pomieszczeń, takich jak biuro, korytarz lub hol wejściowy. Dzięki stonowanemu i czystemu wzornictwu, stanowiącemu połączenie białego metalu i naturalnego drewnianego wykończenia, lampa nada skandynawski charakter Twoim wnętrzom. Venosa spełnia ekologiczne standardy, jest wykonana z drewna pochodzącego z odpowiedzialnie zarządzanych lasów i uzyskała certyfikat FSC. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). Do tej lampy wiszącej można również dobrać inne produkty z tej samej linii.', '', 'lampa-wiszaca-venosa-e27-biala-inspire', '', '', '', 'Lampa wisząca Venosa E27 biała Inspire', '', '', '', ''),
(360, 1, 2, 'Lampa wisząca Venosa marki Inspire o średnicy 18 cm idealnie nadaje się do oświetlania niewielkich pomieszczeń, takich jak biuro, korytarz lub hol wejściowy. Dzięki stonowanemu i czystemu wzornictwu, stanowiącemu połączenie białego metalu i naturalnego drewnianego wykończenia, lampa nada skandynawski charakter Twoim wnętrzom. Venosa spełnia ekologiczne standardy, jest wykonana z drewna pochodzącego z odpowiedzialnie zarządzanych lasów i uzyskała certyfikat FSC. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). Do tej lampy wiszącej można również dobrać inne produkty z tej samej linii.', '', 'lampa-wiszaca-venosa-e27-biala-inspire', '', '', '', 'Lampa wisząca Venosa E27 biała Inspire', '', '', '', ''),
(361, 1, 1, 'Lampa wisząca Venosa marki Inspire o średnicy 28 cm pasuje do różnych pomieszczeń, na przykład sypialni, salonu lub przedpokoju. Dzięki stonowanemu i czystemu wzornictwu, stanowiącemu połączenie białego metalu i naturalnego drewnianego wykończenia, lampa nada skandynawski charakter Twoim wnętrzom. Venosa spełnia ekologiczne standardy, jest wykonana z drewna pochodzącego z odpowiedzialnie zarządzanych lasów i uzyskała certyfikat FSC. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). Do lampy  można również dobrać inne produkty z tej samej linii.', '', 'lampa-wiszaca-venosa-e27-biala-inspire', '', '', '', 'Lampa wisząca Venosa E27 biała Inspire', '', '', '', ''),
(361, 1, 2, 'Lampa wisząca Venosa marki Inspire o średnicy 28 cm pasuje do różnych pomieszczeń, na przykład sypialni, salonu lub przedpokoju. Dzięki stonowanemu i czystemu wzornictwu, stanowiącemu połączenie białego metalu i naturalnego drewnianego wykończenia, lampa nada skandynawski charakter Twoim wnętrzom. Venosa spełnia ekologiczne standardy, jest wykonana z drewna pochodzącego z odpowiedzialnie zarządzanych lasów i uzyskała certyfikat FSC. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). Do lampy  można również dobrać inne produkty z tej samej linii.', '', 'lampa-wiszaca-venosa-e27-biala-inspire', '', '', '', 'Lampa wisząca Venosa E27 biała Inspire', '', '', '', ''),
(362, 1, 1, 'Chromowana lampa sufitowa Loob nada Twojemu domowi designerski charakter. Dzięki 6 oprawom z możliwością zmiany ustawienia, za pomocą tej lampy sufitowej można oświetlić duży obszar z kilku kierunków jednocześnie. Chromowane wykończenie wniesie do wnętrza nutę nowoczesności. Lampa Inspire o temperaturze barwowej 3000 K zapewni ciepłą atmosferę w Twoim pokoju. Produkt  można dowolnie łączyć z innymi lampami z tej samej serii, aby zastosować podobny styl w swoim domu.', '', 'lampa-sufitowa-loob-630-lm-chrom-6-x-led-inspire', '', '', '', 'Lampa sufitowa Loob 630 lm chrom 6 x LED Inspire', '', '', '', ''),
(362, 1, 2, 'Chromowana lampa sufitowa Loob nada Twojemu domowi designerski charakter. Dzięki 6 oprawom z możliwością zmiany ustawienia, za pomocą tej lampy sufitowej można oświetlić duży obszar z kilku kierunków jednocześnie. Chromowane wykończenie wniesie do wnętrza nutę nowoczesności. Lampa Inspire o temperaturze barwowej 3000 K zapewni ciepłą atmosferę w Twoim pokoju. Produkt  można dowolnie łączyć z innymi lampami z tej samej serii, aby zastosować podobny styl w swoim domu.', '', 'lampa-sufitowa-loob-630-lm-chrom-6-x-led-inspire', '', '', '', 'Lampa sufitowa Loob 630 lm chrom 6 x LED Inspire', '', '', '', ''),
(363, 1, 1, 'Lampa wisząca Linden Inspire, wykonana z naturalnej tkaniny lnianej, o całkowitej średnicy 60,5 cm, idealnie nadaje się do oświetlania pomieszczeń, tworząc przy tym ciepłą atmosferę. Piękny dla oka i przyjemny w dotyku len jest materiałem używanym od setek lat, który posiada niezaprzeczalne zalety ekologiczne, zwłaszcza w porównaniu z bawełną lub tekstyliami syntetycznymi. Lniany abażur sprawia, że światło staje się cieplejsze i intensywniejsze. Ponadczasowa, naturalna i ekologiczna seria lamp Linden jest trochę w stylu bohemy i vintage, a mimo to ma całkowicie współczesny charakter. Lampę można zainstalować na dwa różne sposoby: trzy kable mogą swobodnie zwisać lub mogą być przymocowane do sufitu i rozmieszczone w różnych miejscach.  Długość kabli jest regulowana, dzięki czemu lampę można idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówek E27 Lexman dostosowanym do Twoich potrzeb.', '', 'lampa-wiszaca-linden-bezowa-3-x-e27-inspire', '', '', '', 'Lampa wisząca Linden beżowa 3 x E27 Inspire', '', '', '', ''),
(363, 1, 2, 'Lampa wisząca Linden Inspire, wykonana z naturalnej tkaniny lnianej, o całkowitej średnicy 60,5 cm, idealnie nadaje się do oświetlania pomieszczeń, tworząc przy tym ciepłą atmosferę. Piękny dla oka i przyjemny w dotyku len jest materiałem używanym od setek lat, który posiada niezaprzeczalne zalety ekologiczne, zwłaszcza w porównaniu z bawełną lub tekstyliami syntetycznymi. Lniany abażur sprawia, że światło staje się cieplejsze i intensywniejsze. Ponadczasowa, naturalna i ekologiczna seria lamp Linden jest trochę w stylu bohemy i vintage, a mimo to ma całkowicie współczesny charakter. Lampę można zainstalować na dwa różne sposoby: trzy kable mogą swobodnie zwisać lub mogą być przymocowane do sufitu i rozmieszczone w różnych miejscach.  Długość kabli jest regulowana, dzięki czemu lampę można idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówek E27 Lexman dostosowanym do Twoich potrzeb.', '', 'lampa-wiszaca-linden-bezowa-3-x-e27-inspire', '', '', '', 'Lampa wisząca Linden beżowa 3 x E27 Inspire', '', '', '', ''),
(364, 1, 1, 'Lampa wisząca Merone Inspire w czarnym matowym wykończeniu, o średnicy 32 cm, idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. Elegancję, unikatowość i współczesny styl designerskiego wnętrza podkreślą piękne żarówki dekoracyjne zastosowane w lampie serii Merone. Druty krzyżują się, tworząc dwie warstwy wokół żarówki. Rzucane cienie subtelnie padają na ściany i sufit. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. Zalecamy użycie przezroczystej żarówki dekoracyjnej, jeśli chcesz cieszyć się efektem świetlnym na swojej ścianie. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia', '', 'lampa-wiszaca-merone-czarna-e27-inspire', '', '', '', 'Lampa wisząca Merone czarna E27 Inspire', '', '', '', ''),
(364, 1, 2, 'Lampa wisząca Merone Inspire w czarnym matowym wykończeniu, o średnicy 32 cm, idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. Elegancję, unikatowość i współczesny styl designerskiego wnętrza podkreślą piękne żarówki dekoracyjne zastosowane w lampie serii Merone. Druty krzyżują się, tworząc dwie warstwy wokół żarówki. Rzucane cienie subtelnie padają na ściany i sufit. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. Zalecamy użycie przezroczystej żarówki dekoracyjnej, jeśli chcesz cieszyć się efektem świetlnym na swojej ścianie. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia', '', 'lampa-wiszaca-merone-czarna-e27-inspire', '', '', '', 'Lampa wisząca Merone czarna E27 Inspire', '', '', '', ''),
(365, 1, 1, 'Lampa wisząca Frella Inspire o białym matowym wykończeniu i średnicy 38 cm, idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. Dzięki swojemu naturalnemu stylowi Frella wniesie do Twojego domu akcenty delikatności. Klosz tworzy iluzję lasu tropikalnego, gdyż po włączeniu ściana wygląda jak pokryta bujną roślinnością. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb.', '', 'lampa-wiszaca-frella-e27-biala-inspire', '', '', '', 'Lampa wisząca Frella E27 biała Inspire', '', '', '', ''),
(365, 1, 2, 'Lampa wisząca Frella Inspire o białym matowym wykończeniu i średnicy 38 cm, idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. Dzięki swojemu naturalnemu stylowi Frella wniesie do Twojego domu akcenty delikatności. Klosz tworzy iluzję lasu tropikalnego, gdyż po włączeniu ściana wygląda jak pokryta bujną roślinnością. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb.', '', 'lampa-wiszaca-frella-e27-biala-inspire', '', '', '', 'Lampa wisząca Frella E27 biała Inspire', '', '', '', ''),
