(367, 1, 1, 'Lampa wisząca Eldrick, wykonana z wysokiej jakości materiału, wpasuje się w każde nowoczesne wnętrze. Nadaje wnętrzom nowoczesny, industrialny, loftowy design. Lampa przeznaczona jest na pięć źródeł światła o tradycyjnym gwincie E27. Pozwoli to oświetlić każde wnętrze. Polecamy użyć źródeł światła wykonanych w całości ze szkła. Świetnie nadają się źródła światła przezroczyste, z mlecznym szkłem lub bursztynowym.', '', 'lampa-wiszaca-eldrick-czarna-5-x-e27-inspire', '', '', '', 'Lampa wisząca Eldrick czarna 5 x E27 Inspire', '', '', '', ''),
