(369, 1, 1, 'Lampa wisząca Eldrick wykonana z wysokiej jakości materiału wpasuje się w każde nowoczesne wnętrze. Nadaje wnętrzom nowoczesny, industrialny loftowy design. Lampa przeznaczona jest na źródło światła o tradycyjnym gwincie E27, co pozwoli oświetlić każde wnętrze. Polecamy użyć źródeł światła wykonanych w całości ze szkła. Świetnie nadają się źródła światła przezroczyste, z mlecznym szkłem lub bursztynowym.', '', 'lampa-wiszaca-eldrick-czarna-e27-inspire', '', '', '', 'Lampa wisząca Eldrick czarna E27 Inspire', '', '', '', ''),
(369, 1, 2, 'Lampa wisząca Eldrick wykonana z wysokiej jakości materiału wpasuje się w każde nowoczesne wnętrze. Nadaje wnętrzom nowoczesny, industrialny loftowy design. Lampa przeznaczona jest na źródło światła o tradycyjnym gwincie E27, co pozwoli oświetlić każde wnętrze. Polecamy użyć źródeł światła wykonanych w całości ze szkła. Świetnie nadają się źródła światła przezroczyste, z mlecznym szkłem lub bursztynowym.', '', 'lampa-wiszaca-eldrick-czarna-e27-inspire', '', '', '', 'Lampa wisząca Eldrick czarna E27 Inspire', '', '', '', ''),
(370, 1, 1, 'Ta czarna lampa wisząca marki Inspire jest idealna do oświetlenia średniej wielkości pomieszczenia lub do powieszenia nad stołem. Glint to ładne industrialne zawieszenie. Klosz tej lampy można łatwo zdjąć. Może on ukryć żarówkę, aby uzyskać bardziej elegancką i współczesną interpretację stylu industrialnego. Dla podkreślenia stylu industrialnego w pomieszczeniu można zrezygnować z klosza. Pozwoli to na pokazanie dekoracyjnej żarówki. Dzięki nowoczesnemu kształtowi lampa Glint z łatwością dopasuje się do Twojego pomieszczenia.', '', 'lampa-wiszaca-glint-czarna-e27-inspire', '', '', '', 'Lampa wisząca Glint czarna E27 Inspire', '', '', '', ''),
(370, 1, 2, 'Ta czarna lampa wisząca marki Inspire jest idealna do oświetlenia średniej wielkości pomieszczenia lub do powieszenia nad stołem. Glint to ładne industrialne zawieszenie. Klosz tej lampy można łatwo zdjąć. Może on ukryć żarówkę, aby uzyskać bardziej elegancką i współczesną interpretację stylu industrialnego. Dla podkreślenia stylu industrialnego w pomieszczeniu można zrezygnować z klosza. Pozwoli to na pokazanie dekoracyjnej żarówki. Dzięki nowoczesnemu kształtowi lampa Glint z łatwością dopasuje się do Twojego pomieszczenia.', '', 'lampa-wiszaca-glint-czarna-e27-inspire', '', '', '', 'Lampa wisząca Glint czarna E27 Inspire', '', '', '', ''),
(371, 1, 1, 'Lampa wisząca Nama marki Inspire o średnicy 20 cm jest idealna do oświetlenia małego pomieszczenia, do umieszczenia nad małym stołem lub do powieszenia nad blatem kuchennym. Nama dzięki swojej stylistyce wniesie do Twojego wnętrza nowoczesność. Wysokość produktu jest regulowana, dzięki czemu można go idealnie dopasować do pomieszczenia. Możesz dobrać do lampy żarówkę Lexman, jaka najbardziej odpowiada Twoim preferencjom.', '', 'lampa-wiszaca-nama-szara-e27-inspire', '', '', '', 'Lampa wisząca Nama szara E27 Inspire', '', '', '', ''),
(371, 1, 2, 'Lampa wisząca Nama marki Inspire o średnicy 20 cm jest idealna do oświetlenia małego pomieszczenia, do umieszczenia nad małym stołem lub do powieszenia nad blatem kuchennym. Nama dzięki swojej stylistyce wniesie do Twojego wnętrza nowoczesność. Wysokość produktu jest regulowana, dzięki czemu można go idealnie dopasować do pomieszczenia. Możesz dobrać do lampy żarówkę Lexman, jaka najbardziej odpowiada Twoim preferencjom.', '', 'lampa-wiszaca-nama-szara-e27-inspire', '', '', '', 'Lampa wisząca Nama szara E27 Inspire', '', '', '', ''),
(372, 1, 1, 'Lampa sufitowa Goteo marki Inspire jest idealna do umieszczenia na suficie. Mimo prostej konstrukcji lampa pięknie doświetli małe pomieszczenie, pozostając jednocześnie wyrafinowaną i schludną dekoracją. Oprawa jest w kolorze białym. Możesz spersonalizować lampę dobierając odpowiednią żarówkę Lexman z gwintem E27 o kształcie, mocy i barwie światła dostosowaną do Twoich potrzeb.', '', 'lampa-sufitowa-goteo-biala-e27-inspire', '', '', '', 'Lampa sufitowa Goteo biała E27 Inspire', '', '', '', ''),
(372, 1, 2, 'Lampa sufitowa Goteo marki Inspire jest idealna do umieszczenia na suficie. Mimo prostej konstrukcji lampa pięknie doświetli małe pomieszczenie, pozostając jednocześnie wyrafinowaną i schludną dekoracją. Oprawa jest w kolorze białym. Możesz spersonalizować lampę dobierając odpowiednią żarówkę Lexman z gwintem E27 o kształcie, mocy i barwie światła dostosowaną do Twoich potrzeb.', '', 'lampa-sufitowa-goteo-biala-e27-inspire', '', '', '', 'Lampa sufitowa Goteo biała E27 Inspire', '', '', '', ''),
(373, 1, 1, 'Lampa wisząca SITIA marki INSPIRE o średnicy 48 cm w kolorze szarym jest idealna do oświetlenia średniej wielkości pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-48-cm-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Sitia 48 cm szara 3 x E27 Inspire', '', '', '', ''),
(373, 1, 2, 'Lampa wisząca SITIA marki INSPIRE o średnicy 48 cm w kolorze szarym jest idealna do oświetlenia średniej wielkości pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-48-cm-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Sitia 48 cm szara 3 x E27 Inspire', '', '', '', ''),
