(374, 1, 2, 'Lampa wisząca SITIA marki INSPIRE o średnicy 38 cm w kolorze białym jest idealna do oświetlenia średniej wielkości pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-38-cm-biala-e27-inspire', '', '', '', 'Lampa wisząca Sitia 38 cm biała E27 Inspire', '', '', '', ''),
(375, 1, 1, 'Lampa wisząca Hoki marki INSPIRE z matowego białego metalu jest idealna do oświetlenia małego pomieszczenia w stylu Design, natomiast by oświetlić większy pokój można oprawę zwielokrotnić w przestrzeni - powiesić kilka lamp obok siebie w linii lub klastrze. Stworzy się piękna kompozycja nad blatem lub wyspą w kuchni. Dzięki swojej stonowanej i nowoczesnej stylistyce Hoki z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować rozprzestrzenianie się światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Zalecamy użycie żarówki o średnicy od 70 mm do 120 mm, aby uzyskać optymalny efekt estetyczny. Długość kabla tej oprawy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji każdego pomieszczenia.', '', 'lampa-wiszaca-hoki-biala-e27-inspire', '', '', '', 'Lampa wisząca Hoki biała E27 Inspire', '', '', '', ''),
(375, 1, 2, 'Lampa wisząca Hoki marki INSPIRE z matowego białego metalu jest idealna do oświetlenia małego pomieszczenia w stylu Design, natomiast by oświetlić większy pokój można oprawę zwielokrotnić w przestrzeni - powiesić kilka lamp obok siebie w linii lub klastrze. Stworzy się piękna kompozycja nad blatem lub wyspą w kuchni. Dzięki swojej stonowanej i nowoczesnej stylistyce Hoki z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować rozprzestrzenianie się światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Zalecamy użycie żarówki o średnicy od 70 mm do 120 mm, aby uzyskać optymalny efekt estetyczny. Długość kabla tej oprawy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji każdego pomieszczenia.', '', 'lampa-wiszaca-hoki-biala-e27-inspire', '', '', '', 'Lampa wisząca Hoki biała E27 Inspire', '', '', '', ''),
(376, 1, 1, 'Lampa wisząca SITIA marki INSPIRE o średnicy 28 cm w kolorze białym jest idealna do oświetlenia małego pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-28-cm-biala-e27-inspire', '', '', '', 'Lampa wisząca Sitia 28 cm biała E27 Inspire', '', '', '', ''),
(376, 1, 2, 'Lampa wisząca SITIA marki INSPIRE o średnicy 28 cm w kolorze białym jest idealna do oświetlenia małego pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-28-cm-biala-e27-inspire', '', '', '', 'Lampa wisząca Sitia 28 cm biała E27 Inspire', '', '', '', ''),
(377, 1, 1, 'Lampa wisząca Zina marki Inspire o średnicy 40 cm jest idealna do oświetlenia średniej wielkości pomieszczenia. Dzięki lnianemu kloszowi Zina wprowadzi do Twojego pomieszczenia miękkie i stonowane światło. Lampa wspaniale ociepli wnętrze i dopasuje się do skandynawskiego wystroju pomieszczenia. Możesz również spersonalizować sposób rozproszenia światła, wybierając żarówkę dostosowaną do swoich potrzeb o \"dużym trzonku\" E27.', '', 'lampa-wiszaca-zina-lniana-e27-inspire', '', '', '', 'Lampa wisząca Zina lniana E27 Inspire', '', '', '', ''),
