(384, 1, 1, 'Lampa wisząca Jazon marki Inspire o średnicy 38 cm idealnie nadaje się do oświetlania i dekorowania różnego rodzaju pomieszczeń, takich jak duży hol wejściowy, przestronny salon, biuro, czy sypialnia. Jazon to połączenie matowej czerni i matowego mosiężnego żelaza. Ma zaokrąglone kształty, a złote wnętrze klosza rozprasza światło, tworząc ciepłą i zmysłową atmosferę. Lampa jest doskonałym dodatkiem do wnętrz w stylu glamour. Posiada przewód o regulowanej długości, dzięki któremu można ją powiesić w odległości aż 120 cm od sufitu i idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. W celu uzyskania optymalnego efektu zalecamy użycie żarówki o średnicy do 80 mm i wysokości do 150 mm.', '', 'lampa-wiszaca-czarna-e27-inspire', '', '', '', 'Lampa wisząca  czarna E27 Inspire', '', '', '', ''),
(384, 1, 2, 'Lampa wisząca Jazon marki Inspire o średnicy 38 cm idealnie nadaje się do oświetlania i dekorowania różnego rodzaju pomieszczeń, takich jak duży hol wejściowy, przestronny salon, biuro, czy sypialnia. Jazon to połączenie matowej czerni i matowego mosiężnego żelaza. Ma zaokrąglone kształty, a złote wnętrze klosza rozprasza światło, tworząc ciepłą i zmysłową atmosferę. Lampa jest doskonałym dodatkiem do wnętrz w stylu glamour. Posiada przewód o regulowanej długości, dzięki któremu można ją powiesić w odległości aż 120 cm od sufitu i idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. W celu uzyskania optymalnego efektu zalecamy użycie żarówki o średnicy do 80 mm i wysokości do 150 mm.', '', 'lampa-wiszaca-czarna-e27-inspire', '', '', '', 'Lampa wisząca  czarna E27 Inspire', '', '', '', ''),
