(387, 1, 1, 'Lampa wisząca Hoki marki Inspire świetnie nadaje się do oświetlania dużych przestrzeni, na przykład salonu. Za jej pomocą można także wydzielić przestrzeń nad blatem barowym lub stołem w jadalni. Dzięki swojemu stonowanemu i nowoczesnemu stylowi Hoki z łatwością dopasuje się do stylu Twojego domu. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. Zalecamy użycie żarówki o średnicy od 70 do 120 mm w celu uzyskania optymalnego efektu. Długość kabla lampy jest regulowana i maksymalnie może wynosić 137,5 cm, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Hoki to uniwersalna i stylowa seria.', '', 'lampa-wiszaca-hoki-czarna-e27-inspire', '', '', '', 'Lampa wisząca Hoki czarna E27 Inspire', '', '', '', ''),
(387, 1, 2, 'Lampa wisząca Hoki marki Inspire świetnie nadaje się do oświetlania dużych przestrzeni, na przykład salonu. Za jej pomocą można także wydzielić przestrzeń nad blatem barowym lub stołem w jadalni. Dzięki swojemu stonowanemu i nowoczesnemu stylowi Hoki z łatwością dopasuje się do stylu Twojego domu. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. Zalecamy użycie żarówki o średnicy od 70 do 120 mm w celu uzyskania optymalnego efektu. Długość kabla lampy jest regulowana i maksymalnie może wynosić 137,5 cm, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Hoki to uniwersalna i stylowa seria.', '', 'lampa-wiszaca-hoki-czarna-e27-inspire', '', '', '', 'Lampa wisząca Hoki czarna E27 Inspire', '', '', '', ''),
(388, 1, 1, 'Lampa wisząca Milky marki Inspire o średnicy 38 cm idealnie nadaje się do oświetlania i dekorowania różnego rodzaju pomieszczeń, takich jak duży hol wejściowy, przestronny salon, biuro, czy sypialnia. Milky to połączenie kremowego koloru, żelaza i kabla z tkaniny o prostym wzornictwie. Nowoczesny rustykalny charakter serii będzie doskonale pasował do domu w stylu industrialnym. Lampa ma przewód o regulowanej długości, dzięki któremu można ją powiesić w odległości aż 120 cm od sufitu i idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). W celu uzyskania optymalnego efektu zalecamy użycie żarówki o średnicy do 119 mm i wysokości do 150 mm. Do tej lampy można również dobrać inne produkty z tej samej serii.', '', 'lampa-wiszaca-milky-kremowa-e27-inspire', '', '', '', 'Lampa wisząca Milky kremowa E27 Inspire', '', '', '', ''),
(388, 1, 2, 'Lampa wisząca Milky marki Inspire o średnicy 38 cm idealnie nadaje się do oświetlania i dekorowania różnego rodzaju pomieszczeń, takich jak duży hol wejściowy, przestronny salon, biuro, czy sypialnia. Milky to połączenie kremowego koloru, żelaza i kabla z tkaniny o prostym wzornictwie. Nowoczesny rustykalny charakter serii będzie doskonale pasował do domu w stylu industrialnym. Lampa ma przewód o regulowanej długości, dzięki któremu można ją powiesić w odległości aż 120 cm od sufitu i idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). W celu uzyskania optymalnego efektu zalecamy użycie żarówki o średnicy do 119 mm i wysokości do 150 mm. Do tej lampy można również dobrać inne produkty z tej samej serii.', '', 'lampa-wiszaca-milky-kremowa-e27-inspire', '', '', '', 'Lampa wisząca Milky kremowa E27 Inspire', '', '', '', ''),
(389, 1, 1, 'Lampa wisząca Ted marki Inspire świetnie nadaje się do oświetlania dużych przestrzeni, na przykład salonu. Za jej pomocą można także wydzielić przestrzeń nad blatem barowym lub stołem w jadalni. Dzięki połączeniu matowego czarnego metalu z antycznym mosiężnym wykończeniem, Ted wniesie do Twojego wnętrza nutę współczesnej rustykalności i doskonale wkomponuje się w styl industrialny. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). W celu uzyskania optymalnego efektu zalecamy użycie żarówki o średnicy do 60 mm i wysokości do 119 mm.', '', 'lampa-wiszaca-ted-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Ted szara 3 x E27 Inspire', '', '', '', ''),
(389, 1, 2, 'Lampa wisząca Ted marki Inspire świetnie nadaje się do oświetlania dużych przestrzeni, na przykład salonu. Za jej pomocą można także wydzielić przestrzeń nad blatem barowym lub stołem w jadalni. Dzięki połączeniu matowego czarnego metalu z antycznym mosiężnym wykończeniem, Ted wniesie do Twojego wnętrza nutę współczesnej rustykalności i doskonale wkomponuje się w styl industrialny. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb (sprzedawane oddzielnie). W celu uzyskania optymalnego efektu zalecamy użycie żarówki o średnicy do 60 mm i wysokości do 119 mm.', '', 'lampa-wiszaca-ted-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Ted szara 3 x E27 Inspire', '', '', '', ''),
(390, 1, 1, 'Lampa wisząca Finch marki Inspire w kolorze czarnego matu idealnie nadaje się do oświetlania dużych, wysokich pomieszczeń. Świetnie sprawdzi się w dużym przedpokoju lub przestronnym salonie. Można ją także umieścić nad stołem w jadalni. Długość kabla lampy jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Bardzo eleganckie czyste linie i staranne wykończenia nadadzą Twojemu wnętrzu designerski charakter. Za pomocą dołączonego pilota można łatwo regulować temperaturę i natężenie światła. Lampa z wbudowaną żarówką LED.', '', 'lampa-wiszaca-finch-czarna-led-inspire', '', '', '', 'Lampa wisząca Finch czarna LED Inspire', '', '', '', ''),
