(395, 1, 1, 'Lampa sufitowa VANILLA Inspire wprowadzisz do swojego domu akcenty przyrodnicze. Ze względu na ładny klosz z bambusa sugerujemy użycie przezroczystej żarówki dekoracyjnej, aby cieszyć się świetlnymi efektami na ścianie.', '', 'lampa-sufitowa-vanilla-bambus-e27-inspire', '', '', '', 'Lampa sufitowa Vanilla bambus E27 Inspire', '', '', '', ''),
(395, 1, 2, 'Lampa sufitowa VANILLA Inspire wprowadzisz do swojego domu akcenty przyrodnicze. Ze względu na ładny klosz z bambusa sugerujemy użycie przezroczystej żarówki dekoracyjnej, aby cieszyć się świetlnymi efektami na ścianie.', '', 'lampa-sufitowa-vanilla-bambus-e27-inspire', '', '', '', 'Lampa sufitowa Vanilla bambus E27 Inspire', '', '', '', ''),
(396, 1, 1, 'Lampa wisząca Fonda Inspire o średnicy 60 cm idealnie pasuje do umieszczenia na przykład nad prostokątnym stołem w jadalni. Wniesie do Twojego wnętrza akcenty nowoczesności. Położenie czterech lamp można zmienić. Długość kabla jest regulowana, dzięki czemu lampę można idealnie dopasować do układu pomieszczenia. Ten produkt jest zintegrowany z diodami LED. Jej zimna barwa światła (4000 K) nada Twojemu wnętrzu dynamiczny wygląd.', '', 'lampa-wiszaca-concord-chrom-4-x-led-inspire', '', '', '', 'Lampa wisząca Concord chrom 4 x LED Inspire', '', '', '', ''),
(396, 1, 2, 'Lampa wisząca Fonda Inspire o średnicy 60 cm idealnie pasuje do umieszczenia na przykład nad prostokątnym stołem w jadalni. Wniesie do Twojego wnętrza akcenty nowoczesności. Położenie czterech lamp można zmienić. Długość kabla jest regulowana, dzięki czemu lampę można idealnie dopasować do układu pomieszczenia. Ten produkt jest zintegrowany z diodami LED. Jej zimna barwa światła (4000 K) nada Twojemu wnętrzu dynamiczny wygląd.', '', 'lampa-wiszaca-concord-chrom-4-x-led-inspire', '', '', '', 'Lampa wisząca Concord chrom 4 x LED Inspire', '', '', '', ''),
(397, 1, 1, 'Lampa wisząca Shoshone to połączenie elegancji i nowoczesności. Konstrukcja lampy to trzy obręcze z wbudowanymi diodami led kaskadowo zawieszone na eleganckiej chromowej ramie. Każda z obręczy jest ozdobiona kryształkami dzięki temu blask emitowanego światła jest pięknie rozproszony. Lampa z możliwością regulacji wysokości. Shoshone to lampa elegancka, idealna do salonu lub reprezentacyjnych wnętrz użytkowych. Wyróżnia się nowoczesnym designem, który zachwyci klientów szukających niebanalnych rozwiązań oraz ceniących niepowtarzalne wnętrza.', '', 'lampa-wiszaca-shoshone-chrom-led-inspire', '', '', '', 'Lampa wisząca Shoshone chrom LED INSPIRE', '', '', '', ''),
(397, 1, 2, 'Lampa wisząca Shoshone to połączenie elegancji i nowoczesności. Konstrukcja lampy to trzy obręcze z wbudowanymi diodami led kaskadowo zawieszone na eleganckiej chromowej ramie. Każda z obręczy jest ozdobiona kryształkami dzięki temu blask emitowanego światła jest pięknie rozproszony. Lampa z możliwością regulacji wysokości. Shoshone to lampa elegancka, idealna do salonu lub reprezentacyjnych wnętrz użytkowych. Wyróżnia się nowoczesnym designem, który zachwyci klientów szukających niebanalnych rozwiązań oraz ceniących niepowtarzalne wnętrza.', '', 'lampa-wiszaca-shoshone-chrom-led-inspire', '', '', '', 'Lampa wisząca Shoshone chrom LED INSPIRE', '', '', '', ''),
(398, 1, 1, 'Lampa wisząca Fonda Inspire w chromowym matowym wykończeniu, o długości 90 cm, idealnie pasuje do umieszczenia nad prostokątnym stołem w jadalni lub w kuchni. Dzięki swojemu designerskiemu stylowi Fonda wniesie do Twojego wnętrza akcenty nowoczesności, tworząc pionowe pasy na ścianie. Długość kabli jest regulowana, dzięki czemu lampę można idealnie dopasować do układu pomieszczenia. Ten produkt jest zintegrowany z diodami LED. Ciepła barwa światła (3000 K) ociepli wnętrza Twojego domu.', '', 'lampa-wiszaca-fonda-led-chrom-inspire', '', '', '', 'Lampa wisząca Fonda LED chrom Inspire', '', '', '', ''),
(398, 1, 2, 'Lampa wisząca Fonda Inspire w chromowym matowym wykończeniu, o długości 90 cm, idealnie pasuje do umieszczenia nad prostokątnym stołem w jadalni lub w kuchni. Dzięki swojemu designerskiemu stylowi Fonda wniesie do Twojego wnętrza akcenty nowoczesności, tworząc pionowe pasy na ścianie. Długość kabli jest regulowana, dzięki czemu lampę można idealnie dopasować do układu pomieszczenia. Ten produkt jest zintegrowany z diodami LED. Ciepła barwa światła (3000 K) ociepli wnętrza Twojego domu.', '', 'lampa-wiszaca-fonda-led-chrom-inspire', '', '', '', 'Lampa wisząca Fonda LED chrom Inspire', '', '', '', ''),
(399, 1, 1, 'Plafon Loob w kolorze czarnym nada Twojemu wnętrzu designerski charakter. Dzięki sześciu oprawom z możliwością zmiany ustawienia, za pomocą tej lampy sufitowej można oświetlić duży obszar z kilku kierunków jednocześnie. Czarne wykończenie wniesie do wnętrza nutę nowoczesności. Lampa o temperaturze barwowej 3000 K zapewni ciepłą atmosferę w Twoim pokoju. Produkt można dowolnie łączyć z innymi lampami z tej samej serii, aby zastosować podobny styl w swoim domu.', '', 'plafon-loob-4020-lm-inspire', '', '', '', 'Plafon LOOB  4020 lm  INSPIRE', '', '', '', ''),
(399, 1, 2, 'Plafon Loob w kolorze czarnym nada Twojemu wnętrzu designerski charakter. Dzięki sześciu oprawom z możliwością zmiany ustawienia, za pomocą tej lampy sufitowej można oświetlić duży obszar z kilku kierunków jednocześnie. Czarne wykończenie wniesie do wnętrza nutę nowoczesności. Lampa o temperaturze barwowej 3000 K zapewni ciepłą atmosferę w Twoim pokoju. Produkt można dowolnie łączyć z innymi lampami z tej samej serii, aby zastosować podobny styl w swoim domu.', '', 'plafon-loob-4020-lm-inspire', '', '', '', 'Plafon LOOB  4020 lm  INSPIRE', '', '', '', ''),
(400, 1, 1, 'Lampa wisząca Linden Inspire, wykonana z naturalnej tkaniny lnianej, o średnicy 50 cm, idealnie nadaje się do oświetlania pomieszczeń, tworząc przy tym ciepłą atmosferę. Piękny dla oka i przyjemny w dotyku len jest materiałem używanym od setek lat, który posiada niezaprzeczalne zalety ekologiczne, zwłaszcza w porównaniu z bawełną lub tekstyliami syntetycznymi. Lniany abażur sprawia, że światło staje się cieplejsze i intensywniejsze. Ponadczasowa, naturalna i ekologiczna seria lamp Linden jest trochę w stylu bohemy i vintage, a mimo to ma całkowicie współczesny charakter. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb.', '', 'lampa-sufitowa-linden-bezowy-e27-inspire', '', '', '', 'Lampa sufitowa Linden beżowy E27 Inspire', '', '', '', ''),
