(401, 1, 1, 'Lampa wisząca Anemone Inspire o białym matowym wykończeniu i dodatkiem drewna, o średnicy 45 cm, idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. Dzięki swojemu naturalnemu stylowi Anemone wniesie do Twojego wnętrza akcenty delikatności. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. Zalecamy użycie dużej przezroczystej żarówki dekoracyjnej, jeśli chcesz cieszyć się efektem świetlnym na swojej ścianie.', '', 'lampa-wiszaca-anemone-biala-e27-inspire', '', '', '', 'Lampa wisząca Anemone biała E27 Inspire', '', '', '', ''),
