(403, 1, 1, 'Lampa wisząca Marotta Inspire o czarnym matowym wykończeniu, średnicy 38 cm, idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. Dzięki swojemu stylowi glamour Marotta stanowić będzie piękny akcent dekoracyjny Twojego domu. Wzór inspirowany jest słynnymi liśćmi Ginkgo Biloba, przypominającymi małe wachlarze. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki różnym wariantom żarówki E27 Lexman dostosowanym do Twoich potrzeb. Z uwagi na ozdobny klosz zalecamy użycie dekoracyjnej żarówki, jeśli chcesz cieszyć się efektem świetlnym na swojej ścianie i suficie.', '', 'lampa-wiszaca-marotta-czarna-e27-inspire', '', '', '', 'Lampa wisząca Marotta czarna E27 Inspire', '', '', '', ''),
