(404, 1, 1, 'Lampa wisząca Merone Inspire w czarnym matowym wykończeniu. Podstawa o długości 79 cm idealnie pasuje do umieszczenia nad prostokątnym stołem w jadalni lub w kuchni. Elegancję, unikatowość i współczesny styl designerskiego wnętrza podkreślą piękne żarówki dekoracyjne zastosowane w lampie serii Merone. Druty krzyżują się, tworząc dwie warstwy wokół żarówki. Rzucane cienie subtelnie padają na ściany i sufit. Istnieje możliwość wyboru preferowanej barwy i mocy światła dzięki trzem wariantom żarówek E27 Lexman dostosowanym do Twoich potrzeb; Zalecamy użycie przezroczystych żarówek dekoracyjnych, jeśli chcesz cieszyć się efektem świetlnym na swojej ścianie. Długość kabla tej lampy wiszącej jest regulowana, dzięki czemu można ją idealnie dopasować do układu pomieszczenia.', '', 'lampa-wiszaca-merone-czarna-e27-inspire', '', '', '', 'Lampa wisząca Merone czarna E27 Inspire', '', '', '', ''),
