(408, 1, 1, 'Lampa wisząca Inspire idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. model ten może być wykorzystywany do oświetlania konkretnych pomieszczeń, jak na przykład salon. Dzięki swojemu eleganckiemu designowi lampa Borgos doskonale podkreśli wnętrze w nowoczesnym stylu. Polecamy wybór nowoczesnej żarówki, która będzie podkreślona szklanym kloszem o maksymalnej średnicy 95 mm. Wysokość produktu można regulować, dzięki czemu można go idealnie dopasować do układu pomieszczenia.', '', 'lampa-wiszaca-borgos-czarna-e27-inspire', '', '', '', 'Lampa wisząca Borgos czarna E27 Inspire', '', '', '', ''),
(408, 1, 2, 'Lampa wisząca Inspire idealnie nadaje się do oświetlenia średniej wielkości pomieszczenia. model ten może być wykorzystywany do oświetlania konkretnych pomieszczeń, jak na przykład salon. Dzięki swojemu eleganckiemu designowi lampa Borgos doskonale podkreśli wnętrze w nowoczesnym stylu. Polecamy wybór nowoczesnej żarówki, która będzie podkreślona szklanym kloszem o maksymalnej średnicy 95 mm. Wysokość produktu można regulować, dzięki czemu można go idealnie dopasować do układu pomieszczenia.', '', 'lampa-wiszaca-borgos-czarna-e27-inspire', '', '', '', 'Lampa wisząca Borgos czarna E27 Inspire', '', '', '', ''),
(409, 1, 1, 'Ta duża lampa wisząca Flut marki Inspire w kolorze matowej czerni jest idealna do oświetlenia dużego pomieszczenia lub do postawienia nad prostokątnym stołem. Dzięki swojemu projektowi Flut jest bardzo elegancki. To wynik doskonałej równowagi technologii, pomysłowości i stylu. Cienkie kable sprawiają, że wydaje się, jakby lampa unosiła się sama nad stołem. Dzięki 3 trybom oświetlenia: bezpośrednie, pośrednie i dwustronne możesz wybrać światło, które najlepiej odpowiada Twoim potrzebom. Oświetlenie pośrednie pozwoli oświetlić sufit w kierunku sufitu, nadając pomieszczeniom dekoracyjną atmosferę dzięki rozproszonemu światłu. Oświetlenie bezpośrednie zapewni doskonałe oświetlenie Twojego stołu. Jeśli chcesz uzyskać więcej światła, po prostu obróć obie strony. Instalacja produktu jest łatwa, a jej cienka podstawa na suficie daje naprawdę estetyczny efekt. Wynika to z unikalnej zdejmowanej pokrywy skrzynki elektrycznej, którą stworzyliśmy. Pozwala ukryć każdą dziurę lub przewody na suficie. Długość kabli jest również regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-flut-czarna-led-inspire', '', '', '', 'Lampa wisząca Flut czarna LED Inspire', '', '', '', ''),
(409, 1, 2, 'Ta duża lampa wisząca Flut marki Inspire w kolorze matowej czerni jest idealna do oświetlenia dużego pomieszczenia lub do postawienia nad prostokątnym stołem. Dzięki swojemu projektowi Flut jest bardzo elegancki. To wynik doskonałej równowagi technologii, pomysłowości i stylu. Cienkie kable sprawiają, że wydaje się, jakby lampa unosiła się sama nad stołem. Dzięki 3 trybom oświetlenia: bezpośrednie, pośrednie i dwustronne możesz wybrać światło, które najlepiej odpowiada Twoim potrzebom. Oświetlenie pośrednie pozwoli oświetlić sufit w kierunku sufitu, nadając pomieszczeniom dekoracyjną atmosferę dzięki rozproszonemu światłu. Oświetlenie bezpośrednie zapewni doskonałe oświetlenie Twojego stołu. Jeśli chcesz uzyskać więcej światła, po prostu obróć obie strony. Instalacja produktu jest łatwa, a jej cienka podstawa na suficie daje naprawdę estetyczny efekt. Wynika to z unikalnej zdejmowanej pokrywy skrzynki elektrycznej, którą stworzyliśmy. Pozwala ukryć każdą dziurę lub przewody na suficie. Długość kabli jest również regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-flut-czarna-led-inspire', '', '', '', 'Lampa wisząca Flut czarna LED Inspire', '', '', '', ''),
(410, 1, 1, 'Ta matowa biała lampa wisząca marki Inspire jest idealna do oświetlenia małego pomieszczenia. Pięknie będą również wyglądać lampy powieszone obok siebie w kilku egzemplarzach nad blatem lub stołem kuchennym. Dzięki stonowanej i nowoczesnej stylistyce lampa Mazugi z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować sposób rozprowadzania światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. W celu uzyskania optymalnego efektu estetycznego zalecamy użycie żarówki o średnicy 60 mm. Długość kabla tej lampy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-mazugi-biala-e27-inspire', '', '', '', 'Lampa wisząca Mazugi biała E27 Inspire', '', '', '', ''),
(410, 1, 2, 'Ta matowa biała lampa wisząca marki Inspire jest idealna do oświetlenia małego pomieszczenia. Pięknie będą również wyglądać lampy powieszone obok siebie w kilku egzemplarzach nad blatem lub stołem kuchennym. Dzięki stonowanej i nowoczesnej stylistyce lampa Mazugi z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować sposób rozprowadzania światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. W celu uzyskania optymalnego efektu estetycznego zalecamy użycie żarówki o średnicy 60 mm. Długość kabla tej lampy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-mazugi-biala-e27-inspire', '', '', '', 'Lampa wisząca Mazugi biała E27 Inspire', '', '', '', '');
