(411, 1, 2, 'Ta matowa czarna lampa wisząca marki Inspire jest idealna do oświetlenia małego pomieszczenia. Pięknie będą również wyglądać lampy powieszone obok siebie w kilku egzemplarzach nad blatem lub stołem kuchennym. Dzięki stonowanej i nowoczesnej stylistyce lampa Mazugi z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować sposób rozprowadzania światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. W celu uzyskania optymalnego efektu estetycznego zalecamy użycie żarówki o średnicy 60 mm. Długość kabla tej lampy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-mazugi-czarna-e27-inspire', '', '', '', 'Lampa wisząca Mazugi czarna E27 Inspire', '', '', '', ''),
(412, 1, 1, 'Lampa sufitowa Goteo marki Inspire jest idealna do umieszczenia na suficie. Mimo prostej konstrukcji lampa pięknie doświetli małe pomieszczenie, pozostając jednocześnie wyrafinowaną i schludną dekoracją. Oprawa jest w kolorze czarnym. Możesz spersonalizować lampę dobierając odpowiednią żarówkę Lexman z gwintem E27 o kształcie, mocy i barwie światła dostosowanymi do Twoich potrzeb.', '', 'lampa-sufitowa-goteo-czarna-e27-inspire', '', '', '', 'Lampa sufitowa Goteo czarna E27 Inspire', '', '', '', ''),
(412, 1, 2, 'Lampa sufitowa Goteo marki Inspire jest idealna do umieszczenia na suficie. Mimo prostej konstrukcji lampa pięknie doświetli małe pomieszczenie, pozostając jednocześnie wyrafinowaną i schludną dekoracją. Oprawa jest w kolorze czarnym. Możesz spersonalizować lampę dobierając odpowiednią żarówkę Lexman z gwintem E27 o kształcie, mocy i barwie światła dostosowanymi do Twoich potrzeb.', '', 'lampa-sufitowa-goteo-czarna-e27-inspire', '', '', '', 'Lampa sufitowa Goteo czarna E27 Inspire', '', '', '', ''),
(413, 1, 1, 'Lampa wisząca Belluna marki Inspire jest idealna do oświetlenia średniej wielkości pomieszczenia. Model ten można wykorzystać do oświetlenia określonych przestrzeni, takich jak np. salon lub sypialnia. Dzięki swojemu czystemu wzornictwu zen oprawa Belluna doskonale dopełnia wnętrze o nowoczesnym stylu. Możesz spersonalizować sposób oświetlania przestrzeni, wybierając żarówkę dostosowaną do swoich potrzeb. Wysokość produktu jest regulowana, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-belluna-biala-e27-inspire', '', '', '', 'Lampa wisząca Belluna biała E27 Inspire', '', '', '', ''),
(413, 1, 2, 'Lampa wisząca Belluna marki Inspire jest idealna do oświetlenia średniej wielkości pomieszczenia. Model ten można wykorzystać do oświetlenia określonych przestrzeni, takich jak np. salon lub sypialnia. Dzięki swojemu czystemu wzornictwu zen oprawa Belluna doskonale dopełnia wnętrze o nowoczesnym stylu. Możesz spersonalizować sposób oświetlania przestrzeni, wybierając żarówkę dostosowaną do swoich potrzeb. Wysokość produktu jest regulowana, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-belluna-biala-e27-inspire', '', '', '', 'Lampa wisząca Belluna biała E27 Inspire', '', '', '', ''),
(414, 1, 1, 'Lampa Hill marki Inspire to piękne oświetlenie wiszące dla dzieci. Lampa jest idealna do pokoju noworodka i małego dziecka, jednak spodoba się też nastolatkom. Na kloszu są urocze góry w pięknych pastelowych kolorach. Oprócz słodkiego i atrakcyjnego wyglądu, oświetlenie wiszące dla dzieci to także sprytny sposób na oświetlenie miejsc, w których dzieci śpią, uczą się i bawią. Możesz wybrać dowolną żarówkę E27 zgodnie z oczekiwanym efektem świetlnym dzięki naszej szerokiej ofercie żarówek Lexman.', '', 'lampa-wiszaca-hill-niebiesko-zielona-e27-inspire', '', '', '', 'Lampa wisząca Hill niebiesko-zielona E27 Inspire', '', '', '', ''),
(414, 1, 2, 'Lampa Hill marki Inspire to piękne oświetlenie wiszące dla dzieci. Lampa jest idealna do pokoju noworodka i małego dziecka, jednak spodoba się też nastolatkom. Na kloszu są urocze góry w pięknych pastelowych kolorach. Oprócz słodkiego i atrakcyjnego wyglądu, oświetlenie wiszące dla dzieci to także sprytny sposób na oświetlenie miejsc, w których dzieci śpią, uczą się i bawią. Możesz wybrać dowolną żarówkę E27 zgodnie z oczekiwanym efektem świetlnym dzięki naszej szerokiej ofercie żarówek Lexman.', '', 'lampa-wiszaca-hill-niebiesko-zielona-e27-inspire', '', '', '', 'Lampa wisząca Hill niebiesko-zielona E27 Inspire', '', '', '', ''),
(415, 1, 1, 'Lampa Tucan marki Inspire to piękne oświetlenie wiszące dla dzieci. Na kloszu znajduje się motyw dżungli z tym ładnym, ręcznie rysowanym wzorem liści i kolorowym tukanem. Oprócz oryginalnego i atrakcyjnego wyglądu, oświetlenie wiszące dla dzieci to także sprytny sposób na oświetlenie miejsc, w których dzieci śpią, uczą się i bawią. Możesz wybrać dowolną żarówkę E27 zgodnie z oczekiwanym efektem świetlnym dzięki naszej szerokiej ofercie żarówek Lexman.', '', 'lampa-wiszaca-tucan-bialo-zielona-e27-inspire', '', '', '', 'Lampa wisząca Tucan biało-zielona E27 Inspire', '', '', '', ''),
(415, 1, 2, 'Lampa Tucan marki Inspire to piękne oświetlenie wiszące dla dzieci. Na kloszu znajduje się motyw dżungli z tym ładnym, ręcznie rysowanym wzorem liści i kolorowym tukanem. Oprócz oryginalnego i atrakcyjnego wyglądu, oświetlenie wiszące dla dzieci to także sprytny sposób na oświetlenie miejsc, w których dzieci śpią, uczą się i bawią. Możesz wybrać dowolną żarówkę E27 zgodnie z oczekiwanym efektem świetlnym dzięki naszej szerokiej ofercie żarówek Lexman.', '', 'lampa-wiszaca-tucan-bialo-zielona-e27-inspire', '', '', '', 'Lampa wisząca Tucan biało-zielona E27 Inspire', '', '', '', ''),
(416, 1, 1, 'Lampa wisząca SITIA marki INSPIRE o średnicy 28 cm w kolorze szarym jest idealna do oświetlenia małego pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-28-cm-szara-e27-inspire', '', '', '', 'Lampa wisząca Sitia 28 cm szara E27 Inspire', '', '', '', ''),
