(418, 1, 2, 'Lampa wisząca SITIA marki INSPIRE o średnicy 28 cm w kolorze czarnym jest idealna do oświetlenia małego pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-28-cm-czarna-e27-inspire', '', '', '', 'Lampa wisząca Sitia 28 cm czarna E27 Inspire', '', '', '', ''),
(419, 1, 1, 'Lampa wisząca Hoki marki INSPIRE z matowego czarnego metalu jest idealna do oświetlenia małego pomieszczenia w stylu Design, natomiast by oświetlić większy pokój można oprawę zwielokrotnić w przestrzeni - powiesić kilka lamp obok siebie w linii lub klastrze. Stworzy się piękna kompozycja nad blatem lub wyspą w kuchni. Dzięki swojej stonowanej i nowoczesnej stylistyce Hoki z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować rozprzestrzenianie się światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Zalecamy użycie żarówki o średnicy od 70 mm do 120 mm, aby uzyskać optymalny efekt estetyczny. Długość kabla tej oprawy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji każdego pomieszczenia.', '', 'lampa-wiszaca-hoki-czarna-e27-inspire', '', '', '', 'Lampa wisząca Hoki czarna E27 Inspire', '', '', '', ''),
(419, 1, 2, 'Lampa wisząca Hoki marki INSPIRE z matowego czarnego metalu jest idealna do oświetlenia małego pomieszczenia w stylu Design, natomiast by oświetlić większy pokój można oprawę zwielokrotnić w przestrzeni - powiesić kilka lamp obok siebie w linii lub klastrze. Stworzy się piękna kompozycja nad blatem lub wyspą w kuchni. Dzięki swojej stonowanej i nowoczesnej stylistyce Hoki z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować rozprzestrzenianie się światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Zalecamy użycie żarówki o średnicy od 70 mm do 120 mm, aby uzyskać optymalny efekt estetyczny. Długość kabla tej oprawy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji każdego pomieszczenia.', '', 'lampa-wiszaca-hoki-czarna-e27-inspire', '', '', '', 'Lampa wisząca Hoki czarna E27 Inspire', '', '', '', ''),
(420, 1, 1, 'Lampa wisząca SITIA marki INSPIRE o średnicy 28 cm w kolorze taupe jest idealna do oświetlenia małego pomieszczenia. Dzięki stonowanej stylistyce SITIA będzie pasować zarówno do pomieszczenia urządzonego we współczesnym stylu, jak i do bardziej klasycznego wystroju wnętrza. Możesz wybrać pasującą do Ciebie i Twojego pomieszczenia lampę spośród różnych kolorów i średnic. Długość kabla w lampie jest regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji Twojego pokoju. Wnętrze klosza jest białe, co zapewnia bardziej jednorodne i mniej oślepiające rozpraszanie światła. Dobierz do lampy żarówkę o gwincie E27.', '', 'lampa-wiszaca-sitia-28-cm-taupe-e27-inspire', '', '', '', 'Lampa wisząca Sitia 28 cm taupe E27 Inspire', '', '', '', ''),
