(424, 1, 1, 'Lampa wisząca ANNAM marki INSPIRE idealnie pasuje do pomieszczeń w stylu etnicznym, boho lub prowansalskim. Klosz ma okrągły kształt i wykonany jest z naturalnego bambusa. Lampa ma regulowaną długość przewodu. Pięknie wyglądać będzie w salonie lub sypialni, tworząc niesamowity klimat. Żarówka E27 nie wchodzi w skład zestawu. Spośród szerokiej gamy żarówek możesz wybrać odpowiednią dla pomieszczenia i własnych upodobań barwę światła i moc.', '', 'lampa-wiszaca-annam-bezowa-e27-inspire', '', '', '', 'Lampa wisząca Annam beżowa E27 Inspire', '', '', '', ''),
