(429, 1, 1, 'Lampa wisząca BRAGA marki INSPIRE to stylowa, minimalistyczna oprawa z metalowym czarnym kloszem. Wnętrze klosza jest białe, dzięki czemu ładnie rozprasza światło. Łączy ona nowoczesność i styl vintage. Idealnie sprawdzi się w pomieszczeniach w stylu industrialnym. Doskonale nadaje się do oświetlenia stołu lub blatu w kuchni. Pięknie będzie wyglądać również w sypialni, gabinecie, przedpokoju, a nawet w pokoju dziecięcym. Oprawa przeznaczona jest do jednej żarówki o mocy do 60 W z trzonkiem E27. Żarówka nie wchodzi w skład zestawu - możesz wybrać barwę światła i moc, która najbardziej Ci odpowiada. Możesz również zastosować żarówkę dekoracyjną. Lampa nadaje się do wszystkich pomieszczeń oprócz łazienki (klasa szczelności to IP20). Jeśli szukasz minimalistycznego i niedrogiego oświetlenia do swojego wnętrza, lampa BRAGA jest idealnym rozwiązaniem.', '', 'lampa-wiszaca-braga-czarna-e27', '', '', '', 'Lampa wisząca Braga czarna E27', '', '', '', ''),
