(432, 1, 1, 'Lampa wisząca EASLY, zwana także pająkiem, wpasuje się w każdy styl pomieszczenia. Jest to prosta, ale elegancko wykończona metalowa lampa o sześciu punktach świetlnych. Pozwala na oświetlenie dużej powierzchni pomieszczenia. Lampa składa się z czarnych przewodów o maksymalnej długości 150 cm, zakończonych czarnymi oprawkami z gwintem E27. Maksymalna moc żarówek, które możesz wkręcić do oprawek to 60 W. Żarówki nie są dołączone do zestawu. Lampa będzie pięknie wyglądać zarówno z żarówkami LED o klasycznym kształcie, jak i z dekoracyjnymi żarówkami typu \"Edison\". Będzie dekoracją domu, biura, czy restauracji. Pięknie wygląda również na poddaszu przymocowana do belek stropowych. Elementy montażowe i uchwyty stropowe są w zestawie. Lampa EASLY nada niebanalnego charakteru każdemu wnętrzu!', '', 'lampa-wiszaca-pajak-easly-czarna-e27-inspire', '', '', '', 'Lampa wisząca Pająk Easly czarna E27 Inspire', '', '', '', ''),
