(441, 1, 1, 'Lampa wisząca TED świetnie sprawdzi się we wnętrzach inspirowanych stylem industrialnym. Jej pastelowy kolor będzie uzupełnieniem aranżacji salonu, kuchni lub jadalni. Gładki, solidnie wykonany klosz najlepiej prezentuje się z dużą żarówką z gwintem E27. Lampa została zamontowana na łańcuchu, który wprowadza lekko surowy klimat, jednak błyszcząca obudowa łączenia łagodzi to wrażanie. W efekcie lampa zachwyca swoim designem i doprecyzowanymi szczegółami. Produkt przeznaczony jest do użytku wewnętrznego.', '', 'lampa-wiszaca-ted-niebieska-e27-inspire', '', '', '', 'Lampa wisząca Ted niebieska E27 Inspire', '', '', '', ''),
(441, 1, 2, 'Lampa wisząca TED świetnie sprawdzi się we wnętrzach inspirowanych stylem industrialnym. Jej pastelowy kolor będzie uzupełnieniem aranżacji salonu, kuchni lub jadalni. Gładki, solidnie wykonany klosz najlepiej prezentuje się z dużą żarówką z gwintem E27. Lampa została zamontowana na łańcuchu, który wprowadza lekko surowy klimat, jednak błyszcząca obudowa łączenia łagodzi to wrażanie. W efekcie lampa zachwyca swoim designem i doprecyzowanymi szczegółami. Produkt przeznaczony jest do użytku wewnętrznego.', '', 'lampa-wiszaca-ted-niebieska-e27-inspire', '', '', '', 'Lampa wisząca Ted niebieska E27 Inspire', '', '', '', ''),
(442, 1, 1, 'Lampa wisząca TED to uniwersalny produkt, który świetnie sprawdzi się w salonie, jadalni lub w młodzieżowym pokoju. Inspirowana stylem industrialnym doda wnętrzu wyjątkowego charakteru. Gładki metalowy klosz najlepiej prezentuje się z dużą żarówką z gwintem E27. Lampa została zawieszona na łańcuchu, który wprowadza lekko surowy klimat, jednak błyszcząca obudowa łączenia łagodzi to wrażanie. W efekcie lampa zachwyca swoim designem i doprecyzowanymi szczegółami. Na uwagę zasługuje również jej kolorystyka. Szary abażur i metalowe elementy współgrają ze sobą, a dodatkowo będą pasować do każdej aranżacji wnętrza. Produkt przeznaczony jest do użytku wewnętrznego.', '', 'lampa-wiszaca-ted-szara-e27-inspire', '', '', '', 'Lampa wisząca Ted szara E27 Inspire', '', '', '', ''),
