(444, 1, 2, '12,88zł /szt.', '', 'lampa-wiszaca-hana-bezowa-e27-inspire', '', '', '', 'Lampa wisząca Hana beżowa E27 Inspire', '', '', '', ''),
(445, 1, 1, 'Lampa wisząca Inspire Tonka o średnicy 78 cm nada Twojemu wnętrzu szyku i nowoczesności. Na skrzyżowaniu stylów industrialnych i designerskich to zawieszenie będzie idealne na przykład nad stołem w jadalni lub nad wyspą kuchenną. Długość kabla można regulować, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Możesz spersonalizować renderowanie światła, wybierając 3 żarówki E27 Lexman dostosowane do Twoich potrzeb. Żarówki sprzedawane są osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również łączyć ten produkt z innymi z tej samej serii, jeśli chcesz.', '', 'lampa-wiszaca-tonka-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Tonka szara 3 x E27 Inspire', '', '', '', ''),
(445, 1, 2, 'Lampa wisząca Inspire Tonka o średnicy 78 cm nada Twojemu wnętrzu szyku i nowoczesności. Na skrzyżowaniu stylów industrialnych i designerskich to zawieszenie będzie idealne na przykład nad stołem w jadalni lub nad wyspą kuchenną. Długość kabla można regulować, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Możesz spersonalizować renderowanie światła, wybierając 3 żarówki E27 Lexman dostosowane do Twoich potrzeb. Żarówki sprzedawane są osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również łączyć ten produkt z innymi z tej samej serii, jeśli chcesz.', '', 'lampa-wiszaca-tonka-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Tonka szara 3 x E27 Inspire', '', '', '', ''),
(446, 1, 1, 'Ta lampa wisząca Inspire Evora, o średnicy 60 cm, wprowadzi do Twojego wnętrza wyrafinowany akcent dzięki swojemu podniebnemu projektowi z eleganckimi krzywiznami. To zawieszenie idealnie nadaje się do oświetlenia salonu lub przestronnego pokoju. Długość kabla można regulować, dzięki czemu można go idealnie dopasować do konfiguracji pomieszczenia. Zwróć uwagę, że kabel jest również chroniony przez powłokę z tkaniny, co zapewnia dodatkowy akcent wyrafinowania. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, jaki produkt przyniesie na Twojej ścianie, zalecamy użycie przezroczystej żarówki dekoracyjnej z żarnikami. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz', '', 'lampa-wiszaca-evora-czarna-e27-inspire', '', '', '', 'Lampa wisząca Evora czarna E27 Inspire', '', '', '', ''),
