(448, 1, 1, 'Ta lampa sufitowa Inspire Pecan o średnicy 28 cm nada Twojemu wnętrzu ciepły akcent. Wykonano ją z innowacyjnego materiału, naturalnie zrównoważonego zasobu, który szybko rośnie i ma ciepły wygląd: bambusa. Produkt ten idealnie nadaje się do oświetlenia salonu, kuchni czy wejścia. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym, jaki produkt przyniesie na Twojej ścianie, zalecamy użycie przezroczystej żarówki dekoracyjnej z żarnikami. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz', '', 'lampa-sufitowa-pecan-czarno-bezowa-e27-inspire', '', '', '', 'Lampa sufitowa Pecan czarno-beżowa E27 Inspire', '', '', '', ''),
