(451, 1, 1, 'Fantastyczny duet naturalnego drewna i metalowych kloszy w nowej odsłonie. Intrygujący i prosty design serii TABODI przyciąga każde spojrzenie. Warto dodać do oprawy dekoracyjne źródła światła np. LED filament, które osłonięte geometrycznym, metalowym abażurem zaprezentują grę światła i cienia po zapaleniu lampy. Seria doskonale sprawdzi się we wnętrzach o stylu skandynawskim, loftowym, industrialnym.', '', 'lampa-sufitowa-tabodi-czarna-z-drewnem-3-x-e27-inspire', '', '', '', 'Lampa sufitowa Tabodi czarna z drewnem 3 x E27 Inspire', '', '', '', ''),
