(455, 1, 1, 'Nowoczesna lampa wykonana z metalu nada wnętrzu loftowy design. Lampa przeznaczona jest na 4 źródła światła i bez problemu rożświetli każde pomieszczenie. Do lampy pasują źródła światła z tradycyjnym gwintem E27. Najlepiej komponować się będą przezroczyste, bursztynowe i białe źródła światła wykonane w całości ze szkła.', '', 'lampa-sufitowa-eldrick-czarna-4-x-e27-inspire', '', '', '', 'Lampa sufitowa Eldrick czarna 4 x E27 Inspire', '', '', '', ''),
(455, 1, 2, 'Nowoczesna lampa wykonana z metalu nada wnętrzu loftowy design. Lampa przeznaczona jest na 4 źródła światła i bez problemu rożświetli każde pomieszczenie. Do lampy pasują źródła światła z tradycyjnym gwintem E27. Najlepiej komponować się będą przezroczyste, bursztynowe i białe źródła światła wykonane w całości ze szkła.', '', 'lampa-sufitowa-eldrick-czarna-4-x-e27-inspire', '', '', '', 'Lampa sufitowa Eldrick czarna 4 x E27 Inspire', '', '', '', ''),
(456, 1, 1, 'Ta lampa sufitowa Inspire Pizzi o średnicy 38 cm wprowadzi do Twojego domu cyganerię dzięki delikatnemu, ciepłemu i modnemu kształtowi, który zaprasza do relaksu. Produkt ten idealnie nadaje się do oświetlenia salonu, kuchni czy wejścia.. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym na Twojej ścianie, zalecamy użycie przezroczystej żarówki dekoracyjnej z żarnikami. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz.', '', 'lampa-sufitowa-pizzi-bezowa-e27-inspire', '', '', '', 'Lampa sufitowa Pizzi beżowa E27 Inspire', '', '', '', ''),
(456, 1, 2, 'Ta lampa sufitowa Inspire Pizzi o średnicy 38 cm wprowadzi do Twojego domu cyganerię dzięki delikatnemu, ciepłemu i modnemu kształtowi, który zaprasza do relaksu. Produkt ten idealnie nadaje się do oświetlenia salonu, kuchni czy wejścia.. Możesz spersonalizować renderowanie światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. Jeśli chcesz cieszyć się efektem świetlnym na Twojej ścianie, zalecamy użycie przezroczystej żarówki dekoracyjnej z żarnikami. Żarówka sprzedawana jest osobno. Ten produkt Inspire jest objęty 5-letnią gwarancją. Możesz również skoordynować ten produkt z innymi produktami z tej samej serii, jeśli chcesz.', '', 'lampa-sufitowa-pizzi-bezowa-e27-inspire', '', '', '', 'Lampa sufitowa Pizzi beżowa E27 Inspire', '', '', '', '');
