(465, 1, 1, 'Kumo marki Inspire to nowoczesna, designerska lampa wisząca w kształcie chmurki, wykonana z matowego białego plastiku. Jest idealna do oświetlenia i udekorowania pokoju dziecięcego. Jej wysokość jest regulowana, dzięki czemu można ją dostosować do pomieszczenia, a ponadto posiada 1 punkt świetlny na źródło światła E27, kompatybilny z żarówkami LED lub energooszczędnymi. Dobierz żarówkę marki Lexman o kształcie, mocy i barwie światła, jakiej potrzebujesz w danym pokoju.', '', 'lampa-wiszaca-kumo-biala-e27-inspire', '', '', '', 'Lampa wisząca Kumo biała E27 Inspire', '', '', '', ''),
(465, 1, 2, 'Kumo marki Inspire to nowoczesna, designerska lampa wisząca w kształcie chmurki, wykonana z matowego białego plastiku. Jest idealna do oświetlenia i udekorowania pokoju dziecięcego. Jej wysokość jest regulowana, dzięki czemu można ją dostosować do pomieszczenia, a ponadto posiada 1 punkt świetlny na źródło światła E27, kompatybilny z żarówkami LED lub energooszczędnymi. Dobierz żarówkę marki Lexman o kształcie, mocy i barwie światła, jakiej potrzebujesz w danym pokoju.', '', 'lampa-wiszaca-kumo-biala-e27-inspire', '', '', '', 'Lampa wisząca Kumo biała E27 Inspire', '', '', '', ''),
(466, 1, 1, 'Duża lampa wisząca Nama marki Inspire jest idealna do umieszczenia nad dużym stołem lub nad blatem kuchennym. Nama dzięki swojej stylistyce wniesie do Twojego wnętrza nowoczesność. Wysokość produktu jest regulowana, dzięki czemu można go idealnie dopasować do pomieszczenia. Możesz personalizować moc i barwę oddawanego światła, wybierając żarówkę dostosowaną do Twoich potrzeb.', '', 'lampa-wiszaca-nama-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Nama szara 3 x E27 Inspire', '', '', '', ''),
(466, 1, 2, 'Duża lampa wisząca Nama marki Inspire jest idealna do umieszczenia nad dużym stołem lub nad blatem kuchennym. Nama dzięki swojej stylistyce wniesie do Twojego wnętrza nowoczesność. Wysokość produktu jest regulowana, dzięki czemu można go idealnie dopasować do pomieszczenia. Możesz personalizować moc i barwę oddawanego światła, wybierając żarówkę dostosowaną do Twoich potrzeb.', '', 'lampa-wiszaca-nama-szara-3-x-e27-inspire', '', '', '', 'Lampa wisząca Nama szara 3 x E27 Inspire', '', '', '', ''),
(467, 1, 1, 'Ta matowa lampa wisząca z mosiężnym wykończeniem marki Inspire jest idealna do oświetlenia małego pomieszczenia. Pięknie będą również wyglądać lampy powieszone obok siebie w kilku egzemplarzach nad blatem lub stołem kuchennym. Dzięki stonowanej i nowoczesnej stylistyce lampa Mazugi z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować sposób rozprowadzania światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. W celu uzyskania optymalnego efektu estetycznego zalecamy użycie żarówki o średnicy 60 mm. Długość kabla tej lampy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-mazugi-mosiadz-e27-inspire', '', '', '', 'Lampa wisząca Mazugi mosiądz E27 Inspire', '', '', '', ''),
(467, 1, 2, 'Ta matowa lampa wisząca z mosiężnym wykończeniem marki Inspire jest idealna do oświetlenia małego pomieszczenia. Pięknie będą również wyglądać lampy powieszone obok siebie w kilku egzemplarzach nad blatem lub stołem kuchennym. Dzięki stonowanej i nowoczesnej stylistyce lampa Mazugi z łatwością dopasuje się do Twojego pomieszczenia. Możesz spersonalizować sposób rozprowadzania światła, wybierając żarówkę E27 Lexman dostosowaną do Twoich potrzeb. W celu uzyskania optymalnego efektu estetycznego zalecamy użycie żarówki o średnicy 60 mm. Długość kabla tej lampy można regulować, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-mazugi-mosiadz-e27-inspire', '', '', '', 'Lampa wisząca Mazugi mosiądz E27 Inspire', '', '', '', ''),
(468, 1, 1, 'Szerokie zawieszenie Fonda marki Inspire z matowym niklowanym wykończeniem jest idealne do oświetlenia dużego pomieszczenia lub do powieszenia nad prostokątnym stołem. Dzięki ultrasmukłej konstrukcji Fonda jest bardzo nowoczesna i pasuje do wszystkich stylizacji. Instalacja produktu jest łatwa, a jej cienka podstawa na suficie daje naprawdę estetyczny efekt. Wynika to ze zdejmowanej pokrywy skrzynki elektrycznej, która pozwala ukryć dziurę w suficie lub kable. Można ją umieścić w dowolnym miejscu podstawy, co pozwala na przesunięcie oprawy, jeśli chcesz. Długość kabli jest również regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-fonda-chrom-2000-lm-led-inspire', '', '', '', 'Lampa wisząca Fonda chrom 2000 lm LED Inspire', '', '', '', ''),
(468, 1, 2, 'Szerokie zawieszenie Fonda marki Inspire z matowym niklowanym wykończeniem jest idealne do oświetlenia dużego pomieszczenia lub do powieszenia nad prostokątnym stołem. Dzięki ultrasmukłej konstrukcji Fonda jest bardzo nowoczesna i pasuje do wszystkich stylizacji. Instalacja produktu jest łatwa, a jej cienka podstawa na suficie daje naprawdę estetyczny efekt. Wynika to ze zdejmowanej pokrywy skrzynki elektrycznej, która pozwala ukryć dziurę w suficie lub kable. Można ją umieścić w dowolnym miejscu podstawy, co pozwala na przesunięcie oprawy, jeśli chcesz. Długość kabli jest również regulowana, dzięki czemu można ją idealnie dopasować do konfiguracji pomieszczenia.', '', 'lampa-wiszaca-fonda-chrom-2000-lm-led-inspire', '', '', '', 'Lampa wisząca Fonda chrom 2000 lm LED Inspire', '', '', '', ''),
(469, 1, 1, 'Lampa wisząca Cedar w kolorze czarnym to prosty, elegancki format, który wzbogaci wystrój pomieszczenia. Uniwersalny kształt półkuli wspaniale wpasuje się w każde wnętrze. Idealna do oświetlania powierzchni roboczej lub stołu w salonie, czy też jadalni.', '', 'lampa-wiszaca-cedar-czarna-e27-inspire', '', '', '', 'Lampa wisząca Cedar czarna E27 Inspire', '', '', '', ''),
