(470, 1, 1, 'Lampa wisząca Cedar w kolorze białym to prosty, elegancki format, który wzbogaci wystrój pomieszczenia. Uniwersalny kształt półkuli wspaniale wpasuje się w każde wnętrze. Idealna do oświetlania powierzchni roboczej lub stołu w salonie, czy też jadalni.', '', 'lampa-wiszaca-cedar-biala-e27-inspire', '', '', '', 'Lampa wisząca Cedar biała E27 Inspire', '', '', '', ''),
(470, 1, 2, 'Lampa wisząca Cedar w kolorze białym to prosty, elegancki format, który wzbogaci wystrój pomieszczenia. Uniwersalny kształt półkuli wspaniale wpasuje się w każde wnętrze. Idealna do oświetlania powierzchni roboczej lub stołu w salonie, czy też jadalni.', '', 'lampa-wiszaca-cedar-biala-e27-inspire', '', '', '', 'Lampa wisząca Cedar biała E27 Inspire', '', '', '', ''),
(471, 1, 1, 'Lampa wisząca Cedar w kolorze srebrnym to prosty, elegancki format, który wzbogaci wystrój pomieszczenia. Uniwersalny kształt półkuli wspaniale wpasuje się w każde wnętrze. Idealna do oświetlania powierzchni roboczej lub stołu w salonie, czy też jadalni.', '', 'lampa-wiszaca-cedar-srebrna-e27-inspire', '', '', '', 'Lampa wisząca Cedar srebrna E27 Inspire', '', '', '', ''),
(471, 1, 2, 'Lampa wisząca Cedar w kolorze srebrnym to prosty, elegancki format, który wzbogaci wystrój pomieszczenia. Uniwersalny kształt półkuli wspaniale wpasuje się w każde wnętrze. Idealna do oświetlania powierzchni roboczej lub stołu w salonie, czy też jadalni.', '', 'lampa-wiszaca-cedar-srebrna-e27-inspire', '', '', '', 'Lampa wisząca Cedar srebrna E27 Inspire', '', '', '', ''),
(472, 1, 1, 'Lampa wiszące Clinton to biały, tkaninowy abażur, który tworzy przyjemną i przyjazną atmosferę. Nowoczesna a zarazem elegancka forma doda charakteru każdemu wnętrzu. Trzy punkty świetlne zamontowane wewnątrz oprawy wspaniale rozświetlą wnętrze. Prosty sposób regulacji długości wysokości lampy pozwoli na dopasowanie jej do swoich potrzeb.', '', 'lampa-wiszaca-clinton-biala-e27-inspire', '', '', '', 'Lampa wisząca Clinton biała E27 Inspire', '', '', '', ''),
(472, 1, 2, 'Lampa wiszące Clinton to biały, tkaninowy abażur, który tworzy przyjemną i przyjazną atmosferę. Nowoczesna a zarazem elegancka forma doda charakteru każdemu wnętrzu. Trzy punkty świetlne zamontowane wewnątrz oprawy wspaniale rozświetlą wnętrze. Prosty sposób regulacji długości wysokości lampy pozwoli na dopasowanie jej do swoich potrzeb.', '', 'lampa-wiszaca-clinton-biala-e27-inspire', '', '', '', 'Lampa wisząca Clinton biała E27 Inspire', '', '', '', ''),
(473, 1, 1, 'Lampa wisząca Byron to trzy metalowe klosze w kolorze złota. Designerska forma klosza pasuje do większości wnętrz. Oprawa każdego dni będzie ułatwiać życie wskazując drogę po zmierzchu, a jednocześnie wspaniale dekorować pomieszczenie, w którym zostanie zamontowana. Lampa wspaniale ozdobi zarówno salon, jak i biuro czy łazienkę. Nastrojowy klimat, który uzyskamy po wyborze odpowiednich źródeł światła pozwoli na satysfakcjonujący odpoczynek po całym dniu. Do tej oprawy idealnie pasują żarówki dekoracyjne LED np. w kształcie kuli, trzonek E27, maksymalna moc 60W.', '', 'lampa-wiszaca-byron-zlota-e27-inspire', '', '', '', 'Lampa wisząca Byron złota E27 Inspire', '', '', '', ''),
(473, 1, 2, 'Lampa wisząca Byron to trzy metalowe klosze w kolorze złota. Designerska forma klosza pasuje do większości wnętrz. Oprawa każdego dni będzie ułatwiać życie wskazując drogę po zmierzchu, a jednocześnie wspaniale dekorować pomieszczenie, w którym zostanie zamontowana. Lampa wspaniale ozdobi zarówno salon, jak i biuro czy łazienkę. Nastrojowy klimat, który uzyskamy po wyborze odpowiednich źródeł światła pozwoli na satysfakcjonujący odpoczynek po całym dniu. Do tej oprawy idealnie pasują żarówki dekoracyjne LED np. w kształcie kuli, trzonek E27, maksymalna moc 60W.', '', 'lampa-wiszaca-byron-zlota-e27-inspire', '', '', '', 'Lampa wisząca Byron złota E27 Inspire', '', '', '', ''),
(474, 1, 1, 'Lampa sufitowa OTOK o nowoczesnym designie jest odpowiednia do każdego rodzaju pomieszczenia. Wykonana jest z chromowanego metalu. Zintegrowane diody LED umieszczone na 6 metalowych ramionach pokryte zostały akrylem, dla równomiernego rozproszenia światła. Plafon ten dostarcza dużo światła (aż 2340 lumenów) o ciepłej barwie światła. Przeznaczony jest do montażu na suficie, jednak równie dobrze sprawdzi się powieszony na ścianie. Polecany jest do pomieszczeń mieszkalnych - przedpokojów, salonów lub sypialni. Oświetli nawet 20 m2. Ten elegancki plafon będzie piękną dekoracją każdego wnętrza.', '', 'lampa-sufitowa-otok-chrom-led-inspire', '', '', '', 'Lampa sufitowa Otok chrom LED Inspire', '', '', '', ''),
(474, 1, 2, 'Lampa sufitowa OTOK o nowoczesnym designie jest odpowiednia do każdego rodzaju pomieszczenia. Wykonana jest z chromowanego metalu. Zintegrowane diody LED umieszczone na 6 metalowych ramionach pokryte zostały akrylem, dla równomiernego rozproszenia światła. Plafon ten dostarcza dużo światła (aż 2340 lumenów) o ciepłej barwie światła. Przeznaczony jest do montażu na suficie, jednak równie dobrze sprawdzi się powieszony na ścianie. Polecany jest do pomieszczeń mieszkalnych - przedpokojów, salonów lub sypialni. Oświetli nawet 20 m2. Ten elegancki plafon będzie piękną dekoracją każdego wnętrza.', '', 'lampa-sufitowa-otok-chrom-led-inspire', '', '', '', 'Lampa sufitowa Otok chrom LED Inspire', '', '', '', ''),
