(477, 1, 1, 'Lampa wisząca TINNA nadaje otoczeniu efektowny i nowoczesny charakter. Pasuje do wnętrz w stylu glamour, ale równie dobrze będzie wyglądać w skandynawskiej lub industrialnej przestrzeni. Klosz wykonany jest z przydymionego szkła, które ciekawie rozprowadza światło. Zawiera jedno źródło światła na żarówkę z gwintem E27 o maksymalnej mocy 60 W. Możesz wybrać żarówkę LED o mocy i barwie światła, które najlepiej odpowiadają Twoim upodobaniom. Dzięki odpowiednio dobranej żarówce stworzysz przytulną atmosferę w salonie, sypialni lub innych pokojach. Stopień ochrony IP20 wskazuje. że lampa jest przeznaczona do użytku wewnętrznego. Ta piękna wisząca lampa może zmienić estetykę przestrzeni, stworzyć niepowtarzalny klimat w domu i nadać mu niezrównany styl.', '', 'lampa-wiszaca-tinna-przydymione-szklo-e27-inspire', '', '', '', 'Lampa wisząca Tinna przydymione szkło E27 Inspire', '', '', '', ''),
(477, 1, 2, 'Lampa wisząca TINNA nadaje otoczeniu efektowny i nowoczesny charakter. Pasuje do wnętrz w stylu glamour, ale równie dobrze będzie wyglądać w skandynawskiej lub industrialnej przestrzeni. Klosz wykonany jest z przydymionego szkła, które ciekawie rozprowadza światło. Zawiera jedno źródło światła na żarówkę z gwintem E27 o maksymalnej mocy 60 W. Możesz wybrać żarówkę LED o mocy i barwie światła, które najlepiej odpowiadają Twoim upodobaniom. Dzięki odpowiednio dobranej żarówce stworzysz przytulną atmosferę w salonie, sypialni lub innych pokojach. Stopień ochrony IP20 wskazuje. że lampa jest przeznaczona do użytku wewnętrznego. Ta piękna wisząca lampa może zmienić estetykę przestrzeni, stworzyć niepowtarzalny klimat w domu i nadać mu niezrównany styl.', '', 'lampa-wiszaca-tinna-przydymione-szklo-e27-inspire', '', '', '', 'Lampa wisząca Tinna przydymione szkło E27 Inspire', '', '', '', ''),
(478, 1, 1, 'Lampa wisząca TED to uniwersalny produkt, który świetnie sprawdzi się w salonie, jadalni lub w młodzieżowym pokoju. Inspirowana stylem industrialnym doda wnętrzu wyjątkowego charakteru. Gładki metalowy klosz najlepiej prezentuje się z dużą żarówką z gwintem E27. Lampa została zawieszona na łańcuchu, który wprowadza lekko surowy klimat, jednak błyszcząca obudowa łączenia łagodzi to wrażanie. W efekcie lampa zachwyca swoim designem i doprecyzowanymi szczegółami. Na uwagę zasługuje również jej kolorystyka. Czarny abażur ze złotymi elementami współgrają ze sobą, a dodatkowo będą pasować do każdej aranżacji wnętrza. Produkt przeznaczony jest do użytku wewnętrznego.', '', 'lampa-wiszaca-ted-czarno-zlota-e27-inspire', '', '', '', 'Lampa wisząca Ted czarno-złota E27 Inspire', '', '', '', ''),
(478, 1, 2, 'Lampa wisząca TED to uniwersalny produkt, który świetnie sprawdzi się w salonie, jadalni lub w młodzieżowym pokoju. Inspirowana stylem industrialnym doda wnętrzu wyjątkowego charakteru. Gładki metalowy klosz najlepiej prezentuje się z dużą żarówką z gwintem E27. Lampa została zawieszona na łańcuchu, który wprowadza lekko surowy klimat, jednak błyszcząca obudowa łączenia łagodzi to wrażanie. W efekcie lampa zachwyca swoim designem i doprecyzowanymi szczegółami. Na uwagę zasługuje również jej kolorystyka. Czarny abażur ze złotymi elementami współgrają ze sobą, a dodatkowo będą pasować do każdej aranżacji wnętrza. Produkt przeznaczony jest do użytku wewnętrznego.', '', 'lampa-wiszaca-ted-czarno-zlota-e27-inspire', '', '', '', 'Lampa wisząca Ted czarno-złota E27 Inspire', '', '', '', ''),
