(481, 1, 1, 'Lampa wisząca FARELL marki INSPIRE o nowoczesnym designie ma niewielkie rozmiary i służy jako dodatkowe źródło światła. Dzięki niemu możesz stworzyć przytulną atmosferę, podkreślić elementy wnętrza lub zagospodarować przestrzeń. Świetnie prezentuje się jako pojedynczy zwis, w parach i grupach. Posiada jedno źródło światła na żarówki E27 o max. mocy 60 W. Żarówka nie wchodzi w skład zestawu, możesz więc sam zdecydować jaka moc i barwa światła najbardziej odpowiadać będzie Twoim dekoracyjnym upodobaniom. Lampę FARELL można zastosować w kuchni nad stołem jadalnianym lub blatem wyspy, w salonie nad stolikiem kawowym lub sofą, w biurze nad miejscem pracy. Pięknie będzie też wyglądać w sypialni nad łóżkiem lub stolikiem nocnym. Możliwe jest dostosowanie wysokości lampy.', '', 'lampa-wiszaca-farell-srebrna-e27-inspire', '', '', '', 'Lampa wisząca Farell srebrna E27 Inspire', '', '', '', ''),
