(486, 1, 1, 'Lampa wisząca SELVINO to lampa o nowoczesnym i eleganckim designie. Łączy ze sobą trendy wnetrzarskie takie jak złoto i napowietrzane szkło. Świetnie wpasuje się w każde wnętrze zarówno klasyczne jak i nowoczesne. Sprawi, że wnętrze będzie eleganckie jak i przytulne. Pasuje do salonu, kuchni, sypialni.', '', 'lampa-wiszaca-selvino-zlota-e27-eglo', '', '', '', 'Lampa wisząca Selvino złota E27 Eglo', '', '', '', ''),
(486, 1, 2, 'Lampa wisząca SELVINO to lampa o nowoczesnym i eleganckim designie. Łączy ze sobą trendy wnetrzarskie takie jak złoto i napowietrzane szkło. Świetnie wpasuje się w każde wnętrze zarówno klasyczne jak i nowoczesne. Sprawi, że wnętrze będzie eleganckie jak i przytulne. Pasuje do salonu, kuchni, sypialni.', '', 'lampa-wiszaca-selvino-zlota-e27-eglo', '', '', '', 'Lampa wisząca Selvino złota E27 Eglo', '', '', '', ''),
(487, 1, 1, 'Polux. Lampa wisząca GREENE 1xE27. Elegancka lampa z zielonym kloszem i wzorem liścia, nada pomieszczeiu wyjątkowego charakteru. Lampa o regulowanej długości max 120cm, średnica klosza to 20cm. Źródło światła stanowi jedna żarówka o maksymalnej mocy 20W LED do nabycia oddzielnie. Stopień ochrony: IP20.', '', 'lampa-wiszaca-greene-zielona-e27-polux', '', '', '', 'Lampa wisząca Greene zielona E27 Polux', '', '', '', ''),
