(488, 1, 1, 'Lampa wisząca BORDESLEY wykonana jest z trzech kloszy wykonanych z naturalnego drewna i podłużnego czarnego metalowego zawieszenia. Po włączeniu lampy klosze tworzą fascynującą grę światła i cienia. Lampa wisząca płynnie wpisuje się w trend natury we wnętrzu i dzięki naturalnym materiałom zapewnia przyjemną atmosferę.', '', 'lampa-wiszaca-bordesley-drewno-czarna-3-x-e27-eglo', '', '', '', 'Lampa wisząca Bordesley drewno czarna 3 x E27 Eglo', '', '', '', ''),
