(491, 1, 1, 'Rdzawy metal i surowość wykonania to harmonia którą prezentują lampy TOWNSHEND. Intrygujący i prosty design przyciąga każde spojrzenie. Metalową belkę otaczają czarne kable które można zapętlać wokół oprawy na dowolną długość. Pozwala to na swobodne , dopasowywanie produktu do własnych potrzeb. Warto dodać do oprawy dekoracyjne źródła światła np. LED filament, które nie osłonięte dodadzą lampie dekoracyjności. Seria doskonale sprawdzi się we wnętrzach o stylu loftowym i industrialnym. Różnorodne elementy oświetlenie sprawdzą się w każdym pomieszczeniu - czy to w salonie, czy w jadalni, na przykład nad podłużnym stołem jadalnym.', '', 'lampa-wiszaca-townshend-brazowa-6-x-e27-eglo', '', '', '', 'Lampa wisząca Townshend brązowa 6 x E27 Eglo', '', '', '', ''),
(491, 1, 2, 'Rdzawy metal i surowość wykonania to harmonia którą prezentują lampy TOWNSHEND. Intrygujący i prosty design przyciąga każde spojrzenie. Metalową belkę otaczają czarne kable które można zapętlać wokół oprawy na dowolną długość. Pozwala to na swobodne , dopasowywanie produktu do własnych potrzeb. Warto dodać do oprawy dekoracyjne źródła światła np. LED filament, które nie osłonięte dodadzą lampie dekoracyjności. Seria doskonale sprawdzi się we wnętrzach o stylu loftowym i industrialnym. Różnorodne elementy oświetlenie sprawdzą się w każdym pomieszczeniu - czy to w salonie, czy w jadalni, na przykład nad podłużnym stołem jadalnym.', '', 'lampa-wiszaca-townshend-brazowa-6-x-e27-eglo', '', '', '', 'Lampa wisząca Townshend brązowa 6 x E27 Eglo', '', '', '', ''),
(492, 1, 1, 'Lampa wisząca TESS to produkt, który najlepiej sprawdzi się jako oświetlenie stołu w jadalni lub wyspy kuchennej. Umieszczony po zewnętrznej stronie lampy pasek LED umożliwi oświetlenie pomieszczenia o dużej powierzchni. Dzięki możliwości regulacji długości linek (max. 150 cm) z powodzeniem i dużą łatwością można dobrać idealną dla siebie odległość od stołu lub blatu. Niewątpliwą zaletą plafonu jest wbudowana trzystopniowa regulacja natężenia światła poprzez włącznik ścienny, dzięki czemu możemy dopasować moc lampy do własnych preferencji.', '', 'lampa-wiszaca-tess-czarna-led-wofi', '', '', '', 'Lampa wisząca Tess czarna LED Wofi', '', '', '', ''),
(492, 1, 2, 'Lampa wisząca TESS to produkt, który najlepiej sprawdzi się jako oświetlenie stołu w jadalni lub wyspy kuchennej. Umieszczony po zewnętrznej stronie lampy pasek LED umożliwi oświetlenie pomieszczenia o dużej powierzchni. Dzięki możliwości regulacji długości linek (max. 150 cm) z powodzeniem i dużą łatwością można dobrać idealną dla siebie odległość od stołu lub blatu. Niewątpliwą zaletą plafonu jest wbudowana trzystopniowa regulacja natężenia światła poprzez włącznik ścienny, dzięki czemu możemy dopasować moc lampy do własnych preferencji.', '', 'lampa-wiszaca-tess-czarna-led-wofi', '', '', '', 'Lampa wisząca Tess czarna LED Wofi', '', '', '', ''),
(493, 1, 1, 'Nowoczesna lampa wisząca Mailone Italux łączy oryginalną formę z funkcjonalnością. Wykonana z metalu w eleganckim złotym kolorze i niespotykanym, kulistym kształcie, dodaje blichtru wnętrzom w różnych stylach. Sprawdzi się zarówno w domu, jak i w przestrzeni biurowej, idealnie rozświetli każde pomieszczenie. Tworzy przyjemny charakter wnętrza. Lampa wisząca Mailone Italux posiada miejsce na 1 źródło światła. Umożliwia montaż żarówek klasycznych lub LED o maksymalnej mocy 40W. Wysokość 120 cm.', '', 'lampa-wiszaca-mailone-zloty-6-x-e14-italux', '', '', '', 'Lampa wisząca Mailone złoty 6 x E14 Italux', '', '', '', ''),
(493, 1, 2, 'Nowoczesna lampa wisząca Mailone Italux łączy oryginalną formę z funkcjonalnością. Wykonana z metalu w eleganckim złotym kolorze i niespotykanym, kulistym kształcie, dodaje blichtru wnętrzom w różnych stylach. Sprawdzi się zarówno w domu, jak i w przestrzeni biurowej, idealnie rozświetli każde pomieszczenie. Tworzy przyjemny charakter wnętrza. Lampa wisząca Mailone Italux posiada miejsce na 1 źródło światła. Umożliwia montaż żarówek klasycznych lub LED o maksymalnej mocy 40W. Wysokość 120 cm.', '', 'lampa-wiszaca-mailone-zloty-6-x-e14-italux', '', '', '', 'Lampa wisząca Mailone złoty 6 x E14 Italux', '', '', '', ''),
(494, 1, 1, 'Szykowne lampy wisząca LONCINO przyciągną wzrok w każdym miejscu dzięki swojemu wyjątkowemu wzornictwu. Wewnątrz chromowej metalowej klatki znajdują się cylindryczne klosze z transparentnego i białego szkła, które otaczają źródło światła. Oprawę wspaniale uzupełnią źródła światła LED filament, które w całości widoczne wewnątrz klosza podkreślą urok lampy. Prosta forma i klasyczne kolory doskonale sprawdza się w nowoczesnym wnętrzu.', '', 'lampa-wiszaca-loncino-biala-e27-eglo', '', '', '', 'Lampa wisząca Loncino biała E27 Eglo', '', '', '', ''),
(494, 1, 2, 'Szykowne lampy wisząca LONCINO przyciągną wzrok w każdym miejscu dzięki swojemu wyjątkowemu wzornictwu. Wewnątrz chromowej metalowej klatki znajdują się cylindryczne klosze z transparentnego i białego szkła, które otaczają źródło światła. Oprawę wspaniale uzupełnią źródła światła LED filament, które w całości widoczne wewnątrz klosza podkreślą urok lampy. Prosta forma i klasyczne kolory doskonale sprawdza się w nowoczesnym wnętrzu.', '', 'lampa-wiszaca-loncino-biala-e27-eglo', '', '', '', 'Lampa wisząca Loncino biała E27 Eglo', '', '', '', ''),
(495, 1, 1, 'Kolekcja MASERLO to klasyczne rozwiązanie do każdego wnętrza. Elegancki tkaninowy abażur od wewnątrz wykończony jest złota powłoką co wspaniale odbija światło i nadaje mu ciepłą barwę. Wysokość lampy z łatwością można regulować linkami na których jest zawieszona. Produkty z tej serii prezentują się szlachetnie i wytwornie. Będą fantastycznie wyglądać w Twoim salonie, kuchni czy sypialni.', '', 'lampa-wiszaca-maserlo-czarna-2-x-e27-eglo', '', '', '', 'Lampa wisząca Maserlo czarna 2 x E27 Eglo', '', '', '', ''),
(495, 1, 2, 'Kolekcja MASERLO to klasyczne rozwiązanie do każdego wnętrza. Elegancki tkaninowy abażur od wewnątrz wykończony jest złota powłoką co wspaniale odbija światło i nadaje mu ciepłą barwę. Wysokość lampy z łatwością można regulować linkami na których jest zawieszona. Produkty z tej serii prezentują się szlachetnie i wytwornie. Będą fantastycznie wyglądać w Twoim salonie, kuchni czy sypialni.', '', 'lampa-wiszaca-maserlo-czarna-2-x-e27-eglo', '', '', '', 'Lampa wisząca Maserlo czarna 2 x E27 Eglo', '', '', '', ''),
(496, 1, 1, 'Kama to lampa wisząca w kształcie żarówki, biała z niebieskim przewodem. Wygląd oprawy nawiązuje do klasycznej żarówki. Lampa z całą pewnością sprawdzi się w wielu wnętrzach, w których będzie zarówno pełnić funkcję świetlną jak i designerską. Oprawa Kama będzie pasować do pokoju młodzieżowego, sypialni, salonu, jadalni czy kuchni. Szukając lampy do swojego wnętrza postaw na lampę wiszącą Kama.', '', 'lampa-wiszaca-kama-biala-e27-prezent', '', '', '', 'Lampa wisząca Kama biała E27 Prezent', '', '', '', ''),
(496, 1, 2, 'Kama to lampa wisząca w kształcie żarówki, biała z niebieskim przewodem. Wygląd oprawy nawiązuje do klasycznej żarówki. Lampa z całą pewnością sprawdzi się w wielu wnętrzach, w których będzie zarówno pełnić funkcję świetlną jak i designerską. Oprawa Kama będzie pasować do pokoju młodzieżowego, sypialni, salonu, jadalni czy kuchni. Szukając lampy do swojego wnętrza postaw na lampę wiszącą Kama.', '', 'lampa-wiszaca-kama-biala-e27-prezent', '', '', '', 'Lampa wisząca Kama biała E27 Prezent', '', '', '', ''),
(497, 1, 1, 'Lampa wisząca o ozdobnym kształcie, z dużą ilością elementów dekoracyjnych, które dodają jej uroku. Dzięki kwiatowym wzorom wniesie do pomieszczenia nutkę kobiecości. Będzie dobrze prezentowała się w pomieszczeniach o wyrazistej kolorystyce.', '', 'lampa-wiszaca-inka-rozowa-e27-oriva-ab', '', '', '', 'Lampa wisząca Inka różowa E27 Oriva Ab', '', '', '', ''),
(497, 1, 2, 'Lampa wisząca o ozdobnym kształcie, z dużą ilością elementów dekoracyjnych, które dodają jej uroku. Dzięki kwiatowym wzorom wniesie do pomieszczenia nutkę kobiecości. Będzie dobrze prezentowała się w pomieszczeniach o wyrazistej kolorystyce.', '', 'lampa-wiszaca-inka-rozowa-e27-oriva-ab', '', '', '', 'Lampa wisząca Inka różowa E27 Oriva Ab', '', '', '', ''),
(498, 1, 1, 'Nowoczesny plafon VILETTA o prostej, uniwersalnej formie, będzie się dobrze prezentował w większości pomieszczeń. Patynowane ramiona lampy zwieńczone są białymi szklanymi kloszami o ciekawej formie; skierowane pod kątem ku dołowi dobrze rozproszą światło w całym pomieszczeniu. VILETTA to efektowna a zarazem bardzo funkcjonalna lampa, która sprawdzi się zarówno w pokoju dziennym, sypialni czy kuchni.', '', 'zyrandol-viletta-patyna-e27-spot-light', '', '', '', 'Żyrandol Viletta patyna E27 Spot-Light', '', '', '', ''),
(498, 1, 2, 'Nowoczesny plafon VILETTA o prostej, uniwersalnej formie, będzie się dobrze prezentował w większości pomieszczeń. Patynowane ramiona lampy zwieńczone są białymi szklanymi kloszami o ciekawej formie; skierowane pod kątem ku dołowi dobrze rozproszą światło w całym pomieszczeniu. VILETTA to efektowna a zarazem bardzo funkcjonalna lampa, która sprawdzi się zarówno w pokoju dziennym, sypialni czy kuchni.', '', 'zyrandol-viletta-patyna-e27-spot-light', '', '', '', 'Żyrandol Viletta patyna E27 Spot-Light', '', '', '', ''),
(499, 1, 1, 'Montino Lampa Wisząca', '', 'lampa-wiszaca-montino-czarno-brazowa-e27-spot-light', '', '', '', 'Lampa wisząca Montino czarno-brązowa E27 Spot-Light', '', '', '', ''),
(499, 1, 2, 'Montino Lampa Wisząca', '', 'lampa-wiszaca-montino-czarno-brazowa-e27-spot-light', '', '', '', 'Lampa wisząca Montino czarno-brązowa E27 Spot-Light', '', '', '', ''),
(500, 1, 1, 'Miele 3 wisząca dymny/złoty – to smukła lampa z trzema szklanymi kloszami w ciekawym, dymnym kolorze i złotą obręczą. Dzięki temu wytwornie i elegancko wypełni większość ekskluzywnych  aranżacji wnętrz. Jest to nowoczesna propozycja dla osób, poszukujących eleganckiego oświetlenia. Posiada trzy źródła światła, które są w zupełności wystarczające by oświetlić wybrane miejsce, miłym blaskiem.', '', 'lampa-wiszaca-miele-zlota-3-x-e27-light-prestige', '', '', '', 'Lampa wisząca Miele złota 3 x E27 Light Prestige', '', '', '', ''),
(500, 1, 2, 'Miele 3 wisząca dymny/złoty – to smukła lampa z trzema szklanymi kloszami w ciekawym, dymnym kolorze i złotą obręczą. Dzięki temu wytwornie i elegancko wypełni większość ekskluzywnych  aranżacji wnętrz. Jest to nowoczesna propozycja dla osób, poszukujących eleganckiego oświetlenia. Posiada trzy źródła światła, które są w zupełności wystarczające by oświetlić wybrane miejsce, miłym blaskiem.', '', 'lampa-wiszaca-miele-zlota-3-x-e27-light-prestige', '', '', '', 'Lampa wisząca Miele złota 3 x E27 Light Prestige', '', '', '', ''),
(501, 1, 1, 'Ze względu na filigranowy design, lampa wisząca LUCY wygląda jednocześnie nowocześnie i nostalgicznie. Lampa zaopatrzona w żarówki imitujące płomienie nadaje pomieszczeniu stylowej atmosfery oraz elegancji. Mocowana jest za pomocą zawieszki na haku umocowanym w suficie, całość subtelnie ukryta w stożkowej podsufitce. Punkty świetlne pozbawione są jakiejkolwiek osłony, zatem światło może się swobodnie rozprzestrzeniać w pomieszczeniu', '', 'lampa-wiszaca-lucy-biala-5-x-e14-lamkur', '', '', '', 'Lampa wisząca Lucy biała 5 x E14 Lamkur', '', '', '', ''),
