(505, 1, 1, 'Lampa sufitowa ANIA doskonale sprawdzi się w nowoczesnym wystroju wnętrz, szczególnie nadaje się do niemal każdego pomieszczenia. Cztery źródła światła z łatwością zrealizują główne i niezależne oświetlenie salonu, sypialni, jadalni, kuchni, gabinetu czy pokoju dziecięcego. Każdy punkt skierowany jest w innym kierunku, dzięki czemu lampa zapewnia równomierny rozsył światła. Ponieważ model ten nie posiada klosza, zalecamy stosowanie żarówek dekoracyjnych.', '', 'lampa-wiszaca-ania-zlota-4-x-e27-tk-lighting', '', '', '', 'Lampa wisząca Ania złota 4 x E27 Tk Lighting', '', '', '', ''),
(505, 1, 2, 'Lampa sufitowa ANIA doskonale sprawdzi się w nowoczesnym wystroju wnętrz, szczególnie nadaje się do niemal każdego pomieszczenia. Cztery źródła światła z łatwością zrealizują główne i niezależne oświetlenie salonu, sypialni, jadalni, kuchni, gabinetu czy pokoju dziecięcego. Każdy punkt skierowany jest w innym kierunku, dzięki czemu lampa zapewnia równomierny rozsył światła. Ponieważ model ten nie posiada klosza, zalecamy stosowanie żarówek dekoracyjnych.', '', 'lampa-wiszaca-ania-zlota-4-x-e27-tk-lighting', '', '', '', 'Lampa wisząca Ania złota 4 x E27 Tk Lighting', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(506, 1, 1, 'Arette 3 wisząca złota - to kolejna propozycja lampy wiszącej. Ta, posiada trzy klosze w kształcie kul, co daje trzy źródła światła. Kule są wyprodukowane z transparentnego szkła, dzięki czemu światło będzie pięknie rozproszone. Całość na złotym stelażu i długich przewodach sięgających jednego metra. Jednak niezależnie od tego, jaką wysokość ma pomieszczenie, lampa Arette będzie odpowiednia, ponieważ jej przewody są regulowane. Transparentny kolor kloszy, nadaje uniwersalności jeśli chodzi o kolorystykę wnętrz. Jej zastosowanie, będzie odpowiednie zarówno w salonie jak i kuchni.', '', 'lampa-wiszaca-arette-zlota-3-x-e27-light-prestige', '', '', '', 'Lampa wisząca Arette złota 3 x E27 Light Prestige', '', '', '', ''),
(506, 1, 2, 'Arette 3 wisząca złota - to kolejna propozycja lampy wiszącej. Ta, posiada trzy klosze w kształcie kul, co daje trzy źródła światła. Kule są wyprodukowane z transparentnego szkła, dzięki czemu światło będzie pięknie rozproszone. Całość na złotym stelażu i długich przewodach sięgających jednego metra. Jednak niezależnie od tego, jaką wysokość ma pomieszczenie, lampa Arette będzie odpowiednia, ponieważ jej przewody są regulowane. Transparentny kolor kloszy, nadaje uniwersalności jeśli chodzi o kolorystykę wnętrz. Jej zastosowanie, będzie odpowiednie zarówno w salonie jak i kuchni.', '', 'lampa-wiszaca-arette-zlota-3-x-e27-light-prestige', '', '', '', 'Lampa wisząca Arette złota 3 x E27 Light Prestige', '', '', '', ''),
(507, 1, 1, 'Devon to seria lamp wiszących, klosze o mieniącej się fakturze to nieprzewidywalny w swej formie element upiększający, a zarazem podkreślający wyjątkowość lampy. Zawieszone nad stołem w kuchni czy pokoju dziennym lampy Devon awansują do oświetlenia szczególnego rodzaju.', '', 'lampa-wiszaca-devon-3-x-e27-tk-lighting', '', '', '', 'Lampa wisząca Devon 3 x E27 Tk Lighting', '', '', '', ''),
(507, 1, 2, 'Devon to seria lamp wiszących, klosze o mieniącej się fakturze to nieprzewidywalny w swej formie element upiększający, a zarazem podkreślający wyjątkowość lampy. Zawieszone nad stołem w kuchni czy pokoju dziennym lampy Devon awansują do oświetlenia szczególnego rodzaju.', '', 'lampa-wiszaca-devon-3-x-e27-tk-lighting', '', '', '', 'Lampa wisząca Devon 3 x E27 Tk Lighting', '', '', '', ''),
(508, 1, 1, 'Lampa wisząca KINROSS to efektowne uzupełnienie wnętrza w stylu rystykalnym czy marynistycznym. Oryginalny kształt klatki mocowany na łańcuchu wspaniale ozdobi wnętrze.', '', 'lampa-wiszaca-kinross-brazowa-e27-eglo', '', '', '', 'Lampa wisząca Kinross brązowa E27 Eglo', '', '', '', ''),
(508, 1, 2, 'Lampa wisząca KINROSS to efektowne uzupełnienie wnętrza w stylu rystykalnym czy marynistycznym. Oryginalny kształt klatki mocowany na łańcuchu wspaniale ozdobi wnętrze.', '', 'lampa-wiszaca-kinross-brazowa-e27-eglo', '', '', '', 'Lampa wisząca Kinross brązowa E27 Eglo', '', '', '', ''),
(509, 1, 1, 'Kolekcja lamp JOKER polskiej marki MiLAGRO wyróżnia się prostymi, minimalistycznymi kloszami w formie walców o różnej wielkości. W przypadku lamp wiszących są one długie i smukłe (42,5 cm), natomiast w lampach sufitowych, podłogowych, nocnych i kinkietach mają formę reflektorków o długości 8,5 cm. Wszystkie klosze i ramiona wykonane są z najwyższej jakości metalu, dzięki czemu lampy nie tylko prezentują się stylowo, ale także są nadzwyczaj wytrzymałe. Lampy przystosowane są do źródeł światła typu GU10. Lampy JOKER – szlachetne oblicze minimalizmu Elegancka kolekcja lamp JOKER polskiej marki MiLAGRO to propozycja, która przyciąga spojrzenia umiejętnym połączeniem prostych, wąskich kloszy w kształcie walca ze szlachetnymi detalami. Ich cechą wspólną jest prosta, geometryczna forma kloszy, a także kolorystyka. Kolekcja lamp JOKER zaprojektowana została z myślą nowoczesnych przestrzeniach, w których eleganckie detale doskonale harmonizują z minimalistyczną całością. Lampy w jasnej odsłonie najlepiej prezentować się będą w luksusowych wnętrzach, w których króluje drewno, marmur, jasne płaszczyzny i miękkie materiały. Opcja czarna z chromowanymi, złotymi lub drewnianymi dodatkami może natomiast znakomicie wpisać się w nowoczesne przestrzenie, w tym również zawierające industrialne akcenty. Kolekcja JOKER – klasa sama w sobie Eleganckie lampy z kolekcji JOKER to propozycja, która zasługuje na uwagę nie tylko z powodu doskonałego designu i olbrzymiej różnorodności, ale również z powodu najwyższej jakości wykonania. Do produkcji oświetlenia z tej linii wykorzystano trwały i oporny na uszkodzenia metal, dzięki czemu lampy przetrwają w nienagannym stanie przez wiele lat.', '', 'lampa-wiszaca-joker-niebieska-3-x-gu10-milagro', '', '', '', 'Lampa wisząca Joker niebieska 3 x GU10 Milagro', '', '', '', ''),
