(512, 1, 1, 'Metalowe lampy z rodziny LINCOLN to idealne połączenie dobrego designu i funkcjonalności, z jednoczesnym zachowaniem zdrowego rozsądku. Najlepiej odnajdą się we wnętrzach minimalistycznych. Pozbawione różnego typu zdobień, wprowadzą w pomieszczeniu poczucie harmonii i uporządkowania, gdyż prostota jest miarą komfortu i często mniej oznacza więcej. Dobrze będą się również prezentować w aranżacjach klasycznych i nowoczesnych. Żyrandol warto zamieścić nad blatem użytkowym stołu lub wyspy kuchennej. Lampy wiszące LINCOLN to rewelacyjne rozwiązanie do salonu, kuchni oraz modnych lokalów użytkowych. Oszczędny w wyrazie projekt tych lamp wzbogacony został poprzeć pomalowanie wnętrza klosza na kolor złoty, nadając tym samym całej kolekcji szczyptę klasy i elegancji. W przypadku opisywanej kolekcji producent MiLAGRO zadbał również o to, aby lampy te miały zastosowanie zarówno w niskich jak i wysokich pomieszczeniach, umożliwiając regulację długości zwisu w zakresie 40-90 cm. Szerokie i otwarte od dołu klosze, dające dużo światła będą pasowały do większych pomieszczeń jako główny punkt oświetlenia. Kolekcja LINCOLN dostosowana jest do klasycznych żarówek typu E27.', '', 'lampa-wiszaca-lincoln-niebieska-e27-milagro', '', '', '', 'Lampa wisząca Lincoln niebieska E27 Milagro', '', '', '', ''),
(512, 1, 2, 'Metalowe lampy z rodziny LINCOLN to idealne połączenie dobrego designu i funkcjonalności, z jednoczesnym zachowaniem zdrowego rozsądku. Najlepiej odnajdą się we wnętrzach minimalistycznych. Pozbawione różnego typu zdobień, wprowadzą w pomieszczeniu poczucie harmonii i uporządkowania, gdyż prostota jest miarą komfortu i często mniej oznacza więcej. Dobrze będą się również prezentować w aranżacjach klasycznych i nowoczesnych. Żyrandol warto zamieścić nad blatem użytkowym stołu lub wyspy kuchennej. Lampy wiszące LINCOLN to rewelacyjne rozwiązanie do salonu, kuchni oraz modnych lokalów użytkowych. Oszczędny w wyrazie projekt tych lamp wzbogacony został poprzeć pomalowanie wnętrza klosza na kolor złoty, nadając tym samym całej kolekcji szczyptę klasy i elegancji. W przypadku opisywanej kolekcji producent MiLAGRO zadbał również o to, aby lampy te miały zastosowanie zarówno w niskich jak i wysokich pomieszczeniach, umożliwiając regulację długości zwisu w zakresie 40-90 cm. Szerokie i otwarte od dołu klosze, dające dużo światła będą pasowały do większych pomieszczeń jako główny punkt oświetlenia. Kolekcja LINCOLN dostosowana jest do klasycznych żarówek typu E27.', '', 'lampa-wiszaca-lincoln-niebieska-e27-milagro', '', '', '', 'Lampa wisząca Lincoln niebieska E27 Milagro', '', '', '', ''),
(513, 1, 1, 'Kolekcja lamp JOKER polskiej marki MiLAGRO wyróżnia się prostymi, minimalistycznymi kloszami w formie walców o różnej wielkości. W przypadku lamp wiszących są one długie i smukłe (42,5 cm), natomiast w lampach sufitowych, podłogowych, nocnych i kinkietach mają formę reflektorków o długości 8,5 cm. Wszystkie klosze i ramiona wykonane są z najwyższej jakości metalu, dzięki czemu lampy nie tylko prezentują się stylowo, ale także są nadzwyczaj wytrzymałe. Lampy przystosowane są do źródeł światła typu GU10. Lampy JOKER – szlachetne oblicze minimalizmu Elegancka kolekcja lamp JOKER polskiej marki MiLAGRO to propozycja, która przyciąga spojrzenia umiejętnym połączeniem prostych, wąskich kloszy w kształcie walca ze szlachetnymi detalami. Ich cechą wspólną jest prosta, geometryczna forma kloszy, a także kolorystyka. Kolekcja lamp JOKER zaprojektowana została z myślą nowoczesnych przestrzeniach, w których eleganckie detale doskonale harmonizują z minimalistyczną całością. Lampy w jasnej odsłonie najlepiej prezentować się będą w luksusowych wnętrzach, w których króluje drewno, marmur, jasne płaszczyzny i miękkie materiały. Opcja czarna z chromowanymi, złotymi lub drewnianymi dodatkami może natomiast znakomicie wpisać się w nowoczesne przestrzenie, w tym również zawierające industrialne akcenty. Kolekcja JOKER – klasa sama w sobie Eleganckie lampy z kolekcji JOKER to propozycja, która zasługuje na uwagę nie tylko z powodu doskonałego designu i olbrzymiej różnorodności, ale również z powodu najwyższej jakości wykonania. Do produkcji oświetlenia z tej linii wykorzystano trwały i oporny na uszkodzenia metal, dzięki czemu lampy przetrwają w nienagannym stanie przez wiele lat.', '', 'lampa-wiszaca-joker-niebieska-gu10-milagro', '', '', '', 'Lampa wisząca Joker niebieska GU10 Milagro', '', '', '', ''),
(513, 1, 2, 'Kolekcja lamp JOKER polskiej marki MiLAGRO wyróżnia się prostymi, minimalistycznymi kloszami w formie walców o różnej wielkości. W przypadku lamp wiszących są one długie i smukłe (42,5 cm), natomiast w lampach sufitowych, podłogowych, nocnych i kinkietach mają formę reflektorków o długości 8,5 cm. Wszystkie klosze i ramiona wykonane są z najwyższej jakości metalu, dzięki czemu lampy nie tylko prezentują się stylowo, ale także są nadzwyczaj wytrzymałe. Lampy przystosowane są do źródeł światła typu GU10. Lampy JOKER – szlachetne oblicze minimalizmu Elegancka kolekcja lamp JOKER polskiej marki MiLAGRO to propozycja, która przyciąga spojrzenia umiejętnym połączeniem prostych, wąskich kloszy w kształcie walca ze szlachetnymi detalami. Ich cechą wspólną jest prosta, geometryczna forma kloszy, a także kolorystyka. Kolekcja lamp JOKER zaprojektowana została z myślą nowoczesnych przestrzeniach, w których eleganckie detale doskonale harmonizują z minimalistyczną całością. Lampy w jasnej odsłonie najlepiej prezentować się będą w luksusowych wnętrzach, w których króluje drewno, marmur, jasne płaszczyzny i miękkie materiały. Opcja czarna z chromowanymi, złotymi lub drewnianymi dodatkami może natomiast znakomicie wpisać się w nowoczesne przestrzenie, w tym również zawierające industrialne akcenty. Kolekcja JOKER – klasa sama w sobie Eleganckie lampy z kolekcji JOKER to propozycja, która zasługuje na uwagę nie tylko z powodu doskonałego designu i olbrzymiej różnorodności, ale również z powodu najwyższej jakości wykonania. Do produkcji oświetlenia z tej linii wykorzystano trwały i oporny na uszkodzenia metal, dzięki czemu lampy przetrwają w nienagannym stanie przez wiele lat.', '', 'lampa-wiszaca-joker-niebieska-gu10-milagro', '', '', '', 'Lampa wisząca Joker niebieska GU10 Milagro', '', '', '', ''),
(514, 1, 1, 'PALAZZO z trzema źródłami światła to elegancka lampa wisząca. Oprawa wykonana jest z stali lakierowanej na czarno i trzech szklanych, białych kloszy. Lampę dopełniają elementy w złotym kolorze. Trzy źródła światła sprawią że lampa wisząca rozświetli wnętrze. PALAZZO sprawdzi się w salonie, przedpokoju, jadalni jak i w innych pomieszczeniach. Materiały z których lampa jest wykonana to gwarancja trwałości oprawy.', '', 'lampa-wiszaca-palazzo-czarna-3-x-e27-prezent', '', '', '', 'Lampa wisząca Palazzo czarna 3 x E27 Prezent', '', '', '', ''),
(514, 1, 2, 'PALAZZO z trzema źródłami światła to elegancka lampa wisząca. Oprawa wykonana jest z stali lakierowanej na czarno i trzech szklanych, białych kloszy. Lampę dopełniają elementy w złotym kolorze. Trzy źródła światła sprawią że lampa wisząca rozświetli wnętrze. PALAZZO sprawdzi się w salonie, przedpokoju, jadalni jak i w innych pomieszczeniach. Materiały z których lampa jest wykonana to gwarancja trwałości oprawy.', '', 'lampa-wiszaca-palazzo-czarna-3-x-e27-prezent', '', '', '', 'Lampa wisząca Palazzo czarna 3 x E27 Prezent', '', '', '', ''),
(515, 1, 1, 'Nowoczesna lampa wisząca Retro w kolorze czarnym Konstrukcja składa się z metalowych prętów, które tworzą niezwykły efekt wizualny. Model będzie świetną propozycją do oświetlenia barów, hoteli, sklepów lub przestrzeni mieszkalnej wprowadzając oldschoolowy klimat. Do lampy należy osobno dokupić dedykowaną żarówkę Retro z gwintem E27. Lampa może być montowana jako oświetlenie wewnętrzne lub zewnętrzne.', '', 'lampa-wiszaca-retro-czarna-e27-abigali', '', '', '', 'Lampa wisząca Retro czarna E27 Abigali', '', '', '', ''),
(515, 1, 2, 'Nowoczesna lampa wisząca Retro w kolorze czarnym Konstrukcja składa się z metalowych prętów, które tworzą niezwykły efekt wizualny. Model będzie świetną propozycją do oświetlenia barów, hoteli, sklepów lub przestrzeni mieszkalnej wprowadzając oldschoolowy klimat. Do lampy należy osobno dokupić dedykowaną żarówkę Retro z gwintem E27. Lampa może być montowana jako oświetlenie wewnętrzne lub zewnętrzne.', '', 'lampa-wiszaca-retro-czarna-e27-abigali', '', '', '', 'Lampa wisząca Retro czarna E27 Abigali', '', '', '', '');
