(34, 2, 'This module is not compatible with the multistore feature. It means that its configuration applies to all stores.', 'Ten moduł nie jest kompatybilny z funkcją multistore. Oznacza to, że jego konfiguracja dotyczy wszystkich sklepów.', 'AdminModulesFeature', NULL),
