(36, 2, 'This module is partially compatible with the multistore feature. Some of its options might not be available.', 'Ten moduł jest częściowo zgodny z funkcją multistore. Niektóre z jego opcji mogą nie być dostępne.', 'AdminModulesFeature', NULL),
(37, 2, 'or even activated for one store and deactivated for another.', 'lub nawet aktywowane dla jednego sklepu i dezaktywowane dla innego.', 'AdminModulesFeature', NULL),
(38, 2, 'configured quickly in the same way on all stores thanks to the all shops context or to the group of shops;', 'skonfigurowane szybko w ten sam sposób na wszystkich sklepach dzięki kontekstowi wszystkie sklepy lub grupa sklepów;', 'AdminModulesFeature', NULL),
(39, 2, 'configured differently from one store to another;', 'skonfigurowane w różny sposób w zależności od sklepu;', 'AdminModulesFeature', NULL),
