(77, 2, 'You have to select at least one shop to associate this item with', 'Musisz wybrać co najmniej jeden sklep, z którym chcesz powiązać ten przedmiot', 'AdminNotificationsError', NULL),
(78, 2, 'The file you are trying to upload is %2$d KB, which is larger than the maximum size allowed of %1$d KB.', 'Plik, który próbujesz przesłać ma rozmiar %2$d KB, czyli jest większy niż maksymalny dozwolony rozmiar %1$d KB.', 'AdminNotificationsError', NULL),
(79, 2, 'The email is already used, please choose another one', 'Ten e-mail jest już używany, proszę wybrać inny.', 'AdminNotificationsError', NULL),
(80, 2, 'Note that this page is available in a single shop context only. Switch context to work on it.', 'Zauważ, że ta strona jest dostępna tylko w kontekście pojedynczego sklepu. Przełącz kontekst, aby móc na niej pracować.', 'AdminNotificationsInfo', NULL),
(81, 2, 'This page is not yet compatible with the multistore feature. To access the page, please [1]disable the multistore feature[/1].', 'Ta strona nie jest jeszcze kompatybilna z funkcją multistore. Aby uzyskać dostęp do strony, proszę [1]wyłączyć funkcję multistore[/1].', 'AdminNotificationsInfo', NULL),
(82, 2, 'Note that this feature is available in all shops context only. It will be added to all your stores.', 'Zauważ, że ta funkcja jest dostępna tylko w kontekście wszystkich sklepów. Zostanie ona dodana do wszystkich Twoich sklepów.', 'AdminNotificationsInfo', NULL),
(83, 2, 'Note that this page is available in all shops context only, this is why your context has just switched.', 'Zauważ, że ta strona jest dostępna tylko w kontekście wszystkich sklepów, dlatego Twój kontekst właśnie się przełączył.', 'AdminNotificationsInfo', NULL),
(84, 2, '[1] products were successfully removed.', '[1] produkty zostały pomyślnie usunięte.', 'AdminNotificationsSuccess', NULL),
(85, 2, '[1] products were successfully added.', '[1] produkty zostały pomyślnie dodane.', 'AdminNotificationsSuccess', NULL),
(86, 2, 'The product was successfully removed.', 'Produkt został usunięty pomyślnie.', 'AdminNotificationsSuccess', NULL),
(87, 2, 'The product was successfully added.', 'Produkt został dodany pomyślnie.', 'AdminNotificationsSuccess', NULL),
(88, 2, 'Add an image before product name on delivery slip', 'Dodaj obraz przed nazwą produktu na dowodzie dostawy', 'AdminOrderscustomersHelp', NULL),
(89, 2, 'An order message with the same name already exists in %s.', 'Komunikat zamówienia o tej samej nazwie istnieje już w %s.', 'AdminOrderscustomersNotification', NULL),
(90, 2, 'Create carriers to let your customers choose their best shipping option in terms of delivery dates or fees. Start with editing/deleting the default \"My carrier\", and add as many options as you need.', 'Twórz przewoźników, aby pozwolić swoim klientom wybrać najlepszą opcję wysyłki pod względem terminów dostawy lub opłat. Zacznij od edycji / usunięcia domyślnego \"Mojego przewoźnika\" i dodaj tyle opcji, ile potrzebujesz.', 'AdminShippingFeature', NULL),
(91, 2, 'Manage your carriers', 'Zarządzaj przewoźnikami', 'AdminShippingFeature', NULL),
(92, 2, 'If there is no existing module for your carrier, you can register it manually by clicking on \"[1]\" but before, please make sure you did not register a new carrier if a module already exists for it!', 'Jeśli nie ma istniejącego modułu dla Twojego przewoźnika, możesz go zarejestrować ręcznie, klikając na \"[1]\", ale wcześniej upewnij się, że nie zarejestrowałeś nowego przewoźnika, jeśli moduł już dla niego istnieje!', 'AdminShippingHelp', NULL),
(93, 2, 'You need to register all the carriers with which you have chosen to work. PrestaShop comes with a selection of carrier modules you can install right below the page or buy on [1]Addons marketplace[/1].', 'Musisz zarejestrować wszystkich przewoźników, z którymi zdecydowałeś się pracować. PrestaShop posiada wybór modułów nośników, które możesz zainstalować bezpośrednio pod stroną lub kupić na [1]Addons marketplace[/1].', 'AdminShippingHelp', NULL),
(94, 2, 'Your shop\'s default carrier.', 'Domyślny przewoźnik dla twojego sklepu', 'AdminShippingHelp', NULL),
(95, 2, 'An error occurred while updating the free shipping status.', 'Podczas aktualizacji statusu bezpłatnej wysyłki wystąpił błąd.', 'AdminShippingNotification', NULL),
(96, 2, 'Display unavailable attributes on the product page', 'Wyświetlaj niedostępne atrybuty na stronie produktu', 'AdminShopparametersFeature', NULL),
(97, 2, 'Display out-of-stock label on product listing pages', 'Wyświetlaj etykietę o wyczerpaniu zapasów na stronach z listą produktów', 'AdminShopparametersFeature', NULL),
(98, 2, 'Set the order as in transit.', 'Ustaw zamówienie jako w tranzycie.', 'AdminShopparametersFeature', NULL),
(99, 2, 'Enable store', 'Włącz sklep', 'AdminShopparametersFeature', NULL),
(100, 2, 'It will only be applied to this group of shops, each store will keep its individual color.', 'Będzie on stosowany tylko do tej grupy sklepów, każdy sklep zachowa swój indywidualny kolor.', 'AdminShopparametersFeature', NULL),
(101, 2, 'It will only be applied to the multistore header to highlight your shop context.', 'Zostanie on zastosowany tylko w nagłówku multistore, aby podkreślić kontekst Twojego sklepu.', 'AdminShopparametersFeature', NULL),
(102, 2, 'If an attribute is not available in every product combination, it will not be displayed.', 'Jeśli atrybut nie jest dostępny w każdej kombinacji produktów, nie będzie on wyświetlany.', 'AdminShopparametersHelp', NULL),
(103, 2, 'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.', 'Włącz tę opcję, jeśli chcesz zezwolić na akcentowane znaki w przyjaznych adresach URL. Powinieneś aktywować tę opcję tylko wtedy, gdy używasz znaków innych niż łacińskie; dla wszystkich łacińskich zestawów znaków, twoje SEO będzie lepsze bez tej opcji.', 'AdminShopparametersHelp', NULL),
(104, 2, 'Note that the label will be displayed only if backorders are denied.', 'Należy pamiętać, że etykieta zostanie wyświetlona tylko w przypadku odmowy przyjęcia backorderów.', 'AdminShopparametersHelp', NULL),
(105, 2, 'Display a customized message when the store is disabled.', 'Wyświetlanie niestandardowego komunikatu, gdy sklep jest wyłączony.', 'AdminShopparametersHelp', NULL),
(106, 2, 'Allow IP addresses to access the store, even in maintenance mode. Use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96).', 'Zezwól adresom IP na dostęp do sklepu, nawet w trybie konserwacji. Użyj przecinka, aby je oddzielić (np. 42.24.4.2,127.0.0.1,99.98.97.96).', 'AdminShopparametersHelp', NULL),
(107, 2, 'We recommend that you deactivate your store while performing maintenance. Note that it will not disable the webservice.', 'Zalecamy dezaktywację sklepu podczas przeprowadzania konserwacji. Zauważ, że nie spowoduje to wyłączenia usługi webservice.', 'AdminShopparametersHelp', NULL),
(108, 2, 'Send an email with a summary of the account information after registration.', 'Wyślij e-mail z podsumowaniem informacji o koncie po rejestracji.', 'AdminShopparametersHelp', NULL),
(109, 2, 'An order status with the same name already exists: %s', 'Status zamówienia o tej samej nazwie już istnieje: %s', 'AdminShopparametersNotification', NULL),
(110, 2, 'The Base URI is not valid.', 'Bazowy URI jest nieprawidłowy.', 'AdminShopparametersNotification', NULL),
(111, 2, ': ', ':', 'ShopPdf', NULL),
(112, 2, 'Make it easy for your visitors to find their way on your store, select the right link and turn it into a menu item.', 'Ułatw odwiedzającym znalezienie drogi w Twoim sklepie, wybierz odpowiedni link i zamień go w pozycję menu.', 'ModulesMainmenuAdmin', NULL),
(113, 2, 'Enrich your stats, add graphics presenting the evolution of your sales and orders.', 'Wzbogać swoje statystyki, dodaj grafiki prezentujące rozwój sprzedaży i zamówień.', 'ModulesStatssalesAdmin', NULL),
(114, 2, 'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track.', 'Całkowita liczba utworzonych kont nie jest sama w sobie ważną informacją. Korzystne jest jednak przeanalizowanie liczby utworzonych w czasie. Wskaże to, czy sprawy są na dobrej drodze, czy nie.', 'ModulesStatsregistrationsAdmin', NULL),
(115, 2, 'Sell your first product quicker than you would have expected with our nice onboarding process.', 'Sprzedaj swój pierwszy produkt szybciej niż byś się spodziewał dzięki naszemu przyjemnemu procesowi onboardingu.', 'ModulesWelcomeAdmin', NULL),
(116, 2, 'Offer your customers the possibility to buy matching items when on a product page.', 'Zaoferuj swoim klientom możliwość zakupu pasujących elementów, gdy są na stronie produktu.', 'ModulesCrosssellingAdmin', NULL),
(117, 2, 'There was an error during the uninstallation. Please <a href=\"https://github.com/PrestaShop/PrestaShop/issues\">open an issue</a> on the PrestaShop project.', 'Wystąpił błąd podczas odinstalowywania. <a href=\"https://github.com/PrestaShop/PrestaShop/issues\">Otwórz issue</a> w projekcie PrestaShop.', 'ModulesBlockreassuranceAdmin', NULL),
(118, 2, 'There was an error during the installation. Please <a href=\"https://github.com/PrestaShop/PrestaShop/issues\">open an issue</a> on the PrestaShop project.', 'Wystąpił błąd podczas instalacji. <a href=\"https://github.com/PrestaShop/PrestaShop/issues\">Otwórz issue</a> w projekcie PrestaShop.', 'ModulesBlockreassuranceAdmin', NULL),
(119, 2, 'Connect with your visitors and reassure them about secure payment, free shipping or returns.', 'Połącz się ze swoimi odwiedzającymi i zapewnij ich o bezpiecznych płatnościach, darmowej wysyłce lub zwrotach.', 'ModulesBlockreassuranceAdmin', NULL),
(120, 2, 'There was an error during the uninstallation. Please contact us through Addons website.', 'Podczas odinstalowywania wystąpił błąd. Prosimy o kontakt poprzez stronę Addons.', 'ModulesBlockreassuranceAdmin', NULL),
(121, 2, 'Give more visibility to your content/static pages (CMS, external pages, or else), where you want and when you want, to make your visitors feel like shopping on your store.', 'Daj większą widoczność swoim treściom/stronom statycznym (CMS, strony zewnętrzne lub inne), gdzie chcesz i kiedy chcesz, aby odwiedzający poczuli się jak na zakupach w Twoim sklepie.', 'ModulesLinklistAdmin', NULL),
(122, 2, 'Please choose a shop to edit the social media links.', 'Proszę wybrać sklep do edycji linków do mediów społecznościowych.', 'ModulesSocialfollowAdmin', NULL),
(123, 2, 'Facebook, Twitter, let your customers know where to follow you and increase your community.', 'Facebook, Twitter - niech Twoi klienci wiedzą, gdzie Cię śledzą i zwiększają swoją społeczność.', 'ModulesSocialfollowAdmin', NULL),
(124, 2, 'Enable the NVD3 charting code for your own uses, providing you with ever so useful graphs.', 'Włącz kod do tworzenia wykresów NVD3 do własnych zastosowań, dostarczając tak użyteczne wykresy.', 'ModulesGraphnvd3Admin', NULL),
(125, 2, 'Criterions not available', 'Kryteria nie są dostępne', 'ModulesProductcommentsShop', NULL),
(126, 2, 'Enrich your stats, add a registration progress tab to analyze your visitors’ behavior.', 'Wzbogać swoje statystyki, dodaj zakładkę postępu rejestracji, aby analizować zachowanie odwiedzających.', 'ModulesCustomeraccountlinksAdmin', NULL),
(127, 2, 'Enrich your stats, have a look at your catalog’s general statistics.', 'Wzbogać swoje statystyki, zajrzyj do ogólnych statystyk swojego katalogu.', 'ModulesStatscatalogAdmin', NULL),
(128, 2, 'Add sliding images to your homepage to welcome your visitors in a visual and friendly way.', 'Dodaj obrazy przesuwne do swojej strony głównej, aby powitać swoich gości w wizualny i przyjazny sposób.', 'ModulesImagesliderAdmin', NULL),
(129, 2, 'Enrich your stats, display the pages requested by your visitors that could not be found.', 'Wzbogać swoje statystyki, wyświetl strony żądane przez odwiedzających, które nie mogły zostać znalezione.', 'ModulesPagesnotfoundAdmin', NULL),
(130, 2, 'Display a shopping cart icon on your pages and the number of items it contains.', 'Wyświetl ikonę koszyka na swoich stronach i liczbę przedmiotów, które zawiera.', 'ModulesShoppingcartAdmin', NULL),
(131, 2, 'Filter your catalog to help visitors picture the category tree and browse your store easily.', 'Filtruj swój katalog, aby pomóc odwiedzającym zobrazować drzewo kategorii i łatwo przeglądać swój sklep.', 'ModulesFacetedsearchAdmin', NULL),
(132, 2, 'You need to choose a specific shop to display the top 10 most added products', 'Musisz wybrać konkretny sklep, aby wyświetlić 10 najczęściej dodawanych produktów', 'ModulesBlockwishlistAdmin', NULL),
(133, 2, 'Allow customers to create wishlists to save their favorite products for later.', 'Pozwól klientom tworzyć listy życzeń, aby zapisać swoje ulubione produkty na później.', 'ModulesBlockwishlistAdmin', NULL),
(134, 2, 'The product will be removed from \"%nameofthewishlist%\".', 'Produkt zostanie usunięty z \"%nameofthewishlist%\".', 'ModulesBlockwishlistShop', NULL),
(135, 2, 'Delete wishlist', 'Usuń listę życzeń', 'ModulesBlockwishlistShop', NULL),
(136, 2, 'Remove product from wishlist', 'Usuń produkt z listy życzeń', 'ModulesBlockwishlistShop', NULL),
(137, 2, 'Product successfully updated', 'Produkt został pomyślnie zaktualizowany', 'ModulesBlockwishlistShop', NULL),
(138, 2, 'Product successfully removed', 'Produkt został pomyślnie usunięty', 'ModulesBlockwishlistShop', NULL),
(139, 2, 'There was an error while adding the product attributes', 'Podczas dodawania atrybutów produktu wystąpił błąd', 'ModulesBlockwishlistShop', NULL),
(140, 2, 'Enrich your stats, add information about your registered customers and learn more about them!', 'Wzbogać swoje statystyki, dodaj informacje o zarejestrowanych klientach i dowiedz się o nich więcej!', 'ModulesStatspersonalinfosAdmin', NULL),
(141, 2, 'Help your visitors find what they are looking for, add a quick search field to your store.', 'Pomóż odwiedzającym znaleźć to, czego szukają, dodaj do swojego sklepu pole szybkiego wyszukiwania.', 'ModulesSearchbarAdmin', NULL),
(142, 2, 'Contact us', 'Kontakt', 'ModulesContactinfoShop', NULL),
(143, 2, 'Recycled packaging:', 'Opakowania z recyklingu:', 'EmailsBody', NULL),
(144, 2, 'Review this credit slip and download it on our shop, go to the <a href=\"{order_slip_url}\" target=\"_blank\">%credit_slips_label%</a> section of your customer account.', 'Przejrzyj ten dowód zakupu i pobierz go w naszym sklepie, przejdź do sekcji <a href=\"{order_slip_url}\" target=\"_blank\">%credit_slips_label%</a> na swoim koncie klienta.', 'EmailsBody', NULL),
(145, 2, 'Enrich your stats, give your catalog a quick evaluation to better analyze your activity.', 'Wzbogać swoje statystyki, nadaj swojemu katalogowi szybką ocenę, aby lepiej przeanalizować swoją aktywność.', 'ModulesStatscheckupAdmin', NULL),
(146, 2, 'Instagram, YouTube, gather your community with social media sharing buttons on product pages.', 'Instagram, YouTube, Zbierz swoją społeczność dzięki przyciskom udostępniania w mediach społecznościowych na stronach produktów.', 'ModulesSharebuttonsAdmin', NULL),
(147, 2, 'Give your visitors extra information, display a customized block of content on your homepage.', 'Daj swoim gościom dodatkowe informacje, wyświetl niestandardowy blok treści na swojej stronie głównej.', 'ModulesCustomtextAdmin', NULL),
(148, 2, 'Custom text block', 'Własny blok tekstowy', 'ModulesCustomtextAdmin', NULL),
(149, 2, 'Keep in touch with your customers the way you want, add a form to the homepage of your store and allow all the curious to subscribe to your newsletter.', 'Utrzymuj kontakt ze swoimi klientami w taki sposób, w jaki chcesz, dodaj formularz na stronie głównej swojego sklepu i pozwól wszystkim ciekawskim zapisać się na Twój newsletter.', 'ModulesEmailsubscriptionAdmin', NULL),
(150, 2, 'Reassure your customers, display a short notice to let them know you care about privacy.', 'Uspokój swoich klientów, wyświetl krótkie powiadomienie, aby dać im znać, że dbasz o prywatność.', 'ModulesDataprivacyAdmin', NULL),
(151, 1, 'The personal data you provide is used to answer queries, process orders or allow access to specific information. You have the right to modify and delete all the personal information found in the \"My Account\" page.', 'The personal data you provide is used to answer queries, process orders or allow access to specific information. You have the right to modify and delete all the personal information found in the \"My Account\" page.', 'ModulesDataprivacyAdmin', NULL),
(152, 2, 'You may unsubscribe at any moment. For that purpose, please find our contact info in the legal notice.', 'Możesz zrezygnować w każdej chwili. W tym celu należy odnaleźć szczegóły w naszej informacji prawnej.', 'ModulesEmailsubscriptionShop', NULL);
